INSERT INTO `author` VALUES (8,'Radosław','Pawluczuk','Flaw:\nPerson1 (ja):\nnieogarniety -> kompletnie nie ogarniam co się dookoła mnie dzieje, często wręcz głupi\n    1. Moi znajomi uważają, że jestem nie ogarnięty ale nie ogarniam dlaczego\n    2. Kiedyś nie ogarnąłem, że od dwóch lat jeżdżę na nieważnym prawku i dopiero przy piątym złapaniu przez policję się skapnąłem\n    3. Nie ogarniam do tego stopnia, że jak kiedyś leżałem w łóżku z dziewczyną i całowaliśmy się, było fajnie i ona w pewnym momencie powiedziała, że jest rozpalona to jej gripex dałem bo myślałem, że jest chora\nleniwy -> Nierobienie to moja ukochana aktywność\n    1. Ja jestem leniwy i kocham odpoczywać i ja dlatego całe życie odpoczywam. Nawet jak ciężko pracuję to dlatego bo odpoczywam sobie od odpoczywania.\n    2. Ja lubię przyjeżdżać do domu bo wtedy nic nie muszę robić, moja mama wtedy robi wszystko za mnie i bardzo sobie ją chwale. Mój szef zresztą też.\n    3. \nniepewny -> Przerażony i bojący się własnego cienia\npanikujacy -> Gdy coś się dzieje nie po mojej myśli  to zakłądam zawsze najgorsze i zrobię wszystko by doprowadzić do stabilazcji\nuparty -> Nie docierają do mnie, żadne argmenty. Mam jakieś spojrzenie na sytuacje, które jest bezsensowne ale i tak przy nim trwam bo mam zbyt wysokie ego\n\nPerson2 (mama):\nuparty\nleniwy\npanikujacy\nrozkojarzony\nłatwowierny\n\nBlind Spot:\nJestem pogodnym i dobrym człowiekiem, a świat to trudne miejsce pełne zła. \nWszystkie przykrości, które mnie spotykają to nie moja wina tylko złego świata.\nMam bardzo dojrzały i interesujący światopogląd.\n','2020-10-31 23:18:01','2022-01-17 16:52:05'),(9,'Wojciech','Fiedorczuk','','2020-11-07 11:36:16','2021-01-02 00:15:30'),(11,'Anthony','Jeselnik','Postać:\nZimna, bezwględna, psychopatyczna, opanowana, pewna siebie, spokojna\n\nPlusy:\n+ rozbudowane one linery\n+ mocne żarty\n+ tematyka inna niż tylko seks (patologia, śmierć, przemoc)\n+ błyskotliwe puenty\n+ Budowanie napięcia\n+ Wtrącanie swojej opinii, przemyśleń o opisywanie swoich emocji w one linerach\n+ Dosyć udane zbudowanie charakterystycznej postaci\n\nMinusy:\n+ Kamienna twarz, prawie bez uśmiechu\n+ Nie ma w mówieniu i gestykulacji wyrażania emocji\n+ Trochę monotonne\n+ Niektóe wstawki po żartach są nietrafne i wydają się być przygotowane na wypadek jakby ludzie się nie śmiali\n+ Brakuje spójnej historii, każdy oneliner to tak naprawdę oddzielny żart\n','2020-11-20 21:45:34','2021-10-06 20:07:41'),(17,'Cezary','Jurkiewicz','','2021-10-06 17:44:52','2021-10-06 17:44:52'),(18,'Autor','Nieznany','','2021-11-26 13:32:13','2021-11-26 13:32:13');
