INSERT INTO `categorization` VALUES (2,'Miejsce -> Osoba',381,'Kto tam się znajduje?\nDo kogo należy te miejsce?',429,429,'2021-10-26 13:43:29.315000','2021-10-14 09:42:02.305000'),(3,'Czynność -> Miejsce',584,'Gdzie czynność jest możliwa do wykonania?\nCzy czynność powinna być wykonywana publicznie?\nSkąd?',381,381,'2021-10-21 13:01:57.745000','2021-10-14 09:46:07.533000'),(4,'Czynność -> Powód',584,'Jaki może być powód wykonywania tej czynności?',639,639,'2021-10-21 12:53:49.640000','2021-10-14 09:56:23.389000'),(5,'Rzecz -> Rodzaj',636,'Jaki rodzaj?\nJaki dokładnie? Jaka dokładnie?',638,638,'2021-10-21 12:47:28.657000','2021-10-14 10:01:15.841000'),(6,'Czynność -> Wyolbrzymiona emocja & Trywializm',584,'Jakie emocje może wzbudzać dana czynność?\nCo jest podstawą tej czynności?\nJaki trywializm jest przeciwstawny do czynności?',623,625,'2021-10-21 11:30:29.829000','2021-10-14 10:06:20.126000'),(7,'Czynność -> Osoba',584,NULL,429,429,'2021-10-15 09:58:55.485000','2021-10-14 10:07:31.344000'),(9,'Zarzut -> Rzekomy dowód & Ukryty dowód',444,'Na jakiej podstawie się coś zarzuca?\nCo stanowi rzekomy dowód?\nCo stanowi ukryty dowód?\nCo się dzieje w tle rzekomego dowodu?',584,584,'2021-11-18 15:11:57.918000','2021-10-21 12:03:30.565000'),(10,'Osoba -> Osoba',429,'Kim jest dana osoba?\nJaka jest relacja z daną osobą?',429,429,'2021-10-21 12:58:40.022000','2021-10-21 12:58:40.022000'),(11,'Osoba -> Czynność',429,'Jakiego zachowania można się spodziewać?\nJakiego zachowania nie można sie spodziewać?',584,584,'2021-10-21 13:19:20.459000','2021-10-21 13:19:20.459000'),(12,'Osoba -> Cecha',429,'Jaka jest dana osoba?\nJakie posiada cechy?',641,641,'2021-10-21 13:29:15.343000','2021-10-21 13:28:21.679000'),(13,'Rzecz -> Stan',636,'Jaki może być stan tego przedmiotu?',618,618,'2021-10-21 13:34:32.485000','2021-10-21 13:34:32.485000'),(14,'Cecha -> Osoba',641,'Kto może posiadać daną cechę?',429,429,'2021-10-21 13:38:12.694000','2021-10-21 13:38:12.694000'),(15,'Czynność -> Czynność',584,'Jaka czynność może być następstwem tej czynności?\nJaki to jest dokładnie rodzaj tej czynności (doprecyzowanie)?\n',584,584,'2021-10-26 12:33:18.650000','2021-10-21 13:52:47.891000'),(16,'Miejsce -> Czynność',381,'Co się w tym miejscu wydarzyło?\nJaki był cel przebywania w tym miejscu?',584,584,'2021-10-26 12:20:52.233000','2021-10-26 12:20:52.233000'),(17,'Rzecz -> Czynność',636,'Co z tą rzecz można zrobić?',584,584,'2021-10-26 12:25:55.512000','2021-10-26 12:25:55.512000'),(18,'Zarzut -> Zaprzeczenie & Potwierdzenie',444,'Co można komuś zarzucić?\nCo może stanowić o fałszywości zarzutu?\nCo może stanowić o prawdziwości zarzutu?\nCzemu ktoś kłamie?\nCo mogłoby udowodnić czyjąć winę?',661,662,'2021-10-27 13:12:41.862000','2021-10-26 13:20:31.623000'),(19,'Zdarzenie -> Emocja',665,'Jakie emocje powinno te zdarzenie wywołać?\nJakich emocji nie powinno wywoływać?',623,623,'2021-10-27 13:09:30.897000','2021-10-27 13:08:51.152000'),(20,'Czynność -> Wypadek & Premedytacja',584,'W jakich okolicznościach czynność mogła być niechcianym wypadkiem?\nCo by potwierdziło, że czynność mogłaby być wykonana z premedytacją?',392,535,'2021-10-27 13:19:36.329000','2021-10-27 13:19:12.838000'),(21,'Czynność -> Stan',584,'Jaki jest domyślny warunek zrealizowania tej czynności?\nJaki jest przewidywany stan przy którym ta czynność następuje?',618,618,'2021-10-27 13:29:01.511000','2021-10-27 13:29:01.511000'),(22,'Rzecz -> Osoba',636,'Kto jest właścicielem?',429,429,'2021-10-27 13:51:36.654000','2021-10-27 13:51:36.654000'),(23,'Osoba -> Miejsce',429,'Gdzie ta osoba powinna się znajdować?',381,381,'2021-10-28 07:36:07.757000','2021-10-28 07:36:07.757000'),(24,'Powiedzenie -> Interpretacja',680,'Co to powiedzenie oznacza?\nCo to może oznaczać jak potraktuje się je dosłownie?\nJakie jest inne spojrzenie?',681,681,'2021-10-28 14:09:44.348000','2021-10-28 14:09:44.348000'),(25,'Słowo -> dwa znaczenia',NULL,NULL,NULL,NULL,'2021-11-04 20:27:12.842000','2021-11-04 20:27:12.842000');
