INSERT INTO `joke` VALUES (45,8,'2020-10-31 23:13:01','2021-11-18 15:11:19','Chyba gej','Mogę się mylić...\nale Wydaje mi się, że mój współlokator jest gejem... \nW sensie tak myślę, że to jest gej bo ostatnio jak się przelizaliśmy to powiedział mi, że mnie kocha...',6,1),(46,8,'2020-11-01 19:16:27','2021-11-18 15:14:49','Puszczanie kaczek','Kiedyś jak miałem problem to zbierałem kamienie, chodziłem nad wodę i z całej siły puszczałem kaczki.\nAle teraz nie jest to już takie proste. \nOstatnio właśnie jak nazbierałem kamieni, poszedłem nad wodę i zacząłem puszczać kaczki to nagle ludziom zaczęło to przeszkadzać.\nI to do tego stopnia, że ratownik wypierdolił mnie z basenu.',6,1),(48,8,'2020-11-03 23:08:22','2021-10-21 09:37:51','Chowanie się do szafy','Nigdy nie miałem lekko... Jak byłem mały i mieszkałem z rodzicami to moja mama raz w miesiącu miała taki czas, że stawała się bardzo agresywna. Ja się wtedy bardzo jej bałem i chowałem się do szafy. I pamiętam jak dzisiaj jak ona chodzi po tym mieszkaniu i tupając nogami mnie szuka: \n- Gdzie jesteś? Gdzie jesteś? Wyłaź! \nJa tam wystraszony ale siedzę cicho. A ona dalej: \n- Gdzie jesteś? Chodź tu gnojku jeden! Pokaż się! \nMi już się łapki trzęsą z strachu ale siedzę cicho. \n- No gówniarzu jeden gdzie jesteś? Czekaj niech no tylko ojciec do domu wróci!!\n I ja już właśnie miałem się rozpłakać, kiedy z drugiego kąta szafy ojciec do mnie: Ciiiii...',6,1),(49,8,'2020-11-05 20:21:15','2021-10-21 11:41:32','Nietypowa randka','Zainstalowałem sobie tindera jakiś czas temu i to fajnie bo chodzę sobie na randki dzieki temu. \nI ostatnio byłem na bardzo nietypowej randce bo dziewczyna kompletnie mnie zaskoczyła... \nBo zrobiła coś czego jeszcze nie zrobiła żadna inna dziweczyna... \nPrzyszła.',6,1),(50,8,'2020-11-06 23:22:29','2021-10-21 12:17:33','Wstydliwa sytuacja','Ostatnio nie gadam za dużo z swoim współlokatorem Danielem. \nJest między nami niezręcznie bo miałem z nim dosyć wstydliwą sytuację... \nBo Daniel nakrył mnie na masturbacji. \nByło mi wtedy bardzo wstyd. \nI kompletnie nie spodziewałem się, że spotkam go w tramwaju.',0,NULL),(51,9,'2020-11-07 11:34:20','2021-10-21 12:51:52','Świąteczna atmosfera','W ogóle tu jak wszedłem na scene to poczułem się tak jakoś tak bardzo fajnie, poczułem taki miły zapach alkoholu i wymiocin. Co od razu przywołało mi to wspomnienia. Ciepła rodzinnego domu, dzieciństwa, świąt. Pamiętam te niebieskie migające lampki na niebieskich samochodzikach i ojciec tak prowadzony: Zabije was kurwa puśćcie mnie!',0,NULL),(52,8,'2020-11-08 23:06:53','2021-10-21 12:56:05','Pierwsze kontakty w Białymstoku','Do Białegostoku przeprowadziłem się na studia i spędziłem tam siedem lat. Było to siedem cudownych lat.  \nBo tam miałem swoje pierwsze kontakty z narkotykami... \nPotem pierwsze kontakty seksualne... \nNo bo wiadomo na narkotyki jakoś musiałem zarabiać.',0,NULL),(53,8,'2020-11-08 23:18:42','2021-10-21 12:59:54','Ojciec mnie uderzył','Ostatnio ojciec uderzył mnie w twarz i powiedział, że mnie nienawidzi... \nAle powiem wam, że w sumie to mam w to wyjebane. \nBo to nie był mój ojciec tylko jakiegoś pięciolatka co mu kopa sprzedałem.',0,NULL),(55,8,'2020-11-09 22:22:36','2021-10-21 13:01:35','Agresywny Białostoczanin','W Białymstoku jest bardzo dużo agresji. \nRaz właśnie podbił do mnie tam typek, pierwszy raz gościa na oczy widzę i mówi do mnie: \n- Wypierdalaj! \nJa do niego: \n- Gościu ochłoń przecież nawet Cię nie znam. \nA on do mnie dalej: \n- Wypierdalaj! \nI co z nim nie próbowałem jakoś spokojnie porozmawiać to on do mnie, że mam wypierdalać. \nW końcu już tam machnąłem ręką i wyszedłem z jego mieszkania.',0,NULL),(60,8,'2020-11-17 11:02:39','2021-10-21 13:05:41','Nie lubię psychologów','Bardzo nie lubię psychologów, a to, że ich nie lubię jest powodem dla którego chodzę na standupy. \nBo tutaj mogę za darmo poopowiadać o swoich problemach... \nKażdy mnie tu zawsze wysłucha... \nI nikt się nie śmieje nigdy.',5,1),(61,8,'2020-11-17 12:18:36','2021-10-21 13:11:16','Dzwoni telefon','Zadzwonił do mnie telefon, a tam słyszę w słuchawce:\n- ooo siema Radek! W końcu jestem singlem, uwolniłem się od tej swojej. Teraz możemy zacząć pić, możemy zacząć ćpać, możemy zacząć ruchać dupy! \nA ja na to mówię, że: \n- Nie, nie, nie mogę. W żałobie jestem po śmierci babci... A poza tym dziadku... Byś się kurwa wstydził!',6,1),(63,8,'2020-11-17 21:15:55','2021-10-21 13:21:25','Pilnowanie kotka','Bliskim trzeba zawsze pomagać dlategoteż, kiedy siostra poprosiła mnie czy nie popilnowałbym jej kotka - bo ona tam z szwagrem szła na jakiś melanż, to ja oczyiście się zgodziłem i przyjechałem z Białegostoku do Warszawy by tego kotka jej popilnować.\nI kotek jak to tam kotek, chodził sobie swoimi ścieżkami. Mi się trochę nudziło bo tyle co na krześle siedziałem to uznałem, że zagadam do kotka i pytam się go czy miał dobry dzień, a on mi na to że:\n- Miał\nNo nieźle myślę sobie i zagaduje go dalej. Pytam się go czyyy miałł okazję być w Francji? A on mi na to, że:\n- Miał\nO kurde, myślę sobie, że zajebisty ten kotek i mówię do niego, że jest mega interesujący i już dawno chciałem go poznać bo zawsze mega fajny wydawał mi się być... I pytam się go czy on też tak miał\nA on wtedy spojrzał się tak na mnie, tak się wyprostował i mówi:\n- Nie. Ani trochę.\n',6,1),(64,8,'2020-11-18 18:04:11','2021-10-21 13:23:07','Wyłudzanie w Warszawie','W Warszawie nie podoba mi się takie wszechobecne cwaniactowo. Tutaj dosłownie na każdym kroku ktoś próbuje wyłudzić ode mnie pieniądze.\nNie tak dawno podbił do mnie taki właśnie gagatek i pyta się czy mam 20 złotych. Ja na to:\n- Nie mam.\n- Kolego to chociaż może dychę\nJa na to dalej:\n- Nie mam.\n- Kierowniku to przynajmniej mi piątke daj\nJa na to twardo odpowiadam:\n- Nie. Nie dam Ci żadnych pieniędzy.\nI to już podziałało bo ksiądz z tacą poszedł dalej.',6,1),(65,8,'2020-11-19 22:11:24','2021-10-21 13:30:02','Rady ojca','W życiu zawsze z zmianami pomagał mi mój tata.\nKiedy byłem w liceum pytam się go:\n- Tato jestem w liceum, co dalej mam zrobić z swoim życiem?\n- Zdaj dobrze maturę, a potem pójdź na studia\nTo ja tak zrobiłem:\n- Tato co teraz?\n- Teraz z kolei zrób inżynierkę, a potem magisterkę.\nTo ja tak zrobiłem:\n- Co dalej tato?\n- Teraz jest moment w którym musisz pójść do pracy. Nie będzie to dobrze płatna praca ale będzie. Nabedzięsz doświadczenia, będzie ok.\nTo ja tak zrobiłem i dwa lata spędziłem w tej pracy i przychodzę do taty:\n- Tato już dwa lata jestem w tej pracy. Nie lubię jej, słabo mi płacą, nie szanują mnie tam. Co dalej mam zrobić z swoim życiem?\nNa co ojciec spojrzał się na mnie:\n- Synu, synu, synu... Ja już Ci nie pomogę... Jestem kurwa na tym samym etapie...',5,1),(66,8,'2020-11-20 21:31:59','2021-10-21 13:33:05','Dresik z nożem','Raz w Białymstoku podbił do mnie dresik, wyciągnął nóż i mnie ciapnął w brzuch. Już się miałem na niego zdenerwować kiedy widzę, że zaczyna płakać. Szkoda mi się go zrobiło to mówie do niego:\n- Nie no stary nie przejmuj się. Każdemu się może zdarzyć\n- Nie, nie, nie kolego. Ty mnie źle zrozumiałeś. Ja po prostu zawsze płaczę jak cebulę kroję',0,NULL),(67,11,'2020-11-20 21:45:11','2021-10-27 13:30:36','Dziecko zamknięte w samochodzie','Poszedłem się dziś przejść.\nZobaczyłem dziecko.\nByło zamknięte z tyłu rozgrzanego samochodu.\nTo był wspaniały dzień.\nPodobał mi się.\nNie zrozumcię mnie źle. Nie jestem potworem. Próbowałem pomóc dziecku.\nRzuciłem w szybę kamieniem.\nAle okno było otwarte',6,1),(68,11,'2020-11-20 21:53:35','2021-10-21 13:39:11','Kobiety z San Franciso','Kocham San Franciso.\nNajbardziej podobają mi się w tym mieście kobiety.\nKobiety w San Franciso są przecudne.\nStwierdzam to mimo tego, co mamy dziś na widowni.',4,1),(69,11,'2020-11-20 22:10:29','2021-10-21 13:42:13','Pies sam w domu','Tak, mam niezłe mieszkanie.\nStaram się trzymać w nim porządek.\nNie zawsze się to udaje.\nKiedyś kupiłem sobie pieska.\nTo była katastrofa.\nMusiałem się go pozbyć.\nMusiałem zrobić to natychmiast.\nJak tylko zostawiłem go samego... \nGdy pierwszy raz został sam w domu, poszarpał wszystko na strzępy, wszędzie nasrał i do tego zdechł z głodu.',6,1),(70,11,'2020-11-20 22:22:06','2021-10-21 14:01:05','Podlewanie kwiatków dziewczyny','Moja dziewczyna strasznie się na mnie wściekła.\nWściekła się, bo uśmierciłem jej rośliny doniczkowe.\nPrzeze mnie zdechły co do jednej.\nPowiedziała:\n- Wyjeżdżam na dwa tygodnie. Wlej każdej pół kubeczka co drugi dzień.\nAle ja jestem samcem.\nUsłyszałem tylko \"dwa tygodnie\" i \"zdradzaj mnie\"\n',0,NULL),(71,11,'2020-11-21 15:36:48','2021-10-26 11:35:59','Szkoła katolicka','Mnie rodzice posłali do szkoły katolickiej.\nNienawidziłem jej.\nNajbardziej na świecie.\nZakonnice były bezwzględne.\nBiły mnie linijką, dostawałem też w twarz.\nRobiły wszystko by się bronić.\n',6,1),(72,11,'2020-11-21 15:41:25','2021-10-26 11:37:22','Kobiety muszą Cię nienawidzić','Ciągle słyszę:\n- Anthony strasznie się ubawiłem ale wszystkie kobiety muszą Cię nienawidzić.\nOdpowiadam:\n- Nie. Nie. Tylko głupie kobiety mnie nienawidzą. Nienawidzą moich występów. Mądre kobiety na nie nie przychodzą.\n',4,1),(73,11,'2020-11-21 15:51:13','2021-10-26 11:39:27','Rodzina w II wojnie światowej','Dowiedziałem się, że członkowie mojej rodziny podczas II wojny światowej walczyli po obu stronach.\nTo upokarzające.\nPodczas gdy bandycka część rodziny służyła w Wermachcie, krewka część rodziny Jeselników była w Ameryce.\nI szpiegowała dla Niemców.\n',0,NULL),(74,11,'2020-11-21 16:40:18','2021-10-26 12:22:59','Zamiłowanie do alkoholu','Lubię pić. \nWręcz kocham. Robię to codziennie.\nNie wiem, skąd mi się to wzięło.\nRodzice opowiadali, że kiedy byłem bardzo mały, co rano wyłaziłem z łóżeczka i szedłem na czworakach w stronę barku. \nBy choć trochę z nimi pobyć.',6,1),(75,8,'2020-11-21 16:44:26','2021-10-26 12:24:28','Chciałem mieć dzieci','Zerwałem z dziewczyną. Jednym z powodów naszego zerwania było to, że ja chciałem mieć dzieci, a ona bardzo nie. I to do tego stopnia nie chciała, że co tylko jakieś przyprowadziłem to wypuszczała je z piwnicy.',5,1),(78,11,'2021-01-03 23:31:45','2021-10-26 12:28:13','Broń palna i dzieci','Ja nie mam broni.\nJestem przeciwny jej posiadaniu.\nMoi rodzice mieli broń, jak byłem mały.\nMówili, że jest im potrzebna.\nPotrzebna by chronić pięcioro dzieci.\nJak masz pięcioro dzieci, to potrzebujesz broni, by je chronić.\nW końcu sie jej pozbyli,\nby chronić pozostałe czworo.',4,1),(79,11,'2021-01-03 23:36:03','2021-10-26 12:30:30','Pała na świadectwie','Nigdy nie zapomnę,\njak pierwszy raz miałem pałę na swiadectwie.\nPrzyniosłem je do domu i pokazałem tacie.\nStrasznie mnie sprał.\nNa kwaśne jabłko,\nAle to mnie czegoś nauczyło.\nGdy nasepnym razem miałem na świadectwie pałę, przyniosłem je do domu i dałem mamie\nNiechże ona dostanie',5,1),(80,11,'2021-01-03 23:41:00','2021-10-26 12:37:03','Nauka przez doświadczenie','Tata był twardy.\nJeden z tych, którzy wierzą, że mężczyznę uczy tylko doświadczenie.\nJego zdaniem szkoła nic nie da.\nTłumaczenie nic nie da.\nMusisz sam w praktyce do czegoś dojść.\nGdy byłem mały, nie potrzebowałem lekcji pływania.\nTata wrzucał mnie do basenu,\nby poćwiczyć udzielanie pierwszej pomocy.',5,1),(83,8,'2021-01-04 23:03:11','2021-10-26 12:39:10','Kłamliwe wypowiedzenie','W poprzedniej pracy szef mnie bardzo nie lubił i za wszelką cenę chciał mnie zwolnić. \nDoszło nawet do tego, że dał mi wypowiedzenie pod prekstem, że niby napastuje seksualnie innych pracowników.\nOczywiście było to ochydne kłamstwo.\nAle ja swojej pracy i tak nie lubiłem\nDlatego schowałem wojego penisa w spodnie i poszedłem do domu.',0,0),(84,11,'2021-01-21 21:21:32','2021-10-26 12:48:20','Mój tata nie ufa nikomu','Mój tata nie ufał nikomu. Dosłownie nikomu.\nMiał nawet na to powiedzenie,\nale nigdy mi go nie powiedział',0,NULL),(85,11,'2021-01-21 21:24:43','2021-10-26 12:56:37','Urodziny mamy','Zeszły rok był smutny dla mojej rodziny.\nMama mogła mieć swoją 60 imprezę urodzinową.\nAle przez narkotyki, alkohol i inne fatalne decyzje zapomnieliśmy o tym',0,NULL),(86,11,'2021-01-21 21:32:26','2021-10-26 13:01:39','Mama rasistka','Mama była rasistką. Straszną rasistką.\nA ja nie toleruje rasizmu.\nNie znoszę bo to przejaw ignorancji.\nGdy miałem 9 lat i wracałem do domu po szkole, raz na jakiś czas przyprowadzałem ze sobą kolegę.\nZdarzało się, że kolega był czarny.\nGdy przychodził mama zaczynała się dziwnie zachowywać.\nOdciągała mnie na bok i pytała:\n- Anthony, kim jest Twój nowy przyjaciel? Czy to jakiś handlarz narkotyków?\nOdpowiadałem:\n- Zamknij się mamo to rasistowskie... i schowaj te pieniądze.\n',0,NULL),(87,11,'2021-01-21 21:58:35','2021-10-26 13:05:41','Zamykanie klinik aborcyjnych','Wieczorami występuję, ale mam też hobby.\nW dzień jeżdżę od miasta do miasta i zamykam kliniki aborcyjne.\nDobrze słyszeliście.\nZamykam kliniki aborcyjne, gdzie tylko pojadę.\nŁatwo mi to przychodzi. Jestem czarujący.\nStoję czły dzień przed wejściem i proponuję niższe ceny',0,NULL),(88,11,'2021-03-30 21:30:15','2021-10-26 13:08:18','Autopsja babci','Moja babcia umarła. \nBabcia zawsze chciała umrzeć spokjnie w śnie.\nMyśleliśmy, że tak było.\nCieszyliśmy się z jej szczęścia.\nPotem zleciliśmy autopsję.\nOkazało się, że zmarła straszną śmiercią.\nW najgorszy możliwy sposób.\nPodczas autopsji.',0,NULL),(89,11,'2021-03-30 22:04:18','2021-10-26 14:23:55','Zły wpływ i brzydkie słowo','Przyjaciółka mojej żony jest nawróconą chrześcijanką.\nI ni cholery się nie dogadujemy.\nZadzowniła żeby mnie ochrzanić.\nPowiedziała, że mam zły wpływ na jej męża, bo brzydko ją nazwał.\n- Jak? Nazwał Cię suką\n- Nie, Anthony. Nie chodziło o słowo na \"S\"\nNo nieźle\n- Czy nazwał Cię pizdą?\n- Nie\n- Więc nie usłyszał tego ode mnie',0,NULL),(90,11,'2021-03-30 22:09:54','2021-10-27 13:12:03','Najlepszy telefon w życiu','Czasami życie nie jest zabawne.\nNie chcę wnikać w szczegóły, ale na początku tygodnia odebrałem najlepszy telefon w moim całym życiu.\nPięć minut później odebrałem kolejny telefon, mówiący o tym, że mój tata jest w szpitalu.\nPowiedziałem: \"Tak, właśnie słyszałem\"',0,NULL),(91,11,'2021-03-31 21:18:21','2021-10-27 13:23:06','Niezapomniany widok','Nigdy nie zapomnę tego jednego razu, gdy zobaczyłem penisa ojca.\nPowiedziałem: \n-Tato... Nie wysyłaj mi takich zdjęć',0,NULL),(92,11,'2021-03-31 21:23:30','2021-10-26 14:08:24','Ślepy woźny','Kiedy chodziłem do liceum, szkoła zatrudniła niewidomego woźnego.\nBył w stu procentach ślepy.\nWszystkie dzieci żartowały, że oślepł od masturbacji.\nWtedy w to wierzyłem.\nByłem dzieckiem, skąd miałem wiedzieć?\nDopiero gdy dorosłem, zmądrzałem, zrozumiałem, że to głupi przesąd, którego użyli, żeby wytłumaczyć, dlaczego ciągle walił przy nas konia.',0,NULL),(93,11,'2021-03-31 21:29:56','2021-10-26 13:50:49','Sąsiedzi Jehowi','Mam fajne mieszkanie.\nTrochę gorzej z sąsiadami.\nMieszkam na jednej ulicy z trzem rodzinami świadków Jehowych.\nI ile razy bym nie powtarzał:\n- Nie, absoultnie nie\nI tak przychodzą dwa razy w tygodniu i mówią:\n- Anthony, proszę przestań rzucać kamieniami w nasze domy\n',0,NULL),(94,11,'2021-03-31 21:34:56','2021-10-27 13:14:04','Sąsiad z Alzheimerem','Mam jeszcze gorszych sąsiadów.\nJednym z najbliżej mieszkających jest 90-latek, który ma Alzheimera.\nI każdego ranka o dziewiątej puka do moich drzwi i pyta czy nie widziałem jego żony.\nCo oznacza, że każdego ranka o dziewiątej muszę tłumaczyć 90-latkowi z Alzheimerem, że jego żona od dawna nie żyje.\nMyślałe, żeby się przenieść.\nMyślałem, żeby nie otwierać drzwi rano, ale szczerze to warto się poświęcić, żeby widzieć ten usmiech na jego twarzy.',0,NULL),(95,11,'2021-03-31 21:49:50','2021-10-27 13:42:04','Upuszczenie dziecka','Ostanio w centrum handlowym znajomy poprosił mnie czy mogę potrzymać jego dziecko bo on musi iść do łazienki.\nUpuściłem je.\nPodniosłem, zanim mnie ktoś zobaczył.\nA było blisko.\nMusiałem zbiec trzy piętra po schodach.',0,NULL),(96,11,'2021-03-31 21:57:32','2021-10-27 13:49:55','Dziewczynka z szklanym okiem','Nie lubię dzieci.\nZnam dziewięciolatkę, mała, chudą dziewczynkę.\nMała, chuda dziewczynka mieszka w moim śasiedztwie.\nMa szklane oko.\nCholernie się jej boję.\nRobię w porty ze strachu.\nKiedy tylko mnie widzi zaczyna mnie gonić.\nTak długo, aż oddam jej szklane oko. Najgorzej.',0,NULL),(97,11,'2021-03-31 22:02:36','2021-10-27 13:48:27','Znajoma nie może mieć dzieci','Mam znajomą, która dowiedziała się, że nie może mieć dzieci... od sądu rodzinnego',0,NULL),(98,11,'2021-04-01 19:36:47','2021-10-27 13:52:52','Depresja mamy','Mama miała depresję.\nNaprawdę miała depresję.\nTak wielką, że wytatuowała: \"w przypadku zagrożenia życia, nie reanimować\"\nNa wszystkich dzieciach',0,NULL),(99,11,'2021-04-01 19:41:14','2021-10-27 13:55:33','Spór prawny','Od pogrzebu mamy minęło jakieś 10 lat.\nW zeszłym roku kazałem wykopać jej ciało żeby rozwiązać spór prawny z rodzeństwem.\nOkazało się, że to oni mieli rację.\nTo jednak nielegalne.',0,NULL),(100,11,'2021-04-01 19:53:12','2021-10-27 14:00:01','Inny język','Każdego dnia moi latynoscy sąsiedzi próbują do mnie zagadać.\nA ja nic nie rozumiem.\nW dziewięciu przypadkach na dziesięć jestem uprzejmy.\nAle ostatnio byłem zmęczony, na kacu, wypaliłem trochę zioła, wziąłem parę piguł i kiepsko się czułem.\nNie wytrzymałem.\n- Hej, dupku. Jesteśmy w Ameryce. Nie znam migowego',0,NULL),(125,8,'2021-07-26 11:19:13','2021-10-28 07:37:52','Śmierć babci','Pamiętam, że kiedy moja babcia umarła to wolałem udawać, że nic się nie stało.\nI zamiast zmierzyć się z śmiercią babci to ja: \noglądałem sobie telewizje, \nzaprosiłem znajomych i zoorganizowałem domówkę, \nczy też załatwiłem sobie dziewczynę na noc.\nWszystko byleby tylko uciec od śmierci babci.\nJednak po pewnym czasie uznałem, że jest to oszukiwanie siebie samego i czas w końcu zmierzyć się z śmiercią babci.\nDlatego też wyciągnąłem telefon\ni zadzwoniłem do zakładu pogrzebowego\nby zabrali ciało babci z wersalki.',0,NULL),(127,8,'2021-07-26 12:04:10','2021-10-28 14:04:47','Ponowna wprowadzka do rodziców','Wprowadziłem się z powrotem do rodziców by się uczyć.\nJednak tym razem było inaczej niż w dzieciństwie\nBo moja mam nie miała już tego jednego dnia kiedy była agresywna\nTeraz była już po menopauzie\nI cały czas chodziła wkurwiona.',0,NULL),(129,8,'2021-08-18 15:21:29','2021-10-26 13:45:17','Dziewczyna wyrzuciła mnie z domu','Dziweczyna się na mnie wkurzyła.\nTam wyjebała mnie z domu.\nByło ciężko bo nie miałem gdzie spać.\nMusiałem znajomych prosić by mnie przenocowali.\nAle w końcu udało mi się znaleźć jakąś małą i tanią klitkę.\nNo, a ona została w domu i dalej mieszka u moich rodziców.',0,NULL),(140,8,'2021-08-24 20:56:27','2021-10-31 13:14:42','Kiedyś mówiłem, że jestem chujowy','Trochę już występuję\nAle jak zaczynałem to jak wchodziłem na scenę to zawsze na początku mówiłem, że jestm chujowy by obniżyć oczekiwania.\nAle już trochę minęło czasu, nabrałem wprawy.\nI teraz już jak już wchodzę na scenę to nie muszę tego mówić.\nOd razu to widać.',0,NULL),(141,8,'2021-08-25 22:36:09','2021-11-01 16:55:53','Dziewczyna zaraziła mnie jakimś syfem','Jest mi bardzo dobrze z moją dziewczyną.\nJestem z nią szczęsliwy.\nAle jest jeden minus.\nBo zaraziła mnie jakimiś syfem.\nJak byłem u lekarza to okazało się, że jest to robactwo.\nA dokładniej, motyle w brzuchu.',6,2),(144,8,'2021-08-30 22:18:10','2021-11-03 00:01:05','Ubłocone dziecko','Ostatnio siedziałem sobie na ławce na osiedlu i pilonwałem dzieciaka.\nByłem zadowolony bo się bardzo grzecznie chuśtał, a nie paplał w błocie jak inne niegrzeczne dzieci.\nAle w pewnym momencie zeskoczył z tej huśtawki i wlazł do tego błota.\nJa zdenerwowany wyciągam go z tamtąd, ten już cały ubłocony, od stóp po sam czubek głowy.\nTo biorę go za rękę i ciągnę do mieszkania by go umyć.\nTen się tam drze i wyrywa.\nJuż jesteśmy pod klatką to mnie kopnął.\nJa sie wkurzyłem dałem mu kilka klapsów.\nTen płaczę, już po schodach to go ciągnąć musiałem.\nW końcu wchodzimy do mieszkania, następnie wchodzimy do łazienki\nWepchnąłem go do wanny i zaczynam go myć.\nMyje go tak i myje, aż w końcu umyłem mu twarz\nI wtedy sobie uświadomiłem...\nKurwa, przecież ja nawet nie mam dzieci.',6,1),(148,8,'2021-09-13 21:25:35','2021-10-26 13:40:48','Współlokator sika do zlewu','Mój współlokator jest obrzydliwy.\nOstatnio nakryłem go jak sika do zlewu w kuchni.\nJak tylko to zobaczyłem to od razu:\nKurwa stary, poczekaj aż skończę myć naczynia.',0,0),(149,NULL,'2021-09-14 19:31:25','2021-10-28 14:14:58','Zdradziłem dziewczynę i nie chciałem tego','Moja dziewczyna ostatnio nie była zadowolona\nBo ją zdradziłem.\nNie spodobało jej się to.\nMówiłem jej, że no nie moja wina\nŻe próbowałem tamtej tłumaczyć, że ja mam dziewczyną i bardzo ją kocham i bardzo nie chcę jej zdradzać\nAle naprawdę odkąd dałem tamtej prostytutce dwie stówy to kompletnie nie chciała mnie słuchać',0,NULL),(150,8,'2021-09-20 10:15:14','2021-11-01 16:55:42','Nie umiem używać noża','Trochę wstyd ale wciąż nie bardzo umiem używać noża.\nOstatnio jak jadłem w restauracji to doszło właśnie do skaleczenia.\nPięciu osób obok mnie.',5,2),(151,8,'2021-09-20 12:19:11','2021-11-01 16:55:37','Chyba alkoholik','Wydaje mi się, że mój kolega jest alkoholikiem.\nTakie ma wrażenie, że nim jest.\nBo ostatnio gdy tak jak zawsze rano piliśmy spirytus pod żabką to powiedział, że mu smakuje.',4.5,2),(154,8,'2021-09-24 14:24:30','2021-11-03 00:04:40','Spadłem z drabiny','Zycie jest kruche.\nWczoraj spadłem z dwumetrowej drabiny.\nAle całe szczęście była to leżąca dwumetrowa drabina.',4.5,2),(155,8,'2021-09-24 14:25:58','2021-11-01 16:55:27','Wyciągnąłem człowieka spod samochodu','Raz wyciągnałem człowieka spod samochodu.\nMechanik się wkurwił.',5,2),(156,8,'2021-09-24 14:37:43','2021-11-01 16:55:18','Zwolnienie i zabranie rzeczy','Szef poprosił mnie do gabinetu i mnie zwolnił, powiedział:\n- Radek, zabieraj swoje rzeczy i wypierdalaj.\nUznałem, że pokażę klasę i odpowiedziłem mu tylko:\n- Zobaczysz, będziesz żałaować tej decyzji\nI już jestem pod drzwiami, juz mam wychodzić kiedy szef krzyczy:\n- Radek zaczekaj!\nPodbiega łapie mnie za ramię i mówi:\n- Przemyślałem to. Wypierdalaj ale rzeczy jednak zostaw.',5.5,2),(157,8,'2021-09-24 14:40:45','2021-11-01 16:54:52','Lekarz i bezdzietność','Lekarz powiedział mi, że nie mogę mieć dzieci.\nNoo... słabo...\nPsychiatra mi tak powiedział',5.66667,3),(158,8,'2021-09-24 14:52:41','2021-11-03 00:08:34','Pomoc przy zemdleniu','Raz w centrum pewna młoda dziweczyna straciła przytomność.\nBez chwili wahania zacząłem robić jej usta usta.\nLudzie dookoła mnie bili mi brawo i wołali, że jestem bohaterem.\nPamiętam, że byłem wtedy z siebie bardzo zadowolony i pomyślałem sobie:\n- Sposób z chloroformem zawsze działa',5,2),(159,8,'2021-09-28 08:36:48','2021-11-03 00:07:40','Jazda po pijaku','Nigdy, przenigdy nie jeżdżę pijany po ulicy. \nJak jestem to jeżdżę po chodniku.',5,2),(160,8,'2021-09-28 08:47:08','2021-11-03 00:06:05','Jakiś baran trąbi','Miałem cięzki dzień w pracy.\nJedyne czego chciałem to wypocząć.\nAle jakiś baran ciągle trąbi.\nZaciskam zęby i siedzę jednak spokjnie.\nAle ten nie przestaje i dalej trąbi i trąbi.\nW końcu nie wytrzymałem wyleciałem do niego, wyciągam go i zaczynam go bić.\nLudzie zaczęli mnie odciągąć\nI wyjebali mnie z filharmoni',5.5,2),(161,8,'2021-09-28 08:50:42','2021-09-28 09:02:09','Lanie za złe oceany','Jak byłem mały i dostawałem złe oceny w szkole, to mój tata zawsze dawał mi lanie.\nI jestem mu wdzięczny za to bo to mnie czegoś nauczyło.\nŻeby dobrze trzymać gardę.',0,NULL),(162,8,'2021-09-28 09:30:04','2021-11-10 13:08:08','Rozstanie przez orientację','Nie jestem już z swoją dzieczyną.\nPrzyczyną była jej orientacja.\nW sensie zgubiła się w lesie.',5.5,2),(184,17,'2021-10-06 20:28:18','2021-10-11 09:00:08','Diler z warzywniaka','Ja wiem, że nie wyglądam na taką osobę ale... handlowałem kiedyś narkotykami.\nTo się przedawniło, więc mogę o tym mówić.\nHandlowałem narkotykami i popełniałem główny błąd, który popełniają dilerzy,\nmianowicie paliłem towar, który powinienem był sprzedawać.\nZarabiałem przez to mniej.\nTo jest w ogóle dziwne, że jest takie zjawisko bo nie ma czegoś takiego w innych dziedzinach życia.\nNie ma czegoś takiego, że koleś w warzywniaku opierdolił połowę swojej wypłaty.\nW pomidorach. Jak będzie zalegał z hajsem to dojadą go ludzie z Hortexu.',0,0),(185,17,'2021-10-06 20:33:08','2021-10-07 09:45:37','Grożenie za sprzedaż na policji','Ja miałem taką paranoję, nie miałem pleców!\nNie miałem pleców, nie mogłem powiedzieć:\n- Słuchaj jak mnie sprzedasz na policji to wywiozę Cię do lasu\nJedyne co mogłem zrobić to powiedzieć:\n- Słuchaj, jak mnie sprzedasz... To będzie mi po prostu przykro.',0,NULL),(187,17,'2021-10-07 16:26:56','2021-10-07 16:26:56','Skuci dilerzy w samych majtkach','Ja musiałem przestać handlować, miałem paranoje, że mnie złapią.\nJak zobaczycie te filmiki jak antyterroryści wpadają wcześnie rano o szóstej...\nCi dilerzy są kompletnie nieprzygotowani.\nLeża na ziemi, skuci w samych majtkach.\nTak bardzo nie chciałem być typem skutym na ziemi w samych majtkach, że kładłem się spać w ubraniach.\nRaz się więcej policji kręciło koło mojego bloku to się w garniturze położyłem.',NULL,NULL),(188,17,'2021-10-07 16:34:44','2021-10-07 16:34:44','Praprababcia i wielodzietność','Propsowana jest wielodzietność, nie tylko żeby kobiety rodziły dzieci ale żeby rodziły jak najwięcej tych dzieci.\nI to nie jest dobra rzecz.\nJa wiem o tym bo moja praprababcia miała dwanaście dzieciaków.\nTo jest za dużo.\nTo jest za dużo bo masz limit tego ile możesz dać komuś miłości.\nJak masz dwanaście dzieciaków i okaże się, że jedno z nich musisz zostawić w lesie,\nTo wiesz które.',NULL,NULL),(189,17,'2021-10-07 21:40:04','2021-10-07 21:40:04','Seks gejowski jest przyjemniejszy','W Polsce popularne jest jeszcze dissowanie homoseksualistów.\nDo Polski często jest zapraszany typ na uczelnie, który nazywa się Paul Cameron\nI koleś nienawidzi gejów i jak na takiego typa, wygłasza bardzo dziwne tezy.\nTeraz sparafrazuje jego tezę:\nKoleś twierdz, że homoseksualizm jest niebezpieczny bo seks homoseksualny jest przyjemniejszy od heteroseksualnego.\nKoleś to powiedział.\nI dlatego kiedyś wszyscy przerzucimy się na homoseksualizm i przestaniemy się rozmnażać.\nJa wiem, że to jest bzdura bo tym samym tekstem mnie moi kumple geje podrywali, to było:\n- Hej Czarek, słyszałeś, że seks gejowski jest przyjmniejszy?\nJa na to:\n- Nie, nie... Drugi raz się na to nie nabiorę',NULL,NULL),(190,17,'2021-10-12 15:13:38','2021-10-12 15:13:38','Pierwszy król Polski Bolesław Chrobry','Mamy wspaniałą tysiącletnią historię, ponad tysiąc letnią historię.\nI mamy też tendencję do wybielania jej bardzo często... W zasadzie to od samego początku.\nPierwszy król Polski od razu przypał.\nTo co teraz powiem to nie jest żart, to jest fakt.\nBolesław Chrobry dostał kosza od kijowskiej księżniczki, więc najechał na Kijów i ją zgwałcił bo ta odrzuciła jego zaloty.\nTeraz dlaczego odrzuciła jego zaloty?\nOdrzuciła jego zaloty bo miała go za chama i prostaka.\nArgument, który ewidentnie obalił swoim zachowaniem w Kijowie.\nTo jest taki wstyd.\nPierwszy król Polski.\nTen typ jest na naszych banknotach.\nJa się nie czuję komfortowo z tym, że mam w tym momencie w swoim portfelu dwóch gwałcicieli i zdjęcie mojej dziewczyny.\nMoim zdaniem Bolesław Chrobry był takim bezzębnym dresiarzem.\nBył bezzębnym dresiarzem.\nI każda wojna w którą wchodziła Polska zaczynała się od zdania:\n- Co się kurwa patrzysz?\nI to co mnie najbardziej w tym dziwi to jest to, że gwałt popełnia się pod wpływem impulsu.\nTak mi się wydaje nie mam doświadczenia w tym.\nGwałt popełnia się pod wpływem impulsu.\nNa Kijów jedzie się tydzień.\nZ Gniezna\nSprawdzałem na google mapach.\nZaznaczyłem opcję konno na google mapach.\nKoleś mimo wszystko pojechał, co oznacza, że musiał być niezrównoważony psychicznie.\nWyobrażacie sobie, żeby dzisiaj krajem rządził ktoś kto jest niezrównoważony psychicznie?',NULL,NULL),(191,17,'2021-10-12 15:23:41','2021-10-12 15:23:41','Przyjaźń bardziej wartościowa od miłości','Ja osobiście uważam, że przyjaźń jest dużo bardziej wartościową relacją od miłości.\nJest dużo bardziej... Miłość, jest jakiś duży hype na miłość, na jakieś tam obrączki, śluby.\nW przyjaźni tego nie ma, jest to prostsze dużo wszystko.\nMożesz być zazdrosny o kogoś kogo kochasz, o przyjaciela nie bardzo.\nPrzynajmniej ja nie jestem.\nJa nigdy nie miałem takiej sytuacji, że dostaję telefon i:\n- Ty słuchaj widziałem jak Marek zbija piątki z jakimś fagasem na mieście, zwierza mu się z swoich problemów\nJadę wtedy na miejsce i:\n- Co kurwa nie spodziewałeś się, że tu będę co? Kto to kurwa jest?',NULL,NULL),(192,17,'2021-10-13 16:38:09','2021-10-13 16:38:09','Przyjazny gest standupera po występie','Wiem, że przyjaźń jest dużo bardziej wartościową relacją bo kiedyś po występie podbijałem do jednej dziewczyny na publiczności, która mi się podobała.\nRazem z innym komikiem, którego imienia nie mogę wymawiać.\nI konkurowaliśmy o nią.\nI jemu szło lepiej.\nWięc ja zrezygnowany odchodzę zaczynam zakładać kurtkę i ten komik podchodzi do mnie:\n- Co Ty Czarek robisz? Gdzie Ty idziesz?\nJa mówię:\n- No ona jest zainteresowana Tobą, a więc bawcie się tam dobrze\nI on wtedy odpowiedział coś co mnie zszokowało i nigdy w życiu tego nie zapomnę.\nBo spojrzał mi prosto w oczy i powiedział:\n- Nie no co Ty, dawaj na dwa baty ją weźmiemy.\nPrzyjaźń.\nAle ja odmówiłem bo trójkąt to jest zamknięta figura.\nJakby jasna jest nasza relacja wzlędem niej\nNie jest jasna relacja między nami.\nJa nie wiem czy w trakcie tych \"dwóch batów\" mam zbijać z nim piątki\nCzy smyrać go za uchem\nNie mam pojęcia.\nPozatym też kolejny argument trójkąty nie występują w przyrodzie\nNie występują\nNie ma czegoś takiego, że tam nie wiem\nPies dyma psa i trzeci pies patrzy na to waląc konia.\nNie ma czegoś takiego',NULL,NULL),(198,17,'2021-10-14 21:31:45','2021-10-14 21:31:45','Podbijanie samooceny swojej dziewczynie','Moja dziewczyna chciałaby bardzo żebym mówił jej komplementy\nBo powiedziała, że jakby usłyszała ode mnie komplementy to podbiłoby jej to samoocene\nA ja nie chcę podbijać jej samooceny\nW sensie dlaczego miałbym to robić\nZeby zdała sobie sprawę, że stać ją na typa z wyższej półki niż ja\nDziewczyna z którą się spotykam musi być przekonana, że ja jestem maksimum tego na co ją stać\nTo nie jest takie proste\nTo są tygodnie ciężkiej krytyki\nI hajs włożony w lustro pogrubiające',NULL,NULL),(199,17,'2021-10-14 21:35:35','2021-10-14 21:35:35','Podbijanie do dziewczyn z niską samooceną','To jest trochę łajdackie z mojej strony, że zawsze podbijam do dziewczyn z niską samooceną\nZ taką bardzo niską samooceną\nTo jest już taka kategoria dziewczyn, która ma już po prostu pętle założoną na szyję i ma wykopywać stołek spod nóg\nWtedy zjawiam się ja i:\n- Hej, co taka dziewczyna jak Ty robi na takiej gałęzi jak ta',NULL,NULL),(200,17,'2021-10-14 21:47:23','2021-10-14 21:47:23','Narkomanka i pojemnik z moczem','Zawsze poznawałem dzieczyny w jakichś dziwnych okolicznościach\nRaz szedłem na badanie moczu\nI podeszła do mnie dziewczyna i zapytała się:\n- Hej czy masz pożyczyć pięć złotych na heroinę\nja tak:\n- O nie... Ble zostaw mnie\nOdchodzę i ona idzie za mną:\n- Weź pożycz pięć złotych\nJa mówię:\n- Nie, daj mi spokój nie mam pięciu złotych\nA ona:\n- Weź pożycz mi pięć złotych, zrobię Ci laskę\nI znalazłem się w takiej mega niesmacznej sytuacji w której nie chciałem się znaleźć\nŻe stoję w centrum Warszawy z pojemnikiem moczu w kieszeni i narkomanka oferuje mi laskę za pięć złotych\nCo jest dobrą ceną nie zrozumcie mnie źle\nNie możesz się targować\n- Eeee może cztery złote\nWięc ja... romawiamy i ona w pewnym momencie:\n- Co tam masz w kieszeni?\nI mówię, ok powiem jej pewnie da mi spokój\nI pokazjue jej pojemnik z moczem i mówię:\n- Pojemnik z moczem\nI ona spojrzała się na mnie z takim obrzydzeniem i się odsunęła ode mnie\nNarkomanka, która przed chwilą chciała mi zrobić laskę za pięć złotych odsunęła się ode mnie z obrzydzeniem\nI to jest straszne bo jej przestało zależeć, a mi zaczęło zależeć\nWiecie jak to jest',NULL,NULL),(201,17,'2021-10-14 22:24:52','2021-10-14 22:25:31','Pozbywanie się ciała w szpitalu','To co mnie obudziło rano to była ręka pielęgniarki\nBudzi mnię ręka pielęgniarki\nJa wstaję, widzę, że jest czarny worek na łóżku tego typa\nI ona do mnie mówi:\n- No Panie Cezary za chwilę będziemy zabierać tego pana, czy chciałby pan wyjść żeby nie być świadkiem tego?\n...\n- Przed chwilą spałem... Jakbyś mnie nie obudziła to nie byłbym świadkiem tego\nNa co ona mówi:\n- Dobra panie Cezary ale proszę sobie wyobrazić jakby obudziłby się pan w momencie jak będziemy zabierać tego pana... byłby pan w szoku\n...\n- Jak wy dokłądnie chcecie się pozbyć tego ciała? ... Czy wy będziecie rąbać je siekierą i rozpuszczać kwasem w zlewie? ... Bo jak tak to chcę to zobaczyć',NULL,NULL),(202,17,'2021-10-15 17:52:11','2021-10-15 17:52:11','Ojciec lekarz','Największą paranoję z powodu mojej hipochondrii ma mój ojciec\nBo mój ojciec jes lekarzem i ja cały czas do niego wydzwaniam, non stop\nI on ma mnie dosyć\nDo tego stopnia, że jak dzwonię do niego to pierwsze co słyszę w słuchawce to:\n- ehhh... Co Ci znowu dolega Czarek?\nJa mówię:\n- Nie tato nie dzwonię do Ciebie w tej sprawie. Masz dzisiaj imieniny. Wszystkiego najlepszego tato\nA on:\n- ooo wow pamiętałeś. Ooo wow, dzięki synu to miłe z Twojej strony.\n- No, no... Słuchaj mam takiego kolegę, którego boli łokieć.\n- Wiedziałem, że po to do mnie dzwonisz. Nie jestem Twoją osobistą pielęgniarką\n-Jak to nie jesteś przecież składałeś przysięgi hipokreteńskie, masz mnie leczyć\nA on:\n- Debilu ja jestem ginekologiem\nCo jest prawdą mój ojciec jest ginekologiem\nOn mówi mi:\n- Debilu ja jestem ginekologiem, nie znam się na Twoich chorobach, mimo, że jesteś cipą',NULL,NULL),(203,17,'2021-10-17 16:11:16','2021-10-17 16:11:16','Ktoś umie robić zastrzyki domięśniowe?','Ktoś umie robić zastrzyki domięśniowe?\nJesteś pielęgniarką?\nCzy sterydy napierdalasz?',NULL,NULL),(204,17,'2021-10-17 16:21:15','2021-10-17 16:21:15','Spanie względem okna i szatan','Niektórych zniszeń jeśli chodzi o samoocenę nie da się naprawić\nNie ma takiej możliwości poniewać to są traumy z dzieciństwa\nWe mnie wpajano dużo zabobonów jak byłem mały\nJak miałem pięć lat mój starszy kuzyn powiedział mi, że jak będę spał nogami do okna to szatan przyjdzie\nI na podwórku koledzy powiedzieli mi:\n- Co Ty Czarek pierdolisz? Nie możesz spać głową do okna bo szatan przyjdzie\nI była wielka debata jak spać względem okna, żeby szatan nie przyszedł\nJa miałem tego dosyć, więc zapytałem się mojego ojca:\n- Tata jak mam spać względem okna żeby szatan nie przyszedł\nMój ojciec się zaczął tak ze mnie śmiać, miał ze mnie mega bekę:\n- Nie ma znaczenia jak będziesz spał, szatan i tak przyjdzie',NULL,NULL),(205,17,'2021-10-17 17:07:10','2021-10-17 17:07:10','Żul kupił wódkę siedmiolatce','Byłem świadkiem jak siedmiolatka zapytała się żula czy kupi jej pół litra wódki\nKoleś kupił jej pół litra wódki\nWrócił zadowolony z tego... Tak jakby właśnie zwerbował nowego zawodnika\nSzeregi żuli topnieją w Polsce, potrzebujemy młodych i kreatywnych meneli',NULL,NULL),(206,17,'2021-10-17 17:38:24','2021-10-17 17:38:24','Brazylijskie zapasy','Zapisałem się ostatnio na trening brazylijskiego jujitsu\nBrazylijskie zapasy, bardzo fajny sport\nW ciągu jednego wieczora dotknąłem pięciu różnych penisów\nPrzed treningiem',NULL,NULL),(207,17,'2021-10-17 17:43:19','2021-10-17 17:44:18','Niebieska plama na skórze','Ja jestem hipochondrykiem\nDo tego stopnia, że kiedyś zrobiła mi się niebieska plama na skórze \nI poszedłem z nią do dermatologa\nOn mi powiedział, że to jest siniak\nZdiagnozowano u mnie siniaka\nCałe szczęscie tak wcześnie\nJeszcze kilka dni i zmieniłby kolor',NULL,NULL),(211,17,'2021-10-26 18:10:51','2021-10-26 18:10:51','Nie chciałem nikogo urazić','<context> Wcześniej był żart o kurwie <context>\nJa nie chciałem n