10-30 20:49:32','Babcia i tabletki LSD','Babciu widziałaś moje tabletki?\nByły oznaczone LSD.\n- Pie**olić tabletki, widziałeś k**wa smoka w kuchni ?',NULL,NULL),(218,NULL,'2021-10-30 20:56:15','2021-10-30 20:56:15','Grzebanie przy kontakcie','Facet grzebie cos przy kontakcie czy innych tam kabelkach, wola zone:\n- Jadźka, potrzymaj mi ty ten kabelek.\nŻona bierze kabelek i pyta:\n- No i co?\n- Nic..\n- Widac faza jest w drugim...',NULL,NULL),(219,NULL,'2021-10-30 21:18:29','2021-10-30 21:18:29','Wszystko co się rusza','Rozmiawia dwóch kolegów:\n- W sprawach seksu to wiesz ja... wszystko co się rusza....\n- Ja aż takich ograniczeń sobie nie stawiam.',NULL,NULL),(220,NULL,'2021-10-30 21:19:24','2021-10-30 21:19:24','Matka jest tylko jedna','Pani w szkole nakazała dzieciom napisać wypracowanie, które miało by się kończyć zdaniem: \"Matka jest tylko jedna\". Na drugi dzień pani pyta się dzieci.\n- No dzieci przeczytajcie co napisaliście - może zaczniemy od Małgosi.\n- Mama jest kochająca przytula nas, układa do snu. Matka jest tylko jedna.\n- Gosiu 5 siadaj. Teraz Pawełek\n- Mam wyprowadza nas na spacery kupuje nam rowery. Matka jest tylko jedna.\n- Pawełku 5 siadaj.\nWreszcie Pani przepytała prawie całą klasę. Pozostał tylko Jasiu.\n- Jasiu a ty, co napisałeś?\n- W domu balanga,a wódka leje się litrami, goście rzygają na dywan.\nNagle wódka się skończyła, więc matka do mnie: Jasiek skocz do lodówki przynieś dwie wódki. Idę do kuchni, otwieram lodówkę i drę się z kuchni:\nMatka! Jest tylko jedna!',NULL,NULL),(221,NULL,'2021-10-30 21:20:52','2021-10-30 21:20:52','Żona zostawiła dla policjanta','Mężczyzna około 40-tki pomykał szosą w swoim nowiutkim Porsche. Kiedy już dwukrotnie przekroczył dozwolona prędkość we wstecznym lusterku zobaczył charakterystyczne czerwono-niebieskie migające światełka. Pewien mocy swojego\nsamochodu ostro przyspieszył, ale wóz policyjny nie dawał za wygraną. Po chwili zdał sobie jednak sprawę, że w ten sposób może przysporzyć sobie wielu kłopotów i zjechał na pobocze. Policjant podszedł do niego, bez słowa sprawdził prawo\njazdy i powiedział:\n- To był dla mnie długi dzień, zbliża się koniec mojej zmiany, na dodatek jest piątek trzynastego. Mam dość papierkowej roboty, wiec jeśli znajdzie pan jakieś dobre wytłumaczenie na swoja ucieczkę, pozwolę panu odjechać bez mandatu. Mężczyzna pomyślał chwilkę i powiedział:\n- W zeszłym tygodniu moja żona zostawiła mnie dla jakiegoś policjanta. Bałem się, że chciał mi ją pan oddać.\n- Życzę miłego weekendu - powiedział policjant.',NULL,NULL),(222,NULL,'2021-10-30 21:27:03','2021-10-30 21:27:03','Spanie jak niemowle','Szalejacy kryzys finansowy. Dzwoni bankier do bankiera:\n- Czesc stary, jak sypiasz?\n- Jak niemowle.\n- Zartujesz?\n- Nie. Wczoraj cala noc plakalem i dwa razy sie zesralem.',NULL,NULL),(223,8,'2021-10-30 21:35:45','2021-10-30 21:35:45','Wyrywanie na mieście','Często wychodzę na miasto by coś powyrywać\nI ostatnio na mieście młodą dziewczynę\nCel namierzony do wyrwania\nWięc podchodzę na pewniaka i się udało\nWyrwałem jej torebkę i uciekłem\n',NULL,NULL),(224,NULL,'2021-10-30 21:40:37','2021-10-30 21:40:37','Lekcja geografii o globusie','Nowa nauczycielka geografii przychodzi do klasy na lekcje i mówi:\n- Dzisiaj porozmawiamy o tym, co to jest globus.\nKlasa na to chórem:\n- Sp*******j, ty stara k***o!\nNauczycielka rozpłakała się, wybiegła z klasy i poszła do dyrektora.\n- Koleżanko - mówi dyrektor. - Ja pani pokażę, jak należy z nimi postępować.\nPo chwili dyrektor wchodzi do klasy i zaczyna:\n- Cześć, małe sku******y!\n- Czołem, łysy ch**u!\n- Dzisiaj będzie o tym, jak się zakłada kondoma na globus.\n- Na globus? - dziwi się klasa. - A co to jest globus?\n- Od tego właśnie zaczniemy.',NULL,NULL),(225,NULL,'2021-10-30 21:43:38','2021-10-30 21:43:38','Przycupnięty susełek','- Wiesz, Kamil, wydaje mi się, że świruję!\n- Po czemu wnosisz?\n- Widzisz tam po lewo przycupniętego susełka?\n- Nie, nie widzę.\n- I ja nie widzę. A on tam, kurw*a, jest!',NULL,NULL),(226,NULL,'2021-10-30 21:48:36','2021-10-30 21:48:36','Mniejsza jałmużna dla żebraka','Bardzo pobożny człowiek co niedziele chodząc do kościoła rzucał 10zł żebrakowi.\nPewnego razu rzuca tylko 5zł. Żebrak na to:\n- Co się stało? Dlaczego tylko piątka? Stracił pan pracę?\n- Nie, wysłałem syna na studia.\n- No, wszystko fanie, ale dlaczego moim kosztem?',NULL,NULL),(227,8,'2021-10-31 13:20:14','2021-11-01 16:53:56','Masturbacja na złamane serce','Jak miałem złamane serce to cięzko mi było się pozbierać\nW końcu kolega dał mi radę:\n- Słuchaj na złamane serce najlepsza jest masturbacja, wystarczy raz i zapominasz o problemie\nSpróbowałem i nie potwierdzam\nJak mu zwaliłem to wcale mi nie pomogło',6,1),(228,8,'2021-11-01 22:47:13','2021-11-01 22:47:24','Ojciec do matki po obiedzie','Na zakończenie chciałbym wam powiedzieć to co kiedyś powiedział mój ojciec do matki po obiedzie:\nDziękuję, skończyłem',5.66667,3),(229,8,'2021-11-01 23:49:01','2021-11-02 12:37:10','Numerek w klubie w szatni','Ostatnio w klubie w szatni miałem numerek.\nNumer 118 szatniarz mi dał',NULL,NULL),(230,8,'2021-11-02 23:51:51','2021-11-02 23:51:51','Krzyczący nauczyciel chemii','Miałem w szkole takiego nauczyciela chemii co był bardzo nerwowy.\nJak wchodziłem bez pukania to ten od razu krzyczał:\n- Co to ma znaczyć? Jak to bez pukania? A gdzie to się pakujesz?\nI tam jeszcze sie darł swoim chemicznym żargonem, że w życiu to trzeba mieć zasady bo inaczej wyjdzie kwas i takie tam.\nOstatecznie mówił, że mam wyjść i poczekać na zewnątrz.\nPo jakimś czasie drzwi się uchylały, Pan od chemi mówił \"wolne\" i wychodził z kibla\n',NULL,NULL),(231,NULL,'2021-11-03 00:10:33','2021-11-03 00:10:33','Nowa nauczycielka i test dyrektora','Do szkoły przyszła młoda nauczycielka, więc dyrektor postanowił sprawdzić jej kwalifikacje.\nPrzyszedł na lekcję i usiadł w ostatniej ławce, za Jasiem.\nNauczycielka napisała na tablicy zdanie: \"Ala ma lupę\" i prosi, żeby któreś z dzieci przeczytało zdanie.\nW klasie zapanowała cisza, tylko Jasio podnosi rękę.\n-No jasiu, przeczytaj zdanie- mówi pani.\n-Ale ma dupę!- odpowiada, Jasio,\n-Jak tak możesz, nie ładnie używać takich słów Jasiu, siadaj, pała!!\nW tym momencie Jasio odwraca się zdenerwowany do dyrektora:\n-Jak nie wiesz, to nie podpowiadaj!!!',NULL,NULL),(232,NULL,'2021-11-03 00:14:53','2021-11-03 00:14:53','Staruszek na spowiedzi','Wchodzi staruszek do konfesjonału i nawija:\n- Mam 92 lata. Mam wspaniałą żonę, która ma 70 lat. Mam dzieci, wnuki i prawnuki. Wczoraj podwoziłem samochodem trzy nastolatki, zatrzymaliśmy się w motelu i uprawiałem seks z wszystkimi trzema...\n- Czy żałujesz, synu, tego grzechu?\n- Jakiego grzechu?\n- Co z ciebie za katolik?\n- Jestem żydem...\n- To czemu mi to wszystko opowiadasz?\n- Wszystkim opowiadam!',NULL,NULL),(233,NULL,'2021-11-03 00:20:46','2021-11-03 00:20:46','Pożegnanie listonosza','Listonosz odchodzi na emeryturę. Mieszkańcy jego\nrewiru postanowili go pożegnać, każdy na swój własny pomysł. Przychodzi do\npierwszego domu, a tam otwiera facet, który bierze listy i wręcza mu czek na\n200zł.\nW drugim domu dostaje pudełko kubańskich cygar.\nW trzecim butelkę dobrej whisky.\nPrzychodzi do czwartego, otwiera mu odziana skąpo,\nponętna blondynka.\nPatrzy na niego kocim wzrokiem i zaciąga do sypialni.\nJeden, dwa... pięć orgazmów. Po wszystkim kobieta przygotowuje mu\nwspaniałe danie. Na sam koniec podaje mu kawę i banknot dziesięciozłotowy.\nFacet z lekka zblazowany drapie się po głowie.\n-To co pani dla mnie zrobiła było wspaniałe, ale po\nco mi te dziesięć złotych?\n- Zastanawiałam się co Panu dać w związku z odejściem na emeryturę.\nW końcu mąż mi doradził:\nPierdol go- daj mu dychę!-A posiłek to już sama wymyśliłam...',NULL,NULL),(234,NULL,'2021-11-03 00:22:58','2021-11-03 00:22:58','Szukanie żon w sklepie','Spotyka się dwóch kupli w sklepie:\n-Cześć, co robisz?\n-Aaa... żony szukam.\n-Ooo... ja też . Jak twoja wygląda?\n-No, wysoka, blondynka, błękitne oczy, duże piersi. A twoja?\n-Eee.. tam, nieważne szukamy twojej!',NULL,NULL),(235,NULL,'2021-11-03 00:23:59','2021-11-03 00:23:59','Lew o duszy cheścijanina','Misjonarza idącego przez pustynię goni lew, nagle misjonarz upada ze zmęczenia, klęka i zaczyna się modlić :\n- Boże! Spraw by to zwierzę miało duszę chrześcijanina!\nLew:\n-Panie! pobłogosław ten posiłek, który za chwilę będę spożywał.',NULL,NULL),(236,NULL,'2021-11-03 00:27:38','2021-11-03 00:27:38','Imprezowiczki na cmentarzu','Po imprezie trzy laski wracały do domu, lecz po drodze zachciało im się siku. Z braku lepszego miejsca udały się na cmentarz i tam załatwiły. Następnego dnia w ich mężowie w pracy:\n- Ty Jacek jak tam twoja żona wróciła po imprezie??\n- Daj spokój była tak pijana, że musiałem ją przynieść z trawnika do domu.\n- Moja nie dość że była pijana to jeszcze wróciła bez majtek. Zdzisiek a twoja??\n- Panowie szkoda gadać. Nie dość że była pijana i bez majtek, to jeszcze w dupie miała wstążkę z napisem \"My chłopcy z Sosnowa nigdy cię nie zapomnimy\".',NULL,NULL),(237,NULL,'2021-11-03 00:30:49','2021-11-03 00:30:49','Prośba o popchnięcie','Noc. Mąż śpi z żona w łóżku, gdy nagle budzi ich głośne łup łup łup w drzwi. Przewraca się na bok i patrzy na zegarek - trzecia w nocy.\n\"Kurde, nie będę się o tej porze z wyra zrywał\", myśli przewraca się z powrotem.\nSłychać głośniejsze łup łup łup.\n- Idź otwórz, zobacz kto to, - mówi żona.\nNo więc zwleka się półprzytomny i schodzi na dół (mieszkają w domku). Otwiera drzwi, a na progi stoi facet, od którego jedzie alkoholem:\n- Dobry wieszor, - bełkocze. - Szy mochby pan mnie popchnąć?\n- Nie, spadaj facet, jest trzecia w nocy. Wywlokłeś mnie pan z łóżka,- warczy maź i zatrzaskuje drzwi. Wraca do żony i mówi co zaszło.\n- No co ty, jak mogłeś? - mówi żona. - A pamiętasz, jak nam się wtedy zepsuł samochód, kiedy jechaliśmy odebrać dzieci z kolonii i sam musiałeś pukać do kogoś, żeby nam pomógł? Co by się wtedy stało, gdyby też ci powiedział, żebyś spadał?!?!?!?\n- Ale kochanie, on był pijany!\n- Nieważne, potrzebuje pomocy.\nNo wiec mąż jeszcze raz zwleka się z łóżka, ubiera się i schodzi na dol.\nOtwiera drzwi, ale z powodu ciemności nic nie widzi, węec woła:\n- Hej, czy nadal trzeba pana popchnąć?\nZ ciemności dochodzi glos:\n- Taaaa...\nAle ponieważ nadal nie potrafi zlokalizować faceta, krzyczy:\n- Gdzie pan jest?\n- W ogrodzie, na huśtawce...',NULL,NULL),(238,NULL,'2021-11-03 19:39:23','2021-11-03 19:39:23','Kompot z narkotyków w garze','Dwóch narkomanów gotuje kompot w wielkim garze. To jeden zamiesza chochlą, to drugi... Nagle jeden pyta:\n- Ty, a co by było, jakbym ja sobie ten cały gar naraz zapodał?\n- Weź przestań. Poszłaby ci krew z uszu, z oczu, a na twarzy pojawiłyby ci się krwawe ślady.\n- Taki mocny towar?\n- Nie, tak bym ci tą chochlą wpierdolił...',NULL,NULL),(239,NULL,'2021-11-03 19:41:53','2021-11-03 19:41:53','Żona przegląda się w lustrze','Żona wstała rano z łóżka, rozebrała się do naga i stanęła przed wielkim lustrem w przedpokoju. Zobaczyła obwisły brzuch, oklapnięte pośladki, piersi do pasa, a kiedy zbliżyła do lustra twarz, ujrzała zmarszczki i wory pod oczami. Założyła szlafrok, spojrzała na śpiącego męża i mruknęła do siecie: \"Dobrze mu tak, skurwielowi!\"',NULL,NULL),(240,NULL,'2021-11-03 19:47:36','2021-11-03 19:47:36','Lodzik na kaca','Dzwoni gość do pracy:\n- Szefie nie mogę dziś przyjść do roboty... jestem tak skacowany, że i tak nie będę mógł pracować, więc chyba wezmę zwolnienie lekarskie.\nSzef na to:\n- No co ty, na kaca jest super sposób. Ja zawsze jak mam kaca to proszę moją żonę żeby zrobiła mi laskę i potem czuję się doskonale. Powinieneś to wypróbować.\n- Hmm? OK spróbuję.\nPo godzinie pracownik przychodzi na swoje stanowisko w pełni sił.\nSzef podchodzi i zagaduje:\n- I co, jak działa mój sposób ?\n- Doskonale, a w ogóle to fajną ma szef chałupę.',NULL,NULL),(241,NULL,'2021-11-03 19:58:52','2021-11-03 19:58:52','Cyrk i krokodyl','Facet w cyrku wychodzi na arenę z krokodylem. Staje na środku i kopie krokodyla w dupę. Krokodyl rozdziawił paszczę, a facet rozpina rozporek, wyciąga fiuta i kładzie krokodylowi na zęby. Potem bierze deskę i napierdala krokodyla po głowie. Krokodyl nic, tylko mu oczy z bólu łzawią. Po pięciu minutach napierdalanki wyciąga fiuta, krokodyl zamyka paszczę, a facet podchodzi do publiki i pyta:\n- Proszę państwa, kto z Państwa chce spróbować tego samego; gwarantuję pełnię\nbezpieczeństwa; bez obaw - nic nikomu się ni stanie!\nW cyrku cisza, przez dłuższy czas nikt się nie zgłasza, po chwili z trzeciego rzędu podnosi się stara babcia i mówi:\n- Ja tam może bym spróbowała, tylko żeby pan mnie tą deską po głowie tak nie walił...',NULL,NULL),(242,NULL,'2021-11-03 20:02:04','2021-11-03 20:02:04','Żart z światłem w kiblu','Mąż przychodzi do domu i siada na kibelku. Żona krząta\nsię po mieszkaniu i słyszy, że z kibla dochodzą jakieś postękiwania.\nMyśli sobie: - Zrobię mu kawał - i gasi światło.\nPo chwili z kibla słychać krzyk: - O K****!\nPrzerażona żona otwiera drzwi i zapala światło.\nMąż z ulgą: - Eh! Już myślałem, że mi oczy pękły',NULL,NULL),(243,NULL,'2021-11-03 20:03:42','2021-11-03 20:03:42','Stara wielbłądzica','Przyjeżdża nowy oficer do polskiej bazy wojskowej na pustyni w Iraku i pyta się żołnierzy:\n- Jak tam wasze życie seksualne?\nŻołnierz odpowiada:\n- Do miasta dosyć daleko, ale mamy taka starą wielbłądzicę...\nPyta się kolejnego i słyszy taką samą odpowiedź.\n- To zaprowadźcie mnie do niej - mówi oficer.\nPo pół godziny wychodzi, zasuwając rozporek:\n- Niezła. Stara, ale niezła.\n- Niezła - odpowiada żołnierz - do miasta w pół godziny dowiezie...',NULL,NULL),(244,NULL,'2021-11-03 20:16:24','2021-11-03 20:16:24','Strucie grzybami','Spotyka się dwóch facetów:\n- Ten twój kolega to ma szczęście! Dwie żony już pochował, bo struły się grzybami,\na teraz trzeci raz owdowiał.\n- No, ale tym razem to był uraz czaszki.\n- Tak słyszałem. Ponoć nie chciała jeść grzybów.',NULL,NULL),(245,NULL,'2021-11-03 20:21:49','2021-11-03 20:21:49','Obrzygany mundur','Po całonocnej libacji budzi się rosyjski generał, otwiera oczy i widzi jak adiutant czysci jego mundur z wymiocin. Żeby się jakos wytłumaczyć generał tako rzecze do niego:\n- Bo młodzież dzisiejsza w ogóle nie umie pić. Wczoraj jakis porucznik całego mnie zarzygał!\nNa to adiutant:\n- Rzeczywiście panie generale! Całkiem go popierdoliło! Nawet w spodnie panu nasrał!',NULL,NULL),(247,17,'2021-11-04 22:51:36','2021-11-04 22:51:36','Żartowanie by zaimponować kobiecie','Nie chcę wyjść na seksistę, jest dużo seksizmu w standupie.\nJest mało standuperek, co mnie martwi.\nNiektórzy uważają, że to przez to, że kobiety nie są śmieszne\nJa się z tym zupełnie nie zgadzam, kobiety są na maksa śmieszne.\nTylko, że po prostu nie mają potrzeby tego okazywać.\nPonieważ z ewolucyjnego punktu widzenia i tak zaruchają.\nJa natomiast muszę być śmieszny.\nCo myślicie, że to lubię kurwa robić?\nStać tutaj na scenie i ryzykować, że jakiś żart mi nie wejdzie i wrócę do domu sam?\nBędę zajadać smutki milką, oreo i skittelsami, słuchając w kółko \"Jakiś tam tytuł\".\nTo nie jest mój wymarzony wieczór.\nMuszę być jakiś tam zabwny ale zrozumiałem pewną rzecz\nNiekoniecznie Ty musisz być śmieszny jak chcesz zaimponować kobiecie\nSam proces śmiania się nakręca kobiety seksualnie w jakiś sposób\nI my o tym wiemy. My o tym na maksa wiemy.\nDlatego zapraszamy je na komedie romantyczne albo na standup\nTak jak Grzegorz tutaj\nPonieważ spodziewasz się Grzegorz, że będziesz miał w domu seks.\nA według mnie to jest niesprawiedliwe.\nJa stoję na scenie. Ja się kurwa napracowałem\nZe mną wraca Kasia do domu',NULL,NULL),(248,NULL,'2021-11-04 22:54:39','2021-11-04 22:54:39','Rude i szkodzi na zęby','- Co to jest: rude i szkodzi na zęby?\n- Cegła.',NULL,NULL),(249,NULL,'2021-11-04 22:56:16','2021-11-04 22:56:16','Rozpijanie Jasia','- Jasiu chodź napijesz się ze mną wódeczki.\n- Ależ tato!\n- No co, ja ci pomogłem odrobić lekcje.',NULL,NULL),(250,NULL,'2021-11-04 22:57:51','2021-11-04 22:57:51','Śmierć w kadzi z piwem','Kobieta słyszy dzwonek do drzwi.\nPo chwili otwiera je i widzi kolegę męża, który pracuje z mężem w browarze.\n- Mam dla pani złą wiadomość. W browarze był wypadek i pani mąż zginął.\n- O Boże! Jak to się stało?\n- Wpadł do kadzi z piwem i się utopił.\nKobieta pyta przez łzy:\n- Ale czy przynajmniej miał szybką śmierć?\n- Obawiam się, że nie. Zanim utonął, wyłaził z kadzi pięć razy, żeby się odlać...',NULL,NULL),(251,NULL,'2021-11-04 22:59:02','2021-11-04 22:59:02','Kac i wdzięczna żona','Facet budzi się w południe na potwornym kacu. Patrzy, na stole cztery schłodzone butelki piwa i list następującej treści:\n?Kochanie, wypoczywaj. Jakbyś czegoś potrzebował to zadzwoń.\nZwolnię się z pracy i przyjadę. Twoja kochająca żona?.\nFacet pyta syna: ? Co się wczoraj stało? Nic nie pamiętam. Czyżbym wrócił w nocy\nz kwiatami albo pierścionkiem?\nSyn na to: ? Przyszedłeś o piątej nad ranem kompletnie pijany, awanturowałeś się, a gdy matka chcąc cię rozebrać ściągała ci spodnie, powiedziałeś: ?Spadaj dziwko, jestem żonaty!?',NULL,NULL),(252,NULL,'2021-11-04 23:01:19','2021-11-04 23:01:19','Pies i dwóch policjantów','W Warszawie, na rogu ulicy stoi dwóch policjantów z psem. Podchodzi do nich facet i z uwagą ogląda psa. Ogląda go z boku, z tyłu, zagląda mu pod brzuch, pod ogon. Wreszcie policjanci zainteresowali się gościem.\n- Panie, co pan tu tak tego psa prześwietla?\n- Znów mnie kumple w maliny wpuścili. Powiedzieli, że tu na rogu stoi pies z dwoma ch*jami.',NULL,NULL),(253,NULL,'2021-11-05 18:47:36','2021-11-05 18:47:36','Bunt żon feministek','Międzynarodowy kongres feministek.\nNa mównicę wychodzi jedna z aktywistek i wygłasza kwiecistą mowę o zerwaniu kajdan posłuszeństwa i niewolnictwa, kończąc słowami:\n- I od dziś przestajemy im sprzątać, prać i gotować! Niech radzą sobie sami!\nZ sali burza braw, owacje na stające. Ustalono, że po miesiące odbędzie się ponowny kongres w celu zweryfikowania i podzielenia się wynikami i opiniami.\nJak ustalono tak się stało. Na mównicę pierwsza weszła Francuzka.\n- Miesiąc temu wróciłam do domu o oświadczyłam - Piere od dzisiaj przestaje gotować, radź sobie sam!\nPierwszy dzień nic nie widzę, drugi dzień nic, trzeciego dnia widzę jak na śniadanie gotuje sobie jajko.\nBrawa, ogólna radość. Na mównicę wkracza Amerykanka.\n- Ja po powrocie do domu oświadczyłam - Steven od dzisiaj przestaje prać, radź sobie!\nPierwszy dzień nic nie widzę, drugi dzień nic, trzeciego dnia widzę jak dość nieudolnie pierze sobie skarpetki.\nZnowu burza braw. Teraz ma się wypowiedzieć Rosjanka.\n- Ja oświadczyłam w domu - Michaił od dzisiaj sam po sobie sprzątasz!\nPierwszy dzień nic nie wiedzę, drugi dzień nic nie widzę, trzeci dzień nic nie widzę, czwartego dnia zaczęłam widzieć na lewe oko.',NULL,NULL),(254,NULL,'2021-11-05 18:49:11','2021-11-05 18:49:11','Krew na miejscu zbrodni','Adwokat do klienta:\n- Mam dla pana zła i dobrą wiadomość. Analiza DNA wykazała, że na miejscu zbrodni znaleziono pańską krew.\n- Oj, to źle... a... ta dobra?\n- Cholesterol i cukier w normie.',NULL,NULL),(255,NULL,'2021-11-05 18:56:57','2021-11-05 18:56:57','Pomyłka managera w korporacji','Nowy manager zatrudnil sie w duzej miedzynarodowej firmie.\nPierwszego dnia wykrecil wewnetrzny do swojej sekretarki i drze sie:\n- Przynies mi ku**a tej kawy szybko!\nZ drugiej strony odezwal sie gniewny meski glos:\n- Wybrales zly numer! Wiesz z kim rozmawiasz?!\n- Nie!\n- Z Dyrektorem Naczelnym, ty idioto!!\n- A wiesz, z kim ty ku**a rozmawiasz?!\n- Nie!\n- No i dobrze!',NULL,NULL),(256,NULL,'2021-11-05 19:00:16','2021-11-05 19:00:16','Kiedyś było lepiej w sklepach','Mój dziadek ciągle narzeka - że koszty życia strasznie wzrosły w dzisiejszych czasach. M\nówi:\n- \"Pamiętam kiedy byłem młody - mama mi dała 5 złotych na zakupy, a ja wróciłem do domu z pełną reklamówką - wędliny, mleko, chleb, ser, masło, konfitury. A teraz co? Wszędzie te lustra, te kamery!!\"',NULL,NULL),(257,NULL,'2021-11-05 19:01:11','2021-11-05 19:01:11','Radiowóz wpada na drzewo','Radiowóz wpada na drzewo. Z rozbitego pojazdu gramoli się dwóch\n\"wesołych\" funkcjonariuszy. Jeden mówi do drugiego:\n- No, Stasiu, tak szybko na miejscu wypadku to jeszcze nigdy nie byliśmy.',NULL,NULL),(258,8,'2021-11-10 14:56:30','2021-12-27 20:04:37','Lekcje pływania w szkole','W szkole mieliśmy basen, a w nim zajęcia z pływania.\nNienawidziłem ich bo kompletnie nie potrafiłem pływać.\nA nasz wfista co chwile robił nam jakiś sprawdzian...\nJednak za każdym razem dostawałem same piątki\ndzięki jednemu prostemu sposobowi\nBo nasz wfista był już stary, niedowidział i trochę był przysypiał\nWięc jak nie patrzył to po prostu \nściągałem od kolegi obok',2,1),(259,8,'2021-11-18 13:08:19','2021-11-18 13:08:19','Karmienie bezdomnych','Jakiś czas temu uznałem, że zaangażuję się w karmienie innych\nWięc otworzyłem placówkę, nazbierałem pożywienia i rozpocząłem działalność\nSzybko zbiegli się wszyscy bezdomni z okolicy i zaczęli jeść jak najęci\nJedli co popadnie i bez umiaru, a potem sobie poszli\nI strasznie mnie to wkurzyło\nBo to nie ich chiałem karmić\nTo nie dla nich gołębnik zakładałem',NULL,NULL),(260,NULL,'2021-11-18 15:49:10','2021-11-18 15:49:10','Wyrzucenie suki przez okno','Wsiadł do pociągu relacji Paryż - Bruksela Rosjanin. Wszystkie miejsca zajęte przez pasażerów, a jedno z podwójnych siedzeń zajmuje francuska gospodyni z małym pieskiem, który rozwalił się jak car na carskim tronie. Rosjanin prosi:\n- Madammm, nie mogłaby pani wziąć swojego pieska na ręce?\nKobieta ostro odpowiada:\n- Wy Rosjanie jesteście jak zwykle bezceremonialni. Moja Fifi jest zmęczona. Niech sobie pan poszuka wolnego miejsca w innym wagonie!!\nRosjanin poszedł więc szukać nowego miejsca. Nie znalazł. Wraca, mówi:\n- Lady, jestem bardzo zmęczony, chciałbym usiąść. Niech pani weźmie swojego psa na ręce.\nFrancuzka rozeźlona krzyczy:\n- Wy, Ruscy, jesteście gruboskórni i nieokrzesani! W Europie ludzie się tak nie zachowują. To jest nie do pomyślenia!\nWtedy Rosjanin nie wytrzymał i wywalił suczkę przez okno, a sam usiadł sobie wygodnie. Kobieta w szoku, przeklina, miota się, wrzeszczy. Do rozmowy nagle dołącza się siedzący obok Anglik - dżentelmen w każdym calu:\n- Wy, Rosjanie, wszystko robicie nie tak jak trzeba, jakby nie od tej strony. Podczas obiadu trzymacie nóż w lewej ręce, samochody jeżdżą u was po prawej stornie, a teraz pan wyrzucił przez okno nie tą sukę co trzeba.',NULL,NULL),(261,NULL,'2021-11-18 15:50:31','2021-11-18 15:50:31','Porachuje','Spotkanie z prof. Miodkiem, z sali pada pytanie:\n- Panie profesorze, czy forma \"porach*je\" jest poprawna?\n- W zasadzie tak, ale o ileż zgrabniej zabrzmiałoby: \"Już czas\npanowie\".',NULL,NULL),(262,NULL,'2021-11-18 15:51:39','2021-11-18 15:51:39','Strzelenie do kochanka','Mąż po powrocie do domu, zastaje żonę ze swoim kolegą w łóżku... niewiele myśląc, łapie za broń i strzela do rzeczonego, zabijając go.\nWzrok kieruje ku żonie... na co ta:\n\n- Świetnie, rób tak dalej, a żadnych kolegów nie będziesz mieć!',NULL,NULL),(263,NULL,'2021-11-18 15:58:14','2021-11-18 15:58:14','Płukanie gardła na przemoc','Przychodzi kobieta do lekarza, wszędzie jest niebieska, zielona...\nLekarz: o boże, co się pani stało?\nKobieta: panie doktorze, juz nie wiem co mam dalej robić... Za każdym razem, kiedy mój mąż przychodzi do domu pijany, tłucze mnie.\nLekarz: hmm znam jeden absolutnie pewny iefektywny środek! W przyszłości, kiedy pani mąż przyjdzie pijany do domu, weźmie pani filiżankę herbaty rumiankowej i niech pani płucze gardło i płucze i płucze....\n2 tygodnie później przychodzi ta sama kobieta do tegoż lekarza, wygląda jak kwitnące życie...\nKobieta: panie doktorze, wspaniała rada!!, zakażdym razem, kiedy moj mąż dobrze wcięty wtacza się do mieszkania, ja płucze i płucze gardło a on nic mnie nie robi..\nLekarz: Widzi pani, po prostu trzymać pysk zamknięty...',NULL,NULL),(264,NULL,'2021-11-18 16:01:10','2021-11-18 16:01:10','Casting na superagenta','FBI zrobiło casting na nowego super agenta. Do finałowego konkursu dostało się trzech mężczyzn: polak, rusek i niemiec. Ich ostatnim zadaniem było wejście do pokoju i bez zawahania zastrzelenie osoby która siedzi na krześle. Pierwszy wchodzi niemiec, patrzy a tam siedzi jego teściowa, myśli sobie:\n- \"nie no nie zabije teściowej, to matka mojej żony\". Odpadł z konkursu.\nDrugi wchodzi rusek, patrz a tam jego teściowa, myśli:\n-\"nie no to babcia moich dzieci, nie wypada jej zabić\", przegrał.\nNa końcu wchodzi polak, słychać tylko krzyki, trzask i bicie. Wybiega zdyszany i mówi:\n-\" k**wa, jakiś debil nabił broń ślepakami, musiałem ją krzesłem zaje*ać',NULL,NULL),(265,NULL,'2021-11-18 16:03:36','2021-11-18 16:03:36','Poproszę piłkę','Przychodzi Polak do sklepu w Anglii.\n- Poproszę piłkę.\n- ???!! I don\"t understand - rozkłada ręce angielski\nsprzedawca.\n- No piłkę, okrągłą, jak globus, piłkę - tu Polak gestykuluje.\n...- ???!! Please, say it in English... - sprzedawca jest bezradny.\n- Piłka! Mjacz! Futbol! Futbol! - Polak próbuje różnych języków.\n- Futbol? Oh, yes, a BALL! - na twarzy Anglika gości uśmiech.\n- NO! Nareszcie! A teraz powoli: do metalu...',NULL,NULL),(266,NULL,'2021-11-18 16:13:01','2021-11-18 16:13:01','Porównanie mężów','Wieczór ,rozmowa koleżanek przez telefon:Już nie mogę wyrobić z moim starym,jeszcze siedzi w barze...-Powinien brać przykład z mojego.Jego już dawno przynieśli do domu.',NULL,NULL),(267,NULL,'2021-11-18 16:32:06','2021-11-18 16:32:06','Koń wypił farbę','Fachowcy z Ukrainy przyjechali na gospodarstwo do Irlandii wymalować facetowi dom. Jako że byli z Ukrainy mieli w zwyczaju przed robotą chlapnąć ze dwie sety, ale niestety nie mieli za co.\nSprzedali więc farbę, kupili flaszkę, drugą, trzecią. i w końcu przepili wszystko.\nPo jakimś czasie fachowcy widząc że zbliża się właściciel domu, szybko resztką farby wysmarowali koniowi mordę.\nWłaściciel się pyta:\n- dlaczego nic nie jest pomalowane\n-bo koń wypił całą farbę!\nWłaściciel bez zastanowienia wyciąga strzelbę i strzela koniowi w łeb\n-dlaczego od razu tak brutalnie? pytają fachowcy ze zdumieniem\n- a na ch*j mi taki koń. Ostatnio jak byli tu murarze z Polski to 10 worków cementu wpie**olił.',NULL,NULL),(268,8,'2021-11-19 13:31:36','2021-11-19 13:31:36','Wyjazd w pracy','Szef do mnie:\n- no Radek szykuj się na wyjazd\nJa się ucieszyłem:\n- ooo a gdzie mamy integrację? Hiszpania? Włochy? A może Maroko?\nSzef na to rozbawiony:\n- Nie, nie... na wyjazd z firmy. Wypierdalasz!',NULL,NULL),(269,NULL,'2021-11-19 13:40:15','2021-11-19 13:40:15','Szkodliwość drinków','WÓDKA Z LODEM - ATAKUJE NERKI !\n\nRUM Z LODEM - ATAKUJE WĄTROBĘ !\n\nGIN Z LODEM - ATAKUJE MÓZG !\n\nWHISKY Z LODEM - ATAKUJE SERCE !\n\n\nWYGLĄDA NA TO, ZE TEN CHOLERNY LÓD SZKODZI NA WSZYSTKO!!!!!!',NULL,NULL),(270,NULL,'2021-11-19 13:50:21','2021-11-19 13:50:21','Pieszczoty po latach','Po dwudziestu latach małżeństwa para leży w łóżku i nagle żona czuje, że\nmąż zaczyna ją pieścić, co już się bardzo dawno nie zdarzało.\nPrawie jak łaskotki jego palce zaczęły od jej szyi, biegły w dół delikatnie wzdłuż kręgosłupa do bioder.\nPotem pieścił jej ramiona i szyję, dotykał jej piersi, by zatrzymać się powyżej podbrzusza.\nPotem kontynuował, umieszczając swą dłoń po wewnętrznej stronie jej lewego ramienia, znów pieścił lewą stronę jej biustu i obsuwał dłoń wzdłuż jej pośladków, uda i nogę, aż po kostkę.\nKontynuował po wewnętrznej stronie lewej nogi unosząc pieszczoty aż do najwyższego punktu uda.\nOch...\nW ten sam sposób delikatnymi ruchami dłoni pieścił jej prawą stronę i gdy\nżona czuła się już rozpalona do ostatnich granic...\nNagle przestał, przekręcił się na plecy i zaczął oglądać telewizję.\nŻona ledwie łapiąc oddech powiedziała słodkim szeptem:\n- To było cudowne, dlaczego przestałeś?\n- Znalazłem w końcu pilota - odpowiedział',NULL,NULL),(271,NULL,'2021-11-19 13:51:12','2021-11-19 13:51:12','Nie kolegowanie się z Kazikiem','Mama pyta Jasia:\n-Jasiu dlaczego nie bawisz się już z Kaziem?\n-Mamo, a czy ty byś chciała się kolegować z kimś kto pali, pije przeklina?\n-Nie Jasiu.\n-No widzisz, Kaziu też nie chce.',NULL,NULL),(272,NULL,'2021-11-19 13:58:16','2021-11-19 13:58:16','Wstawanie po walce','Dwie babcie oglądają walkę bokserską w tv. Po serii ciosów jeden\nz zawodników pada na deski. Sędzia zaczyna liczyć, tłum szaleje!\nWstanie!?! Nie wstanie!?! Wstanie!?! Nie wstanie!?!\n- Nie wstanie - komentuje jedna z babć - Znam chama z tramwaju.',NULL,NULL),(273,8,'2021-11-22 15:19:56','2021-11-22 15:19:56','Wczesny powrót do domu','Codziennie pracuję i do domu wracam zawsze po godzinie 17.\nAle raz właśnie wyrwałem się wcześniej z pracy no i wiadomo przez to wcześniej wróciłem do domu.\nI nigdy nie zapomne jak wszedłem do mieszkania i otworzyłem drzwi do sypialni.\nI odebrało mi wtedy kompletnie mowę,\nbyłem na maksa zaskoczony bo zobaczyłem coś czego żaden mężczyzna nie chce zobaczyć...\nSwoją dziewczynę bez makijażu',NULL,NULL),(274,NULL,'2021-11-22 15:22:15','2021-11-22 15:22:15','Sprawdzanie prze ochroniarza na dyskotece','Wchodzi facet na dyskotekę w Wołominie, ochroniarz go pyta:\n- Ma Pan pistolet?\n- Nie.\n- A może ma Pan nóż?\n- Nie.\n- Siekierę?\n- Nie.\n- Kastecik?\n- Nie, nie mam nic.\nOchroniarz rozbija butelkę, daje mu tulipana i mówi:\n- Ja pierd***, to niech chociaż to Pan weźmie!',NULL,NULL),(275,NULL,'2021-11-22 15:35:30','2021-11-22 15:35:30','Wraca dresiarz z Paryża','Wraca dresiarz z Paryża i opowiada swojej dziewczynie co tam widział.\n-Wiesz Zocha, idę k***a,patrzę k***a, a tu wielki, wyje**sty plac k***a!\nPatrzę na lewo k***a mać... och***ć można!Patrzę przed siebie: O żesz k***a! Patrzę na prawo: k***a O ja Cię p*****lę...\nZocha zaczyna płakać. Dresiarz pyta:\n-Zocha,co Ci się k***a ,stało?\n-Boże,jak tam musi być pięknie...',NULL,NULL),(276,18,'2021-11-22 15:38:56','2021-11-26 13:33:07','Różnica między teledyskiem Dody, a porno','-Jaka jest różnica miedzy teledyskiem DODY , a filmem porno?\n-W filmie porno jest lepsza muzyka.',NULL,NULL),(277,18,'2021-11-22 15:42:11','2021-11-26 13:32:59','Zamawianie piwa i nauka mówienia','Facet miał specyficzną wadę wymowy. Nie potrafił wypowiedzieć słowa na literę P. Utrudniało mu to życie, ale najgorsze było to, że nie mógł nigdy w pubie zamówić piwa. Za każdym razem starał się jak, mógł ale konczyło się to tak,że po pytaniu barmana:-Co Panu podać?-Facet na to:PPP..PPP..kawę...I próbował biedak tak wiele razy, ale zawsze było tak samo: Co dla Pana?-pp..PPP..Ppp.......kawę....W końcu znalazł lekarza, który nauczył naszego bohatera wymawiać słowo na P, ale tylko w wyrazie PIWO. Trenował gość w domu :piwo.piwo.piwo.piwo!-Hura! -krzyknął zadowolony. I od razu pobiegł do pubu (tego co zawsze). Podchodzi wyluzowany i uśmiechnięty do baru, a barman na to:-Co Panu podać?Facet:PIWO !!!Barman: premium, czy pils ?Facet:kawę...',NULL,NULL),(278,18,'2021-11-22 15:45:59','2021-11-26 13:32:47','Śpiąca królewna','... a z tym pocałunkiem póki co zaczekamy - powiedział piękny książę\nzłażąc ze Śpiącej Królewny.',NULL,NULL),(279,18,'2021-11-22 15:46:30','2021-11-26 13:32:38','Sen bankiera w kryzysie','Szalejący kryzys ekonomiczny. Dzwoni bankier do bankiera:\n- Cześć stary, jak sypiasz?\n- Jak niemowlę.\n-Żartujesz?\n- Wcale nie. Wczoraj całą noc płakałem i dwa razy się zesrałem.',NULL,NULL),(280,18,'2021-11-24 10:24:42','2021-11-26 13:32:27','Pożar i śmierć','- Wiesław, coś taki markotny?\n- Nie wiesz?! Benek nie żyje!\n- No coś Ty?! Jak to?!\n- Wrócił przedwczoraj do domu, wypił, położył się do łóżka, zapalił papierosa, pościel się zajęła;\n- I spalił się?!\n- Nie. Zdążył okno otworzyć i wyskoczyć.\n- I połamał się na śmierć?\n- Nie. Straż wezwał. Strażacy rozciągnęli takie koło z gumy i tam skoczył.\n- Pękło?\n- Nie. Jakoś tak się od tego odbił i z powrotem skoczył do chałupy.\n- I się spalił.\n- Nie! Od bił się od framugi i spadł.\n- Rozbijając się?\n- Otóż nie! Stał tam wóz strażacki. Z plandeką. Trafił w to, odbił się i znowu wskoczył do okna.\n- Zginął?\n- Nie. Spadł, odbił się znów od tej gumy i wleciał do mieszkania!\n- O rzesz ja pierdole! To jak ten Benek zginął?!\n- Zastrzelili go, bo ich zaczął wkurwiać.',NULL,NULL),(281,NULL,'2021-11-24 10:26:37','2021-11-24 10:26:37','Poprawiny i wahanie się','Siedzi Góral na kamieniu i duma. Podchodzi do niego turysta i pyta:\n- Góralu co tak dumasz?\n- góral na to: Waham się!\n- A czego się wahasz?\n- Wczoraj byliśmy z żoną na weselu i żonę zgwałcili a mnie pobili i dzisiaj zaprosili Nas na poprawiny.\n- I co?\n- żona idzie a ja się waham!',NULL,NULL),(282,NULL,'2021-11-24 10:30:39','2021-11-24 10:30:39','Dosiadanie się do dziewczyny','Dosiadłem się kiedyś do dziewczyny.\nOt tak, zagadać, zapoznać się...\nA ona jak nie wrzaśnie:\n- Wynoś się stąd, zboczeńcu! To DAMSKA toaleta!!!',NULL,NULL),(283,8,'2021-11-24 13:53:08','2021-11-24 13:53:08','Utrzymywanie znajomości po latach','Żałuję ale większość starych znajomości już potraciłem\nNie utrzymuje kontantku z nikim z młodych lat.\nI bardzo podziwiam osoby, które mimo upływu lat wciąż trzymają się w tej samej niezmiennej grupie.\nOstatnio spotkałem takiego człowieka, który wciąż spotyka się z ludźmi z studiów i to z wszystkimi.\nPytam się go jaki jest tego sekret\nA on mi:\n- Wspólna praca w Maku',NULL,NULL),(284,8,'2021-11-26 12:57:23','2021-11-26 13:29:19','Wódeczka i koledzy','Chciałem się napić wódeczki\nZaczałem więc dzwonić po kolegach i mówiłem im, że mam ochotę napić się wódeczki\nAle każdy po kolei mi odmawiał\nŻaden z nich nie chciał mi dać pieniędzy',NULL,NULL),(285,8,'2021-11-26 13:26:54','2021-11-26 13:26:54','Wolność po zerwaniu','Po zerwaniu z dziewczyną poczułem wolność\nTeraz byłem sam sobie sterem, wędkarzem i rybą\nUznałem, że wprowadzę w życiu zmiany i zacznę robić rzeczy, których już dawno nie robiłem\nCzyli zacząłem płakać i dostałem depresji.',NULL,NULL),(286,8,'2021-11-26 15:09:31','2021-11-26 15:09:31','Zboczone zdjęcie','Przypięto mi etykietę zboczeńca i to tylko przez jdeno zdjęcie\nPrzez zdjęcie spodni w przedszkolu',NULL,NULL),(287,8,'2021-11-26 15:13:08','2021-11-26 15:13:08','Pies mnie gonił','Ostatnio gonił mnie ogromny pies, pitbull\nNapoczątku po prostu zaczał za mną iść ale jak przyśpieszałem kroku to i on przyśpieszał\nW końcu zaczałem uciekać, a on za mną biegnie i mnie goni\nW końcu nie miałem siły biec to się zatrzymałem i on też się zatrzymał\nIdę dalej, a on za mną\nZnowu biegnę to on mnie goni\nZatrzymuje się i on też\nI tak się to powtórzyło parę razy aż w końcu sobie uświadomiłem, że mi się noga w jego smycz wplątała',NULL,NULL),(288,18,'2021-11-29 14:20:45','2021-11-29 14:20:45','Nowa maszyna w siłowni','Byłem dzisiaj na siłowni. Przywieźli nową maszynę, całkiem fajna. Po pół godzinie jednak miałem dość: spuchłem, rzygać mi się chciało.\nAle naprawdę ma wszystko! Żelki, snickersy, marsy, kit-katy.',NULL,NULL),(289,18,'2021-11-29 14:25:03','2021-11-29 14:25:03','Rozmowa w kiblu','Jechał facet autostradą i nagle mu się coś zachciało.\nPotrzeba nie cierpiąca zwłoki.\nDojechał do najbliższej stacji benzynowej i udał się do świątyni dumania.\nKiedy już siedział i się koncentrował, usłyszał jak ktoś wchodzi do kabiny obok.\nPo chwili z tejże kabiny dobiegło pytanie:\n- Cześć, co tam u Ciebie słychać?\nFacet głupio się poczuł, na ogół nie rozmawiał z obcymi, a tu jeszcze w takim miejscu.\nAle niepewnie odpowiedział:\n- Nic, wszystko w porządku.\n- Słuchaj, a powiedz mi co zamierzasz teraz zrobić?\n- No, nie wiem - facet czuł się coraz bardziej skrępowany tą wymianą zdań.\n- Jadę do Gdańska a potem wracam do Katowic.\n- Wiesz co, zadzwonię do Ciebie później. Jakiś debil w kiblu obok odpowiada na wszystkie moje pytania.',NULL,NULL),(290,18,'2021-11-29 14:34:55','2021-11-29 14:34:55','Wpadłem na ex jadąc metrem','Dzisiaj jadąc metrem wpadłem na moją ex.\nTo był jeden z najfajniejszych dni od kiedy jestem motorniczym w metrze.',NULL,NULL),(291,18,'2021-11-29 14:40:37','2021-11-29 14:40:37','Bolek i Lolek w namiocie','Bolek i Lolek śpią w namiocie nagle Bolek pyta Lolka:\nLolek - walisz konia?\nTak\nTo wal swojego.',NULL,NULL),(292,18,'2021-11-29 14:41:20','2021-11-29 14:41:20','Powiedzenie prawdy dziewczynie','Nie za grubo wyglądam w tych dżinsach, pyta dziewczyna chłopaka\n-A nie obrazisz się jak powiem prawdę ?\n-Nie\n-Posuwam twoją siostrę',NULL,NULL),(293,18,'2021-11-29 14:51:05','2021-11-29 14:51:05','Przebaczanie wrogom','Kaznodzieja wygłasza niedzielne kazanie na temat przebaczenia. Po płomiennej przemowie pyta zgromadzonych:\n- Ilu z was, bracia, przebaczy swoim wrogom?\nPołowa wiernych podnosi ręce do góry. Niezadowolony kaznodzieja kontynuuje kazanie. Mija 20 minut i znowu pyta:\n- Ilu z was, bracia, przebaczy swoim wrogom? Tym razem zgłasza się jakieś 80%. Kaznodzieja jeszcze zawiedziony wraca do kazania. Mija kolejne 30 minut. Kaznodzieja znowu pyta:\n- Ilu z was, bracia, przebaczy swoim wrogom?\nPonieważ wszyscy już myślą o obiedzie, wszyscy podnoszą ręce do góry. Wszyscy z wyjątkiem staruszki z drugiego rzędu. Kaznodzieja pyta:\n- Dlaczego pani nie chce przebaczyć wrogom?\n- Nie mam żadnych.\n- Jakie to niezwykłe! Ile pani ma lat?\n- 93.\n- Niech pani wyjdzie na środek i powie wszystkim jak to możliwe, żeby w takim sędziwym wieku nie mieć żadnych wrogów.\nStaruszka nieśmiało wychodzi na środek, bierze mikrofon i mówi:\n- Przeżyłam wszystkich skurwysynów!',NULL,NULL),(294,18,'2021-11-29 14:56:28','2021-11-29 14:56:28','Bulborator','Porucznik sprawdza umiejętności 3 nowych szeregowych:\n-Powiedzcie nam, co potraficie zrobić pożytecznego?\nPierwszy mówi:\n-Ja potrafię obsługiwać komputer.\n-Dobrze, może być, a Ty?\n-Ja znam się na gotowaniu - mówi drugi.\n-Nieźle. A co Ty potrafisz? - pyta trzeciego.\n-Ja potrafię zrobić bulbulator.\n-A co to jest?\n-Proszę o kawałek blachy, gwoździe, młotek i szklankę wody to pokażę.\nOtrzymał to, o co prosił, wbił gwoździe w blachę, robiąc w niej dziurki, zalał to wodą i mówi:\n-Robi bulbul? No to bulbulator!\nZirytowany porucznik:\n-Ty głupi jesteś, będziesz hańbą dla wojska!\nI wyrzuca blachę przez okno. Po chwili przychodzi major:\n-k***a! Co za tępy ch*j wyrzucił nowy bulbulator!?',NULL,NULL),(295,8,'2021-11-29 15:34:27','2021-11-29 15:34:27','Wykładowca pokazujący penisa','Na studiach miałem takiego wykładowcę\nKtóry na każdych zajęciach jak tylko whcodził do auli to stawał naprzeciwko nas\nI pokazywał nam penisa\nŻadnego dzieńdobry ani nic...\nPo prostu pokazywał nam penisa\nPotem kładł na nim dłon\nKlepnął pare razy i mówił:\n- Kto to kurwa narysował na tablicy',NULL,NULL),(296,18,'2021-12-19 22:10:25','2021-12-19 22:10:25','Kierowca namawiający chłopczyka','Siedmioletni chłopczyk idzie chodnikiem w drodze ze szkoły.\nPodjeżdża samochód. Kierowca odsuwa szybkę i mówi :\nchłopcze, wsiadaj do środka, to dam Ci 10 złotych i lizaka !\nChłopczyk nie reaguje i przyspiesza kroku. Samochód powoli\ntoczy się za nim. Znowu się zatrzymuje przy krawężniku ...\nno wsiadaj! Dam Ci 20 złotych, lizaka i chipsy !\nChłopczyk ponownie kręci głową i przyspiesza kroku ...\nSamochód nadal powoli jedzie za nim.\nZnowu się zatrzymuje ...moja ostatnia oferta:\n50 złotych, chipsy, cola i pudełko chupa-chups - wsiadasz? !\nOj odczep się..... Tato!!!! Kupiłeś Matiza?, to musisz z tym żyć ........\nmnie w to nie mieszaj..............!!!',NULL,NULL),(297,18,'2021-12-19 22:26:19','2021-12-19 22:26:19','Seks grupowy po ciemku','Była sobie para, która poszła do restauracji na obiad. Po paru minutach weszła następna para ich znajomych. Posiedzieli, zjedli, pogadali ale zaczęło być już nudno. Postanowili umówić się w mieszkaniu jednej pary na sex grupowy. Weszli do mieszkania, zgasili światło i zaczęła się zabawa. Mija godzina, dwie, trzy w końcu gościu wstaje zapala światło i mówi.\n- Nie no k**wa musimy ustalić jakieś zasady bo już trzeci raz laskę robię !',NULL,NULL),(298,18,'2021-12-19 22:32:55','2021-12-19 22:32:55','Żona szwenda się po pubach','Adwokat pyta swojego klienta:\n- Dlaczego chce się pan rozwieść?\n- Bo moja żona cały czas szwenda się po knajpach!\n- Pije?\n- Nie, łazi za mną!',NULL,NULL),(299,18,'2021-12-19 22:34:23','2021-12-19 22:34:23','Sraczka, dywan i pies','Przychodzi pijany koleś do dziewczyny...ale ona nie zdążyła się uszykować,więc otwiera owinięta ręcznikiem i mówi:\n-Proszę, wejdź do salonu,ja idę do łazienki,dokończę się malować,za góra 15 min będę gotowa.\nChłopak usiadł na kanapie w salonie i zachciało mu się srać.Myśli sobie...k**wa jaki przypał,ja tu u laski na chacie,kibel zajęty a ja zaraz się zesram.Nagle patrzy a tu na dywanie siedzi pies,myśli...zesram się na dywanie i będzie na psa.I tak zrobił.\nWychodzi dziewczyna z łazienki,patrzy i mówi:\n-Ku*wa!!!co to jest????\nChłopak na to:\n-Noooo pies się zesrał...\nDziewczyna:\n-Ku*waaa pluszowy!!!!????',NULL,NULL),(300,18,'2021-12-19 22:35:53','2021-12-19 22:35:53','Uspokojenie bezstresowo wychowanego dzieciaka','Dwie pary małżonków grają w karty. Czternastoletni synek jednej z par (bezstresowo wychowany) bez przerwy im przeszkadza i nie daje grać w spokoju.\nMężczyzna zaprzyjaźnionej pary nie wytrzymał i wziął młodego na bok, wrócił po chwili bez niego i wrócili di gry.\nPo godzinie ojciec chłopca nie wytrzymuje i pyta:\n- Ty stary co ty mu zrobiłeś że jest taki spokój i nie ma go tyle czasu?\n- A nauczyłem go konia walić.',NULL,NULL),(301,18,'2021-12-19 22:36:48','2021-12-19 22:36:48','Trafianie do łóżka po ciemku','Wraca nawalony gość do domu. Wchodzi. W domu ciemno.\n- Zośkaaa! Weźź jushhhh zacznijjj drzeeeć mooordeee na mnieee, bo dooo łóżkaaa nieeee trafieee!',NULL,NULL),(302,18,'2021-12-19 22:38:36','2021-12-19 22:38:36','Co jest najszybsze na świecie?','Dyrektor firmy potrzebował nowego pracownika. Dał ogłoszenie do pracy, jego ludzie przeegzaminowali wcześniej kandydatów... aż zostało ich w końcu 4-rech najlepszych. Aby rzeczywiście wybrać najlepszego dyrektor postanowił\nprzeegzaminować ich osobiście. Wezwał więc ich do swojego gabinetu i posadził obok siebie. 1-wszego z nich spytał:\n- Co według pana jest najszybsze na świecie?\nFacet pomyślał chwilę i mówi:\n- To myśl. Wpada do głowy, nic jej nie poprzedza po prostu jest.\n- Świetnie - komentuje naprawdę zadowolony z odpowiedzi dyrektor. Zwraca się do 2-giego z tym samym pytaniem.\n- Mrugnięcie - odpowiada kandydat - mruga się okiem cały czas a nawet tego nie zauważamy.\n- Bardzo dobrze - mówi dyrektor i pyta 3-go. Ten miał więcej czasu więc starannie przygotował odpowiedź:\n- No więc w domu mojego ojca jak wyjdzie się na zewnątrz budynku to jest tam taki mur. Jest na nim przycisk jak się go wciśnie to momentalnie zapala się światło na całej posesji. Nie ma nic szybszego niż włączenie światła.\n- Doskonale! A pan? - pyta 4-tego kandydata.\n- Według mnie najszybsza jest sraczka.\n- Co?! - pyta zdziwiony dyrektor.\n- Spokojnie, już wyjaśniam. Widzi pan przedwczoraj źle się poczułem i pobiegłem do kibla. Ale zanim zdążyłem pomyśleć, mrugnąć czy włączyć światło zesrałem się w gacie.',NULL,NULL),(303,18,'2021-12-19 22:40:16','2021-12-19 22:40:16','Chodzi bo chce seksu','Chodzi w nocy facet po pokoju, chodzi i chodzi.\n- Co tak chodzisz?? pyta żona\n- A seksu mi się chce.\n-No to chodź.\n-No przecież ku..wa chodzę!!',NULL,NULL),(304,18,'2021-12-19 22:41:33','2021-12-19 22:41:33','pies liżący jajka','Dwóch kolesi widzi psa liżącego sobie jajka. Jeden mówi do drugiego:\n- Patrz jak zajebiście! Też bym tak chciał!\n- E, lepiej nie próbuj człowieku, bo cię ugryzie...',NULL,NULL),(305,18,'2021-12-19 22:47:00','2021-12-19 22:47:00','Ławka i przeklinanie','Siedzi sobie dziewczyna na ławce w parku i przeklina\n- O k**wa jego mać!\nIdzie chłopak i to słyszy i mówi do niej:\n- Słuchaj, panna jesteś i nie pasuje żebyś przeklinała jak szewc.\nA ona:\n- Siadaj koło mnie to Ci powiem dlaczego...\nChłopak siadł i dziewczyna powiedziała mu do ucha. Chłopak zaczął przeklinać:\n- Do ch*ja wafla! Niech to kutas pogryzie!\nUsłyszała to przechodząca obok babcia i mówi do chłopaka żeby nie przeklinał, bo to nieładnie i niekulturalnie on na to:\n- Niech babcia usiądzie przy mnie to powiem babci.\nBabcia usiadła i chłopak powiedział jej do ucha i babcia zaczęła przeklinać:\n- O w pizdę! Spierdolona dola...\nUsłyszał to dziadek, który przechodził obok i mówi do babci:\n- Wstydziłaby się babcia taki przykład młodym dawać.\nA ona na to, aby dziadek usiadł obok niej to mu powie dlaczego. Dziadek usiadł a babcia mówi:\n- Ta ławka jest świeżo malowana...',NULL,NULL),(306,18,'2021-12-19 22:49:36','2021-12-19 22:49:36','Refleks sprzedawcy w supermarkecie','W pewnym supermarkecie klient poprosił młodego sprzedawcę o pół główki sałaty.\nNiestety chłopak zaczął odmawiać. Klient był jednak nieugiety i bardzo napierał, więc sprzedawca poszedł na zaplecze zapytać kierownika\n- Panie kierowniku jakiś palant chce kupić pół główki sałaty.\nW tym momencie sie obejrzał a za nim stoi klient i patrzy na niego i szybko dodał\n- Ale ten pan reflektuje na drugi pół głowki\nKierownik sie zgodził, ale potem poszedł do sprzedawcy i mówi:\n- Chłopcze mogłeś mieć dziś niezłe klopoty, ale wykazałeś sie refleksem i opanowaniem\npotrzebujemy takich ludzi w naszej firmie skąd pochodzisz?\n- Z Nowego Targu proszę pana\n- A dlaczego stamtąd wyjechałeś ?\n- Bo to miasto bez przyszłości proszę pana, same k***y i hokeiści\n- Hmmmm moja żona pochodzi z NowegoTargu !\n- Taaaak? A na jakiej gra pozycji ?',NULL,NULL),(307,18,'2021-12-19 22:56:48','2021-12-19 22:56:48','Wąsy i podobieństwo','Facet w przedziale dłuższą chwilę przygląda się intensywnie towarzyszowi podróży, wreszcie stwierdza:\n- Wie pan, gdyby nie wąsy, wyglądałbyś pan wypisz wymaluj jak moja żona!\n- Przecież ja nie mam wąsów!\n- Ona ma....',NULL,NULL),(308,18,'2021-12-19 22:58:37','2021-12-19 22:58:37','O Matko!','Mąż z żoną ogląda horror.\nNagle na ekranie pojawia się przerażająca, kobieca postać.\nŻona wystraszona wykrzyknęła:\n- O matko!!!\n- Poznałaś, co?',NULL,NULL),(309,18,'2021-12-19 22:59:43','2021-12-19 22:59:43','Problem z planowaniem','Idzie środkiem ulicy facet (nogi szeroko, przygarbiony) za nim dwóch studentów medycyny zaczyna się kłócić:\n- Ja uważam, że ten pan ma problem z hemoroidami.\n- Nie, nie on ma na pewno problemy z kręgosłupem.\nZałożyli się i podchodzą do gościa mówiąc:\n- Dzień dobry panu, my jesteśmy studentami medycyny i założyliśmy się. Kolega uważa, że ma pan problem z hemoroidami, a ja, że z kręgosłupem. Może nam pan powiedzieć, który z nas ma rację?\n- Niestety żaden, mam problem z planowaniem, bo planowałem puścić bąka, a się zesrałem.',NULL,NULL),(310,18,'2021-12-19 23:01:15','2021-12-19 23:01:15','Nowe miejsca pracy dla polaków','Premier Donald Tusk obiecał 400 tysięcy nowych miejsc pracy. Minister pracy Wielkiej Brytanii zaprzecza tym informacjom...',NULL,NULL),(311,18,'2021-12-19 23:03:19','2021-12-19 23:03:19','Na jeden numerek?','Przychodzi para do knajpki i zostawia płaszcze w szatni.\nSzatniarz pyta:\n- Na jeden numerek?\n- Nie, na kawę. - odpowiada facet.',NULL,NULL),(312,18,'2021-12-19 23:10:33','2021-12-19 23:10:33','Reinkarnacja jako kura','Kazik od zawsze robił to co lubił: całował żonę, wślizgiwał się do wyrka i od razu zasypiał. Pewnego dnia obudził się obok podstarzałego faceta ubranego w biały szlafrok.\n- Co do cholery robisz w moim łóżku? I kim do diabła jesteś? - zapytał Kazik.\n- To nie jest twoja sypialnia. Jestem św. Piotr i jesteś w niebie - odpowiedział facet w szlafroku.\n- Że co?! Twierdzisz, że jestem martwy? Nie chcę umierać, jestem na to jeszcze za młody! Chcę natychmiast wrócić na Ziemię!\n- To nie takie proste - odpowiedział Święty. - Możesz wrócić jako kura albo jako pies. Wybór należy do ciebie.\nKazio pomyślał przez chwilę i doszedł do wniosku, że bycie psem jest stanowczo za bardzo męczące, a życie kury wydaje się być miłe i relaksujące. Bieganie po zagrodzie z kogutem nie może być złe.\n- Chcę powrócić jako kura - odpowiedział.\nW kilka sekund później znalazł się w skórze całkiem przyzwoicie upierzonej kury. Nagle jednak poczuł, że jego kuper zaraz eksploduje.\nWtedy podszedł do niego kogut.\n- Hej! To pewnie ty jesteś tą nową kurą, o której mówił mi św. Piotr - powiedział kogut. - Jak ci się podoba bycie kurą?\n- No jest ok, ale mam to dziwne uczucie, że mi kuper zaraz eksploduje...\n- Ooo, no tak. To znaczy, że musisz znieść jajko - powiedział kogut.\n- Jak mam to zrobić?\n- Gdaknij dwa razy i zaprzyj się jak najmocniej potrafisz.\nKazio zagdakał i zaparł się jak najmocniej potrafił. Nagle \"chlust\" i jajko było już na ziemi.\n- Łoł, to było zaje*iste - powiedział Kazik.\nZagdakał jeszcze raz, zaparł się i wypadło z niego kolejne jajo. Za trzecim razem, gdy zagdakał, usłyszał krzyk swojej żony:\n- Kazik, co ty do cholery robisz?! Obudź się! Zasrałeś całe łóżko!!!',NULL,NULL),(313,18,'2021-12-19 23:11:13','2021-12-19 23:11:13','Czerwona koszula','Rok 1497. Płynie sobie statek piracki straszliwego kapitana \"Rudobrodego\". Nagle na horyzoncie pojawia się statek towarowy. Majtek z bocianiego gniazda woła:\n- Kapitanie statek towarowy na horyzoncie!\n- Dobra jest! Podajcie moją czerwoną koszulę!\nKapitan założył koszulę, dokonali abordażu, straszliwej rzezi i statek był ich. Płyną dalej. Nagle na horyzoncie pojawia się drugi statek towarowy. Majtek z bocianiego gniazda woła:\n- Kapitanie statek towarowy na horyzoncie!\n- Dobra jest! Podajcie moją czerwoną koszulą!\nZnów założył koszulę, dokonali abordażu, straszliwej rzezi i statek był ich.\nPo kilku takich \"akcjach\", jeden z marynarzy pyta:\n- Kapitanie! Dlaczego na \"akcje\" zawsze zakłada pan czerwoną koszulę?\n- Bo jak napadamy na statek, to mogą mnie przecież ranić, a na czerwonej koszuli nie widać plam krwi. A gdy nie widać, że kapitan jest ranny, to duch załogi nie upada i wszyscy walczą jak lwy!\nW tym momencie majtek z bocianiego gniazda woła:\n- Kapitanie 12 brytyjskich statków wojennych!\n- Dobra jest! Podajcie moje brązowe spodnie.',NULL,NULL),(314,18,'2021-12-19 23:16:18','2021-12-19 23:16:18','Ibrachim i kara','Jeden z krajów islamskich. Po ulicy idzie całkowicie \"okutana\" dziewczyna, widać tylko jej ogromne czarne oczy. Kieruje się w stronę przepięknej rezydencji. Nagle przechodzący obok młody chłopak uśmiecha się do niej i puszcza oko. Dziewczę rzuca się biegiem do drzwi wielkiego domu, wpada do ogromnego gabinetu i krzyczy pokazując palcem przez okno:\n- Tato, ten chłopak mnie zaczepił.\nA na nieszczęście chłopaka tata był generałem. Szybko wezwał, więc swoich żołnierzy i rozkazał schwytać młodzika. Po pięciu minutach blady jak śmierć chłopak został postawiony przed obliczem groźnego i rozsierdzonego ojca- generała:\n-Ty gnoju, ty psie - wrzasnął generał - jak śmiałeś podnieść wzrok na moją córkę? Ibrachim!!! - zawołał\nJak spod ziemi wyrósł wielki śniadolicy, brodaty mężczyzna w mundurze z dystynkcjami sierżanta.\nIbrachim - znowu wykrzyczał generał - weźmiesz tego łajdaka, zawieziesz go na naszą ukrytą farmę na pustyni i go wyruchasz.\nSierżant zasalutował, złapał chłopca za oszewę i pociągnął go do dżipa. Przykuł go kajdankami do siedzenia i ruszył w stronę rogatek miasta.\nPo paru minutach jazdy chłopak odzyskał mowę i cichutko zaproponował:\n- Ibrachim, dam ci 200 dolarów jak mnie nie wyruchasz.\nNic zero reakcji.\n- Ibrachim - próbuje znowu młody - dam ci 500 dolarów, ale nie ruchaj mnie, co.\nDalej nic.\nIbrachim, dam 1000 dol.....\nW tym momencie sierżant spojrzał na niego tak, że odechciało mu się znowu mówić.\nDojechali do farmy, brodaty wojskowy wywlekł chłopca z samochodu, wciągnął do środka, rzucił na łóżko i zdarł z niego spodnie. Potem zaczął sam się rozbierać. Był już prawie nago, gdy zadzwonił telefon. Wrzask w słuchawce był tak wielki, że nawet leżący twarzą w poduszce chłopak usłyszał generała:\n- Ibrachim, natychmiast wracaj.\nIbrachim ubrał się, kazał ubrać się chłopakowi, przykuł go do siedzenia w dżipie i pojechali z powrotem do miasta. Weszli do rezydencji gdzie generał czerwony ze złości wrzeszczał na dwóch młodych arabów:\n- Ibrachim, weźmiesz tych dwóch i ich rozstrzelasz.\nSierżant zgarnął całą trójkę wsadził ich do dżipa przykuł kajdankami do foteli i ruszyli. Droga przebiegała w złowieszczym milczeniu. Przerwał je cichy proszący głos naszego pierwszego chłopaka:\n- Ibrachim, ale pamiętasz? Mnie wyruchać.',NULL,NULL),(315,18,'2021-12-19 23:18:54','2021-12-19 23:18:54','miś, łoś i ryś','Idą sobie dróżką trzej przyjaciele: miś,łoś i ryś. Ten pierwszy oznajmia:\n- Wkurwia mnie to \"ś\" na końcu. Takie \"ś\" jest pedalskie, ciotowate i w ogóle!...\nOd dzisiaj koniec z misiem. Jestem Niedźwiedź!!! Bo powiadam wam: kto ma \"ś\" na końcu, ten fujara i gej. Amen. Łoś zorientowawszy się w beznadziei sytuacji,\nbo wszak łoś to łoś i nic nie poradzisz, w panice szarpie za ramię Rysia:\n- Ej, k**wa, powiedz coś, Ryś. Przecież my nie geje, prawda?! No powiedz coś...Ryś!...\nNa to ryś dostojnie:\n- Ryszard, pedale, Ryszard...',NULL,NULL),(316,18,'2021-12-19 23:21:31','2021-12-19 23:21:31','Rozprawa o dziecko i automat z słodyczami','﻿\nW sądzie trwa rozprawa rozwodowa, a dokładniej sprawa o przyznanie opieki nad dzieckiem.\nMatka (jeszcze żona, już nie kochanka) wstała i jasno dała do zrozumienia sędziemu, że dzieci należą się jej.\nTo ona je urodziła, więc to są jej dzieci.\nSędzia zwrócił się do męża, co on ma do powiedzenia.\nMaż przez chwilę milczał, po czym powoli podniósł się z krzesła i rzekł:\n- Panie sędzio, kiedy wkładam złotówkę do automatu ze słodyczami i wypada z niego batonik, to czy batonik należy do mnie, czy do automatu?',NULL,NULL),(317,18,'2021-12-19 23:27:51','2021-12-19 23:27:51','Zając i przekonywanie lisicy','Zajączek przychodzi do nory lisa , puka ale otwiera mu lisica.\n- stary jest?\n- nie, na ryby poszedł\n- słuchaj lisica dam Ci 100zł jak mi zrobisz laskę.\n- nie no co Ty 100zł to mało, zresztą zaraz stary może wrócić.\n- dobra lisica dam ci 200zl jak mi zrobisz laskę.\nLisica pomyślała, że 200zł piechotą nie chodzi i zrobiła mu laskę. Zając zadowolony, ale po 2 minutach mówi do lisicy\n- słuchaj lisica dam Ci 300zł jak mi dasz dupy.\n- zając no co Ty 200zł mi dałeś za laskę a teraz za danie dupy z trzema stówami wyskakujesz?\n- No dobra lisica dam Ci 500zł\nNo i lisica dała mu dupy za 500zł poszedł zając zadowolony do domu. Po godzinie wraca lis.\n- zając był?\n- no był\n- pieniądze oddał?',NULL,NULL),(318,18,'2021-12-19 23:30:45','2021-12-19 23:30:45','Zatrzymanie przed zebrą','Moja żona myśli, że oblała prawko w momencie, w którym nie zatrzymała się przed zebrą. Ja wiem, że stało się to już w momencie wjechania do zoo.',NULL,NULL),(319,18,'2021-12-19 23:31:25','2021-12-19 23:31:25','Wyśmienity weekend','Mówi żona do męża:\n- Kochanie, sprawmy sobie wyśmienity weekend!\n- Cudowny pomysł moja droga, do zobaczenia w poniedziałek.',NULL,NULL),(320,18,'2021-12-19 23:33:16','2021-12-19 23:33:16','Zima i kupowanie piwa','Rozmowa męża z żoną:\n- Piwo się skończyło! Skoczysz do sklepu?\n- Ale na zewnątrz jest lód, jeszcze się wywrócę!\n- To kup w puszce, żeby się nie stłukło.',NULL,NULL),(321,18,'2021-12-20 10:40:38','2021-12-20 10:40:38','Chłodni dupy nie urywa','W restauracji:\n- Jak panu smakował chłodnik?\n- Dupy nie urywa.\n- Cierpliwości.',NULL,NULL),(322,18,'2021-12-20 10:54:54','2021-12-20 10:54:54','Wyłowienie kupy','Był sobie fanatyk wędkowania. Pewnego dnia dowiedział się o fantastycznym wprost miejscu, małym jeziorku w lesie, gdzie ryby o wielkości niesamowitej same wskakują na haczyk. Nie mógł się już doczekać weekendu, zakombinował w pracy, pozamieniał się na dyżury, nastawił budzik na 4 rano, po długiej podróży odnalazł małe jeziorko w lesie, rozstawił wędki i czekał... godzinę... drugą godzinę trzecią... wreszcie spławik drgnął... wędkarz szarpnął... i wyciągnął ogromną nadzianą na haczyk kupę. Zaklął szpetnie i zauważył, że z tyłu ktoś za nim stoi. Był to miejscowy. Wędkarz z żalem powiedział:\n- no patrz pan, taki kawał drogi jechałem, tyle wysiłku, kombinowania, i co? KUPA...\nNa to gościu:\n- A bo wie pan, z tym jeziorkiem związana jest pewna legenda. Otóż niech pan sobie wyobrazi, przed 1 wojną światową żyl tu chłopak i piękna dziewczyna, kochali się niesamowicie. Ale wzięli go do wojska. Po jakimś czasie nadeszła wiadomość że on zginął na froncie. I proszę sobie wyobrazić, że ona przyszła tu, nad to jeziorko i z wielkiego żalu się utopiła!\n- Niesamowite - odparł wędkarz\n- Ale to jeszcze nie koniec proszę pana! Otóż po wojnie okazało się, że chłopak przeżył, był tylko ranny. przyjechał tu, dowiedział się o wszystkim, przyszedł tu, w to miejsce na którym pan siedzi, i z żalu i wielkiej miłości również sie utopił!\n- To szokująca historia- powiedział wędkarz - ale co z tą kupą\n- A to nie wiem. Widocznie ktoś nasrał.',NULL,NULL),(323,18,'2021-12-20 10:56:30','2021-12-20 10:56:30','Scena erotyczna w filmie','Oglądałem z synem film, w którym pojawiła się scena erotyczna.\n- OK, chyba czas żebyś poszedł do łóżka.\n- Tato, ja mam 18 lat.\n- Nie obchodzi mnie ile masz lat, nie będziesz patrzył jak walę konia',NULL,NULL),(324,18,'2021-12-20 11:00:14','2021-12-20 11:00:14','Kierownice w psychiatryku','Przychodzi facet z sanepidu na kontrolę do szpitala psychiatrycznego, a tam wszyscy z kierownicami biegają. Idzie więc do odrynatora i pyta:\n- Co się stało, że tam wszyscy z kierownicami biegają?\nOrdynator wyjmuje z szuflady kierownicę i mówi:\n- Jedziemy sprawdzić!',NULL,NULL),(325,18,'2021-12-20 11:45:53','2021-12-20 11:45:53','Spakowanie gwoździ','Matka pakuje syna na wycieczkę:\n- Zapakowałam ci chleb, masło i kilogram gwoździ.\n- Po co?\n- Jak to po co? Posmarujesz chleb masłem i zjesz.\n- A gwoździe!?\n- Tu są. Przecież spakowałam.',NULL,NULL),(326,18,'2021-12-20 11:48:12','2021-12-20 11:48:12','Klinika medyczna na wszystko','Pewien bezrobotny inżynier nie mogąc od dłuższego czasu znaleźć zatrudnienia postanowił zmienić fach i założyć własną klinikę. Na budynku wywiesił szyld z napisem ?Wyleczymy twoją dolegliwość za 500 zł, w przeciwnym wypadku damy ci 1000 zł?. Przechodzący obok lekarz postanowił to wykorzystać i trochę zarobić.\n- Dzień dobry, nie wiem co się stało, straciłem smak?\n- Siostro, proszę przynieść pudełko 22, jest w nim syrop. Proszę go podać pacjentowi.\n- Dobrze. Proszę otworzyć usta?\n- Fuj? przecież to benzyna!\n- Gratulacje, odzyskał pan smak, 500 zł.\nWściekły lekarz zapłacił. Po kilku dniach wrócił do kliniki:\n- Dzień dobry, straciłem pamięć, pomóżcie mi ją odzyskać?\n- Siostro, proszę przynieść pudełko 22, jest w nim syrop. Proszę go podać pacjentowi.\n- Dobrze, już podaję?\n- Ale przecież tam jest benzyna!\n- Gratuluję, odzyskał pan pamięć, 500 zł.\nJeszcze bardziej zdenerwowany lekarz zapłacił, jednak po kilku kolejnych dniach ponownie postanowił się odgryźć:\n- Dzień dobry, straciłem wzrok, proszę mi pomóc?\n- Przykro mi, nie mamy na to lekarstwa. Proszę, tu jest pana 1000 zł.\n- Ale tu jest tylko 500 zł?\n- Gratuluję, odzyskał pan wzrok, należy się 500 zł.',NULL,NULL),(327,18,'2021-12-20 11:50:08','2021-12-20 11:50:08','Mokra podłoga i zabójstwo','Dwóch gliniarzy łączy się przez radio z wydziałem zabójstw:\n- Przyślijcie ekipę...\n- Jaka sytuacja?\n- Zabójstwo, ofiara to mężczyzna, lat 38, matka uderzyła go nożem kilkanaście razy za to, że wszedł na mokrą, dopiero co umytą podłogę.\n- Aresztowaliście matkę?\n- Nie, podłoga jeszcze mokra.',NULL,NULL),(328,18,'2021-12-20 11:56:21','2021-12-20 11:56:21','Na drugie?','Wchodzi blondynka do windy, a tam stoi facet i pyta się:\n-Na drugie ?\n-Agnieszka.',NULL,NULL),(329,18,'2021-12-20 12:31:27','2021-12-20 12:31:27','Żona z wałkiem w ręku','Wraca pijany mąż późną nocą do domu. Otwiera drzwi, w korytarzu czeka na niego żona z wałkiem w ręku i teściowa z patelnią?\n- Idźcie spać, nie jestem głodny.',NULL,NULL),(330,18,'2021-12-20 12:36:24','2021-12-20 12:36:24','Leczenie przez całusy','Para zakochanych siedzi w parku, całują się, rozmawiają nagle dziewczyna:\n- Kochanie, boli mnie rączka.\nChłopak całuje ją w rękę:\n- A teraz?\n- Teraz już nie, ale zaczął mnie boleć policzek!\nChłopak całuje ją w policzek:\n- A teraz?\n- Hi, hi! Teraz już nie, ale zaczęły mnie usta boleć.\nChłopak całuje ją w usta:\n- A teraz?\n- Już nie.\nNa to staruszek siedzący niedaleko na ławce:\n- Przepraszam, a czy hemoroidy też pan leczy?',NULL,NULL),(331,18,'2021-12-20 12:45:54','2021-12-20 12:45:54','Żona i deszcz za oknem','Za oknem ciągle pada ..... moja żona stoi smutna w oknie ...\nJeszcze trochę tak popada i będę musiał ją wpuścić.',NULL,NULL),(332,18,'2021-12-20 12:51:31','2021-12-20 12:51:31','Patrz przed siebie, idioto!','Jedzie chłopak z dziewczyną autem.\nChłopak kieruje, a dziewczyna siedzi z tyłu.\nChłopak się odwraca:\nOna:\n- Patrz na drogę!\n- Patrz przed siebie, idioto!\n- Na miłosć boską, patrz gdzie jedziesz!\nOn - nie wytrzymuje:\nZamknij ryj kretynko - cofam!',NULL,NULL),(333,8,'2021-12-20 13:28:54','2021-12-20 13:28:54','Podrywanie dziewczyn w klubie','Ostatnio byłem w klubie\nI wpierw tańczyłem z taką Pauliną\nPotem tańczyłem z Moniką\nAle ostatecznie z klubu wyszedłem z Anitą\nAni tą, ani tamtą...',NULL,NULL),(334,18,'2021-12-20 20:42:36','2021-12-20 20:42:36','Spowiedź i ukrywanie żyda','Ksiądz przychodzi do spowiedzi i mówi:\n- proszę księdza bo ja w czasie wojny ukrywałem żyda w piwnicy\n- to nie jest zły uczynek\n- no ale proszę księdza on mi płacił 100 złotych dziennie\n- to nic ryzykowałeś życie\nDziadek odchodzi ale po chwili wraca i mówi:\n- to może powinienem mu powiedzieć że wojna się już skończyła?',NULL,NULL),(335,18,'2021-12-20 20:44:32','2021-12-20 20:44:32','Pierwsza sekcja zwłok','Na akademii medycznej skacowani studenci mają zajęcia z anatomii i pierwszy raz mają być świadkami sekcji zwłok. Stoją wokół łóżka z ciałem. Prowadzący zajęcia nagłym ruchem ściąga prześcieradło i oczom wszystkich ukazuje się topielec w drugim tygodniu rozkładu.\nDłonie studenciaków wędrują w kierunku ust, a profesor ze stoickim spokojem zaczyna wykład:\n- Podczas tych zajęć dowiecie się jakie są dwie najważniejsze rzeczy cech*jące lekarza. Po pierwsze: brak jakiegokolwiek obrzydzenia. Po tych słowach lekarz wpycha palec w dupę topielca, po czym go wyjmuje i, ku obrzydzeniu studentów, oblizuje.\n- Teraz - mówi - wszyscy, którym zależy na zaliczeniu mają to powtórzyć!\nStudenci medycyny to sami twardziele. Podchodzą i robią co im profesor kazał: palec w dupę, palec w buzię. Co drugi nie daje rady i po wszystkim wymiotuje. Gdy wszyscy skończyli profesor mówi:\n- I tak dochodzimy, do drugiej istotnej cechy dobrego lekarza: umiejętność obserwacji. Ja wsadziłem środkowy palec, a oblizałem wskazujący.\nNa przyszłość proszę o więcej uwagi.',NULL,NULL),(336,18,'2021-12-20 21:08:18','2021-12-20 21:08:18','Bill Gates i spotkanie biznesowe','W zeszłym tygodniu byłem na spotkaniu VIP-ów w Seattle. W salonie spostrzegłem Billa Gatesa siedzącego na kanapie i pijącego koniak. Byłem umówiony na spotkanie z bardzo ważnym klientem, który przyleciał do Seattle razem ze mną, ale trochę się spóźniał. Będąc śmiałym facetem, podszedłem do Gatesa i przedstawiłem się. Wyjaśniłem mu, że przeprowadzam bardzo ważny interes i dodałem, jak bardzo by mi pomogło, gdyby podszedł do mnie, kiedy będę z klientem i powiedział do mnie: \"Cześć, Krzysiu\". Zgodził się. 10 minut później, kiedy rozmawiałem z klientem, poczułem klepnięcie w ramię. To był Bill Gates. Odwróciłem się i spojrzałem na niego.\n- Cześć, Krzysiu, jak leci? - zapytał.\nA ja na to:\n- Odpieprz się, Bill, mam spotkanie.',NULL,NULL),(337,18,'2021-12-20 21:18:25','2021-12-20 21:18:25','Rosół z kur wielu','Staszek pojechał na urlop. Gdy wraca, przewodnik w autobusie mówi:\n- Na koniec naszej wycieczki mam dla was dowcip, dzięki któremu możecie kogoś zwyzywać, a ta osoba się nie obrazi. Uwaga. Panie Staszku, jak się nazywa zupa z wielu kur?\n- Nie wiem - mówi Staszek.\n- Rosół z-kur-wielu.\nCały autobus pęka ze śmiechu.\nNastępnego dnia Staszek idzie do pracy. Postanowił wykorzystać nowy kawał. W biurze zebranie. Szef mówi: - Zanim zaczniemy, niech pan powie, panie Staszku, jak udał się urlop.\n- Świetnie - mówi Staszek. - I mam fajny dowcip.\n- Niech pan opowie.\n- Panie kierowniku, jak nazywa się zupa z wielu kur?\n- Jak?\n- Rosół, ty ch...!',NULL,NULL),(338,18,'2021-12-20 21:36:27','2021-12-20 21:36:27','Jakie wolisz kobiety?','Żona pyta męża:\n- Kochanie, jakie kobiety podobają Ci się najbardziej, piękne czy mądre?\nMąż odpowiada:\n- Ani takie, ani takie. Ty mi się najbardziej podobasz.',NULL,NULL),(339,18,'2021-12-20 21:40:49','2021-12-20 21:40:49','Konsekwentny egzamin','Profesor: Samolot przewoził 500 cegieł. Jedna cegła wypadła z samolotu. Ile cegieł pozostało na pokładzie??\nStudent: Cóż, to proste! 499!\nProfesor: To prawda. Następne pytanie. Jak umieścić słonia w lodówce w trzech krokach??\nStudent: 1. Otwórz lodówkę, 2. Umieść słonia 3. Zamknąć lodówkę.\nProfesor: Następne. Jak umieścić jelenia w lodówce w czterech krokach?\nStudent: 1. Otwórz lodówkę. 2. Wyciągnij słonia. 3. Wsadź jelenia. 4. Zamknij lodówkę.\nProfesor: Doskonałe! Następne pytanie. Król zwierząt lew ma urodziny. Przyszły na nie wszystkie zwierzęta, z wyjątkiem jednego. Którego?\nStudent: Jeleń. Bo jest w lodówce!\nProfesor: Super! Następne. Czy babcia może przejść przez bagna na których żyją krokodyle?\nStudent: Oczywiście, że może. Krokodyle są na urodzinach u lwa.\nProfesor: Doskonale. A teraz ostatnie pytanie. Babcia przechodząc przez bagna niestety zginęła. Jak?\nStudent: Yyy? eee? utonęła?\nProfesor: No i oblałeś synku. Cegła coś ci mówi?',NULL,NULL),(340,18,'2021-12-20 21:42:12','2021-12-20 21:42:12','Środek przeczyszczający na kaszel','Kolega opowiada koledze:\n- Byłem u lekarza i poprosiłem o syrop od kaszlu, a on dał mi nie wiem czemu środek przeczyszczający\n- Zażyłeś ten środek?\n- Zażyłem.\n- I co, kaszlesz?\n- Nie mam odwagi',NULL,NULL),(341,18,'2021-12-20 21:47:52','2021-12-20 21:47:52','Rachunek w hotelu','Małżeństwo po nocy w hotelu idzie zapłacić. Na rachunku widnieje kwota 3000 zł. Oburzona para chce pogadać z kierownikiem.\n-To luksusowy hotel. Posiada saunę, baseny, jacuzzi, kino i sale konferencyjną\n-Ale my z tego nie korzystaliśmy!\n-Ale to wszystko było do waszej dyspozycji!\nFacet daje mu 300 zł.\n-Ale tu jest 300 zł! Gdzie reszta?\n-2700 zł jest za przespanie się z moją żoną.\n-Co?? Ja z nią nie spałem!\n-Cóż... była do pana dyspozycji...',NULL,NULL),(342,18,'2021-12-20 21:58:06','2021-12-20 21:58:06','Ostatnie chwile i ciasteczka','Leży facet na łożu śmierci. Lekarz powiedział, że nie\ndotrwa do rana.\nNagle poczuł z kuchni zapach jego ulubionych ciasteczek\nczekoladowych\nzrobionych przez żonę. Ostatkiem sił wydobył się z\nłóżka i czołga się do kuchni. Zapach tych ciasteczek przypominał mu\ndzieciństwo, on\nwiedział, że zasmakuje ich po raz ostatni. Wczołgał się do kuchni i\nwidzi jak jego żona\nprzygotowuje te ciasteczka, o których teraz marzył. Ostatnimi\nsiłami sięgnął po jedno i w tym momencie żona zdzieliła\ngo ścierką\nmówiąc: -\nZostaw ku**a, to na stypę!',NULL,NULL),(343,18,'2021-12-20 22:49:16','2021-12-20 22:49:16','Szczęście w młodości','- Halinko, pamiętasz jacy byliśmy szczęśliwi dziesięć lat temu?\n- Ależ Stasiu, dziesięć lat temu nie znaliśmy się wcale!\n- No właśnie Halinko, no właśnie.',NULL,NULL),(344,18,'2021-12-20 22:52:25','2021-12-20 22:52:25','Odpierdol się','dres po kłótni z dziewczyną\nodpierdol się\npo godzinie dziewczyna przychodzi w sukience i w szpilkach',NULL,NULL),(345,18,'2021-12-20 23:27:34','2021-12-20 23:27:34','Kara za niezrobienie','Jasiu przychodzi do szkoły i pyta się nauczycielki:\n-Czy ukarałaby mnie pani za coś czego nie zrobiłem?\n-Oczywiście, że nie!\n- To ja nie zrobiłem pracy domowej.',NULL,NULL),(346,18,'2021-12-20 23:30:40','2021-12-20 23:30:40','JEszcze jedna pała...','- Proszę Pani - mówi Jasio do nauczycielki. - Nie chcę Pani straszyć, ale mój tata wczoraj powiedział: \"Jeszcze jedna pała i ktoś dostanie wpierdol!\"',NULL,NULL),(347,18,'2021-12-20 23:37:24','2021-12-20 23:37:24','Pierwszy raz z prostytuką','Młody chłopak pierwszy raz idzie do prostytutki, kładzie się i mówi:\n- Denerwuję się. Nigdy wcześniej nie byłem z prostytutką\n- Spokojnie. Po prostu rozluźnij się i powiedz mi co lubisz.\n- Żółwie..',NULL,NULL),(348,18,'2021-12-21 10:21:32','2021-12-21 10:21:32','13 piętro','Blondynka w łóżku z kochankiem. Nagle słyszą, że mąż dziewczyny wraca do domu.\n-Szybko, wyskocz przez okno!!- Mówi kochankowi przerażona blondyna.\n-Zwariowałaś?! Przecież to trzynaste piętro!!\n-Oj, już nie bądź taki przesądny...',NULL,NULL),(349,18,'2021-12-21 10:24:13','2021-12-21 10:24:13','Kradzież srebrnych łyżeczek','- Halo, Sylwek? Siema.\n- Cześć.\n- Mam do ciebie prośbę: nie przychodź do nas więcej!\n- Dlaczego?!\n- Po twojej ostatniej wizycie srebrne łyżeczki nam zginęły.\n- Jak Boga kocham, ja ich nie ukradłem!\n- Wiem. Znalazły się. Ale niesmak pozostał...',NULL,NULL),(350,18,'2021-12-21 10:30:51','2021-12-21 10:30:51','Zakładanie bucików','Pani przedszkolanka pomaga dziecku założyć wysokie, zimowe butki. Szarpie się, męczy, ciągnie.\n- No, weszły!\nSpocona siedzi na podłodze, dziecko mówi:\n- Ale mam buciki odwrotnie.\nPani patrzy, faktycznie! No to je ściągają, mordują się, sapią. Wciągają je znowu, sapią, ciągną, ale nie chcą wejść.\n- Uuuf, weszły!\nPani siedzi, dyszy, a dziecko mówi:\n- Ale to nie moje buciki.\nPani niebezpiecznie zwężały się oczy. Odczekała i znowu szarpie się z butami ... Zeszły!\nNa to dziecko:\n- Bo to są buciki mojego brata ale mama kazała mi je nosić.\nPani zacisnęła ręce mocno na szafce, odczekała, aż przestaną jej się trząść, i znowu pomaga dziecku wciągnąć buty. Wciągają, wciągają, weszły!.\n- No dobrze, - mówi wykończona pani - a gdzie masz rękawiczki?\n- W bucikach.',NULL,NULL),(351,18,'2021-12-21 10:43:23','2021-12-21 10:43:23','Chamski taksówkarz','Wracał mocno zmęczony gość w nocy do domu. A był tak pijany, że ostatkiem sił i przebłyskiem intelektu postanowił pojechać taksówką.\nZłapał jedną i zwraca się do kierowcy:\n- Szefuńcu na Lipową 23 proszę\nNa to kierowca do niego :\n- Spierdalaj pijaku bo jeszcze mi tapicerke zabrudzisz!\n- Cooooooo ? Spierdalaj ?? O ja cie k**wa jeszcze załtwie złamasie - odparł nasz bohater. Zapamietał numer boczny i postanowł się zemścić za brak szacunku wobec jego osoby.\n\nMineło parę tygodni i na jednym z postojów, tym razem po trzeźwemu, koleś zobaczył swojego taksówkarza - stał prawie na końcu kolejki i czekał na swój kurs. Podchodzi do pierwszego pojazdu i mówi do kierowcy:\n- Szefie zabawimy się na ostro ? Dam panu 200 zł i jedziemy tutaj za róg i robi mi pan pałeczkę z połykiem :)\n- Spadaj zboku ! Won mi z wozu !!!\nI tak chodził po kolei do wszystkich kierowców i reakcja była podobana.\nAż przyszła kolej na naszego taksówkarza. Koleś wsiadł do wozu i mówi:\n- Na Lipową 23 bardzo proszę.\nNa to taksówkarz dumny, że nie musi czekać w długiej kolejce powolutku wyjeżdza spogladając z politowaniem na swoich kolegów.\n\n... a nasz bohater przez tylną szybę z kciukami podniesionym w geście OK pusza oko z radosną miną do wszystkich kierowców stojących w kolejce',NULL,NULL),(352,18,'2021-12-21 11:42:40','2021-12-21 11:42:40','Żona rozbiła auto','Rozmawiają dwaj kumple.\n- Słyszałem że twoja żona rozbiła twoje nowe Porsche. Stało jej się coś?\n- Jeszcze nie, zamknęła się w łazience...',NULL,NULL),(353,18,'2021-12-21 14:29:41','2021-12-21 14:29:41','Czerwony kapturek i babcia','Czerwony Kapturek mówi do babci:\n- Babciu. A dlaczego masz takie duże oczy?\n- Żeby Cię lepiej widzieć.\n- A czemu takie duże uszy?\n- Żeby Cię lepiej słyszeć.\n- A czemu masz taki wielki nos?\n- Ku*wa, sama się w lustrze przejrzyj! Księżniczko zasrana!',NULL,NULL),(354,18,'2021-12-21 15:38:30','2021-12-21 15:38:30','Umierający mąż i żona','Stary, umierający Żyd leży na łożu śmierci, przy nim czuwa żona. Słabnącym głosem mówi do niej:\nKiedy wiele lat temu płynęliśmy w podróż poślubną i leżałem w kajucie złożony chorobą morską - byłaś przy mnie. Kiedy parę lat później złamałem nogę i leżałem w szpitalu - też byłaś przy mnie. Gdy zbankrutowała moja firma - byłaś przy mnie. A teraz kiedy umieram - znów jesteś przy mnie. I ja się tak zastanawiam: czy ty mi nie przynosisz pecha?!',NULL,NULL),(355,18,'2021-12-24 16:04:30','2021-12-24 16:04:30','Krycie kolegi przed żoną','kazik wraca do domu nad ranem lekko podpity. Od progu wita go zona:\n- Gdzie byles lajdaku??!! Pewnie znowu wloczyles sie cala noc!!! Wóda, Dzi...ki i zabawa!!\n- No co ty kochanie. Przeciez bylem u Tadeusza i gralismy w karty.\n- Ciekawe. Zaraz to sprawdzimy.\nBierze telefon i dzwoni do Tadeusza:\n- Tadziu, czy moj kazik byl dzis u Ciebie na kartach??\n- jak byl????!! Siedzi i gra!!!!',NULL,NULL),(356,18,'2021-12-24 16:18:55','2021-12-24 16:18:55','List zwierząt do zjedzenia','Niedźwiedź sporządził listę zwierząt, które chce zjeść. Oczywiście dowiedziały się o tym zwierzęta z lasu i wpadły w panikę. Nazajutrz do niedźwiedzia przyszedł jeleń i pyta:\n- Niedźwiedziu, jestem na liście?\n- Tak.\n- No tak, rozumiem. Słuchaj, daj mi jeden dzień, żebym pożegnał się z rodziną. A potem mnie zjesz.\nNiedźwiedź się zgodził i zjadł jelenia dopiero na drugi dzień. Jako następny przyszedł wilk i pyta:\n- Niedźwiedziu, czy jestem na liście?\n- Jak najbardziej.\n- Ojej, straszne. Słuchaj, pozwol mi żyć jeszcze jeden dzień, a ja pożegnam się z najbliższymi. A potem mnie zjesz.\nI znowu ugodowy niedźwiedź zjadł swoją ofiarę dopiero na drugi dzień. Potem do niedźwiedzia przyszedł zajączek i pyta:\n- Słuchaj, czy jestem na liście?\n- Tak, jesteś.\n- A nie mógłbyś mnie skreślić?\n- Nie ma sprawy.',NULL,NULL),(357,18,'2021-12-24 16:21:19','2021-12-24 16:21:19','Parasol zamiast strzelby','98-letni staruszek przychodzi do lekarza na badania kontrolne. Lekarz pyta go o samopoczucie, na co staruszek odpowiada:\n- Nigdy nie czułem się lepiej. Mam 18-letnią narzeczoną. Jest w ciąży i wkrótce będziemy mieć syna.\nDoktor myśli chwilę i mówi:\n- Niech pan pozwoli, że opowiem panu pewną historię: Pewien myśliwy, który nigdy nie zapominał o sezonie myśliwskim, wyszedł raz z domu w takim pośpiechu, że zamiast strzelby wziął ze sobą parasol. Kiedy znalazł się w lesie, z krzaków wyszedł ogromny niedźwiedź. Myśliwy wyciągnął parasol, wycelował w niedźwiedzia i wypalił. I wie pan co stało się potem?\n- Nie ? odpowiada staruszek.\n- Niedźwiedź padł martwy jak kłoda.\n- Niemożliwe! ? wykrzyknął staruszek. ? Ktoś inny musiał wystrzelić!\n- I do tego punktu właśnie zmierzałem.',NULL,NULL),(358,18,'2021-12-24 16:30:05','2021-12-24 16:30:05','Studia medyczne i kiełbasa','Egzamin z anatomii na studiach medycznych. Przyniesiono dużą skrzynię z narządami ludzkimi przykrytą prześcieradłem. Student wkłada rękę pod prześcieradło, maca i po dotyku ma zgadnąć, jaka to cześć ciała. Jeśli zgadnie, zdaje egzamin.\nWchodzi pierwszy student wkłada rękę pod prześcieradło, maca i mówi:\n- Wątroba.\nWyciąga. Sprawdza. Zdał. Wchodzi drugi, wkłada rękę, maca i mówi:\n- Śledziona.\nWyciąga, nerka. Nie zdał.\nWchodzi studentka, wkłada rękę pod prześcieradło, maca, przesuwając rękę w prawo i w lewo. Mówi:\n- Kiełbasa.\nEgzaminatorzy się uśmiechnęli. Patrzą dziewczyna niczego sobie. Dali jej drugą szansę. Dziewczyna maca przesuwając rękę znowu w prawo i w lewo i mówi:\n- Kiełbasa.\n- Proszę pani - mówi jeden z egzaminatorów - Gdzie u człowieka jest kiełbasa? Dajemy pani jeszcze jedną, ostatnią szansę.\nStudentka zdenerwowana maca, przesuwając ręką w prawo w lewo, znowu w prawo, w lewo krzyczy sfrustrowana:\n- NO, KIEŁBASA!\n- Proszę wyciągnąć - mówi egzaminator.\nStudentka wyciąga, patrzy... i rzeczywiście kiełbasa.\nEgzaminatorzy popatrzyli na siebie zdziwieni i jeden mówi:\n- Ty Franek, to czym my wczoraj tę drugą flachę zagryzali?',NULL,NULL),(359,18,'2021-12-24 16:33:24','2021-12-24 16:33:24','Skoki spadochronowe i chrypa','Skoki spadochronowe desantu. Otwiera się klapa, wszyscy żołnierze skoczyli, tylko jeden siedzi w kącie.\n- A ty dlaczego nie skaczesz? - pyta kapitan.\n- Nie skaczę, bo mam chrypę - mówi zachrypłym głosem skoczek.\n- Nie pie*dol, tylko skacz.\n- Nie skaczę, bo mam chrypę - powtarza skoczek.\nKapitan próbował go wyrzucić, szarpał się trochę z nim, ale nie dał rady. Poszedł więc do pilota i mówi:\n- Słuchaj, włącz automatycznego pilota i chodź, pomożesz mi wyrzucić jednego żołnierza, bo nie chce skoczyć. Mówi że ma chrypę i nie skoczy.\nPilot zrobił tak, jak chciał kapitan. Po krótkiej szamotaninie wyrzucili żołnierza.\nKapitan otarł pot z czoła i mówi:\n- W końcu się udało.\n- No, silny był - pada odpowiedź zachrypłym głosem.',NULL,NULL),(360,18,'2021-12-24 16:35:28','2021-12-24 16:35:28','Samotne dziecko na boisku','Blondynka rozpoczęła prace jako szkolny psycholog.\nZaraz pierwszego dnia zauważyła chłopca, który nie biegał po boisku\nrazem z innymi chłopcami tylko stal samotnie.\nPodeszła do niego i pyta:\n- Dobrze się czujesz?\n- Dobrze.\n- To dlaczego nie biegasz razem z innymi chłopcami?\n- Bo jestem bramkarzem.',NULL,NULL),(361,18,'2021-12-24 16:39:22','2021-12-24 16:39:22','Kochanka i worek z śmieciami','Facet spędza popołudnie u kochanki. Niespodziewanie do domu wraca mąż. Kochanka szybko bierze worek ze śmieciami, daje stojącemu w drzwiach mężowi i mówi:\n- Kochanie proszę cię wynieś śmieci.\nFacet w tym czasie wymknął się niepostrzeżenie, i idąc, w drodze do domu myśli o swojej kochance w samych superlatywach: \"Ta moja kochanka jest inteligentna, sprytna, ale ona to wymyśliła\".\nWchodzi do domu, a tu żona daje mu worek ze śmieciami i mówi:\n- Kochanie, proszę wynieś te śmieci.\nFacet nic nie mówiąc bierze worek, idzie w kierunku śmietnika i mruczy do siebie pod nosem: \"ku**a mać, cały dzień w domu siedzi i nawet śmieci nie wyniesie...\".',NULL,NULL),(362,18,'2021-12-25 14:57:27','2021-12-25 14:57:27','Tysiąc na start','Rozmowa o pracę:\n- A ile będę zarabiać?\n- 1000 zł a później więcej.\n- To ja przyjdę później.',NULL,NULL),(363,18,'2021-12-25 14:58:53','2021-12-25 14:58:53','Rodzinna impreza na podwórku','Działkowiec pyta sąsiada:\n- Co tam wczoraj za święto mieliście, tak wszyscy tańczyliście?\n- Dziadek ul przewrócił.',NULL,NULL),(364,18,'2021-12-25 15:05:02','2021-12-25 15:05:02','Puk puk policja','- Puk, puk.\n- Kto tam?\n- Policja!\n- Musicie poczekać, robię kupę.\n- Wiemy. Budka telefoniczna ma szklane boki..',NULL,NULL),(365,18,'2021-12-25 15:10:28','2021-12-25 15:10:28','Pestki mądrości','Siedzi facet na ulicy obok kosza z pestkami z jabłek.\nPodchodzi policjant i pyta:\n-Co tam masz?\n-Sprzedaję pestki z jabłek.\n-A do czego służą?...\n-Po zjedzeniu jednej człowiek staje się mądrzejszy.\n-A po ile je sprzedajesz?\n-15 zł za sztukę.\n-Daj mi jedną.\nPolicjant zjadł pestkę, pomyślał i mówi:\n-Poczekaj chwilę! Za 15 zł mogłem kupić kilka kilo jabłek i mieć z nich mnóstwo pestek zamiast jednej!\n-Widzi Pan? Już poskutkowało.\n-Rzeczywiście. Daj jeszcze dwie.',NULL,NULL),(366,18,'2021-12-25 15:11:20','2021-12-25 15:11:20','Nasypie na oko','Przychodzi zajączek do nowootwartego sklepu misia i mówi:\n- Misiu, poproszę pól kilo soli..\n- Wiesz zajączku, nie mam jeszcze wagi? Nasypię ci na oko?.\n- Do d*py se nasyp, debilu!',NULL,NULL),(367,18,'2021-12-25 15:19:22','2021-12-25 15:19:22','Użądlenie trzmiela','Blondynka u lekarza\n- Niech mi pan pomoże! Trzmiel mnie użądlił!\n- Spokojnie, zaraz posmarujemy maścią?\n- A jak go pan doktor złapie? Przecież on już poleciał!\n- Nie! Posmaruję to miejsce, gdzie panią użądlił!\n- Aaaa! To było w parku, przy fontannie, na ławce pod drzewem.\n- Kretynko! Posmaruję tą część ciała, w którą cię uciął!\n- To trzeba było od razu tak mówić! W palec mnie użądlił. Boże, jak to boli!\n- Który konkretnie?\n- A skąd mam wiedzieć? Wszystkie trzmiele wyglądają podobnie',NULL,NULL),(368,18,'2021-12-25 15:21:59','2021-12-25 15:21:59','Pogryziony facet u lekarza','Przychodzi koleś do lekarza cały pogryziony.\n-Co się panu stało?\n-Wróciłem do domu trzeźwy i pies mnie nie poznał.',NULL,NULL),(369,18,'2021-12-25 15:30:15','2021-12-25 15:30:15','Kiedy skończysz z narkotykami?','- Widzisz?! To fifka, która była pod twoją szafą! Kiedy ty skończysz z tymi narkotykami?!\n- Jakie narkotyki? Uwierz mi, od kiedy ciebie poznałem zmieniłem się, zerwałem ze swoją przeszłością, jesteś jedyną kobietą, którą kocham.\n- Synu! To ja - twój ojciec!',NULL,NULL),(370,18,'2021-12-25 15:33:06','2021-12-25 15:33:06','Krzyk w samolocie','Pasażerowie czekają na start samolotu ale odlot się opóźnia. Czekają, czekają, po 2 godzinach widzą 2 pilotów. Pierwszy idzie pomagając sobie białą laską, drugi jest prowadzony przez psa. Piloci wchodzą, samolot rusza, kołuje po pasie, do końca pasa zostaje 500 metrów, 300, 100, pasażerowie zdenerwowani zaczynają krzyczeć i w ostatniej chwili samolot podrywa się i zaczyna lecieć.\nW kabinie pilotów jeden do drugiego: jak kiedyś nie krzykną to się rozpierdolimy...',NULL,NULL),(371,18,'2021-12-25 15:37:17','2021-12-25 15:37:17','Robiłaś kiedyś prawo jazdy','Spięcie na drodze. Wkurzony facet:\n- Kobieto, robiłaś kiedyś prawo jazdy?!\n- Więcej razy od Ciebie, debilu!',NULL,NULL),(372,18,'2021-12-25 15:38:40','2021-12-25 15:38:40','Ma cztery nogi i nie żyje','Dziadek: a teraz nastepny dowcip wnuczku.\nCo to jest? Ma cztery nogi a nie zyje?\nJaś: hahaha dziadku ! To krzesło !\nDziadek: nie Jasiu - Twój pies',NULL,NULL),(373,18,'2021-12-25 15:41:14','2021-12-25 15:41:14','Pies bez smyczy','Przepraszam, dlaczego ten pies nie jest na smyczy?\n- To nie mój pies.\n- Jak to nie pański?\n- No nie jest mój.\n- Przecież widzę, że to pański pies!\n- Nie.\n- Nie? To niech pan przejdzie na drugą stronę ulicy!\n(facet przechodzi)\n- I co?! Poszedł za panem! To pański pies!\n- To nie jest mój pies.\n- To niech pan przejdzie jeszcze raz!\n(facet przechodzi)\n- Ten pies za panem chodzi, nie oszuka mnie pan, to pański pies!\n- Panie, on się do mnie tak samo przypierdolił, jak i pan!',NULL,NULL),(374,18,'2021-12-25 15:42:41','2021-12-25 15:42:41','Pierwszy raz w teatrze','Kowalscy postanowili pójść do opery. Kiedyś w końcu trzeba... Ubrali się odświętnie w garnitur i suknię wieczorową. Ustawili się po bilety w kolejce pod kasą. Przed nimi gość zamawia:\n- Tristan i Izolda. Dwa poproszę...\nKowalski jest następny:\n- Zygmunt i Regina. Dla nas też dwa...',NULL,NULL),(375,18,'2021-12-26 16:22:58','2021-12-26 16:22:58','Ojciec','Moja dziewczyna oskarżyła mnie o bycie rasistą.\nChyba nie do końca zrozumiała, dlaczego wściekam się, że nasze dziecko jest czarne?',NULL,NULL),(376,18,'2021-12-26 16:26:33','2021-12-26 16:26:33','Cios wałkiem i późne przyjście','Wraca Zenek po szóstej rano do domu. Otwiera drzwi.\nWchodzi - i na wejściu dostaje cios wałkiem od żony Zofii.\nPada i leży...\nZofia tak na niego patrzy... patrzy.\nNagle doznaje olśnienia. Pada na kolana.\nZaczyna go tulić i płakać:\n- Zenuś... Zenuś żyjesz? Przepraszam! Zapomniałam, że miałeś nocną zmianę!!!',NULL,NULL),(377,18,'2021-12-26 16:29:59','2021-12-26 16:29:59','Numerowanie żartów','Filip dołączył właśnie do klubu, który polecił mu jego kumpel, będący jego członkiem od jakiegoś czasu. Siedzą w barze, piją piwo, kiedy nagle ktoś krzyczy: 21! i sala wybuchła umiarkowanym śmiechem. Kilka minut potem ktoś krzyczy 34! i śmiech się wzmógł. Filip zdziwiony tym faktem, pyta kolegę:\n- Czemu wszyscy się śmieją, kiedy ktoś krzyczy numer?\nKumpel na to:\n- Cóż, opowiadaliśmy te same dowcipy przez tyle lat, że w końcu je ponumerowaliśmy i jeśli ktoś chce opowiedzieć któryś z nich, krzyczy tylko jego numer.\nFilip skinął głową i spytał:\n- Mogę spróbować?\nJego kumpel przytaknął i Filip krzyknął: 1216!. Wszyscy w klubie pokładali się ze śmiechu przez 15 minut.\n- Dlaczego wszyscy śmiali się tak mocno z tego dowcipu? pyta Filip.\nKumpel na to chichocząc:\n- Tego akurat jeszcze nie słyszeliśmy.',NULL,NULL),(378,18,'2021-12-26 16:31:18','2021-12-26 16:31:18','Wystawa rzeźnika','U rzeźnika:\n- Przepraszam, to na wystawie to świński ryj?\n- Nie, to lustro.',NULL,NULL),(379,18,'2021-12-26 16:32:45','2021-12-26 16:32:45','Blondynka w klasie biznesowej','W samolocie do Chicago tuż po starcie blondynka przesiada się z klasy ekonomicznej do klasy biznes. Podchodzi do niej stewardessa.\n- Czy mogę zobaczyć pani bilet?\nBlondynka pokazuje bilet. Stewardessa:\n- Niestety, pani bilet nie jest ważny w tej klasie, musi pani wrócić do klasy ekonomicznej.\nBlondynka na to:\n- Jestem piękną blondynką i będę tu siedzieć, aż dolecimy do Chicago!\nStewardessa poszła po pomoc do drugiego pilota.\nPilot przyszedł i mówi:\n- Niestety, muszę panią poprosić o powrót do klasy ekonomicznej.\n- Jestem piękną blondynką i będę tu siedzieć, aż dolecimy do Chicago!\nPilot wraca do kabiny i skarży się głównemu pilotowi.\nTen mówi:\n- Poczekaj, moja żona jest blondynką, wiem jak z nimi rozmawiać.\nPilot udaję się do blondynki, szepce jej coś na ucho, po czym ona zabiera torebkę i wraca do klasy ekonomicznej.\nDrugi pilot nie może się nadziwić:\n- Jak ty to zrobiłeś\n- To proste, powiedziałem jej, że klasa biznesowa nie leci do Chicago.',NULL,NULL),(380,18,'2021-12-26 16:35:30','2021-12-26 16:35:30','Nie słuchanie żony','- Żona ma do mnie pretensje. Po pierwsze, że jej nie słucham?\n- A po drugie?\n- A coś tam jeszcze pierdoliła.',NULL,NULL),(381,18,'2021-12-26 16:52:30','2021-12-26 16:52:30','Dowcip i trzy silne blondynki','W pubie o bardzo ciemnym wnętrzu siedzi przy barze znudzony facet\ni popija drinka.. Czuje, ze obok też ktoś siedzi, wiec zagaduje:\n- Eee, opowiedzieć ci dowcip o blondynce?\nNa to glos (kobiecy):\n- No, możesz. Ale musisz wiedzieć, ze jestem blondynka 1,80 wzrostu\ni 70 kg wagi i jestem naprawdę silna. A obok mnie siedzi tez blondynka,\n1,90 wzrostu, 80 kg wagi i podnosi nacodzień ciężary. A jeszcze dalej przy\nbarze siedzi kolejna blondynka, 2 metry wzrostu. To mistrzyni kickboxingu.\nDalej chcesz opowiedzieć ten dowcip?\nFacet pociąga powoli ze szklanki, myśli i mówi:\n- Nie, juz nie... Pie*dolę, nie będę go trzy razy tłumaczył.',NULL,NULL),(382,18,'2021-12-26 16:59:45','2021-12-26 16:59:45','Mama i kupno roweru','- Mamusiu, kup mi rower.\n- Nie synku. Rower jest bardzo drogi. Nie kupie ci. A poza tym byłes niegrzeczny i nie zasłuzyłes.\n- Mamusiu to pobaw się chociaz ze mna!\n- No, pobawic to się mogę, a w co chciałbys się pobawic, Jasiu? - pyta mama.\n- Pobawmy się w mamusie i tatusia - idz do sypialni i czekaj na mnie mamo.\n- Zaintrygowana mama przebrala się w pizame i lezy w lozku.\n- Wchodzi Jasio z rekami zalozonymi z tylu chodzi z kata w kat i w pewnym momencie mowi:\n- Zbieraj dupsko stara, idziemy gnojowi rower kupić!!!',NULL,NULL),(383,18,'2021-12-26 17:11:05','2021-12-26 17:11:05','Kurtka i wyjście','Mąż zakłada kurtkę i woła do żony:\n- Ty stara! Idę do baru, zakładaj kurtkę.\nżona uśmiechnęła się pod nosem, bo myślała że wyjdzie gdzieś w końcu na miasto i mówi:\n- Naprawdę, bierzesz mnie ze sobą?\na mąż na to:\n- Pogięło cię. Wyłączam ogrzewanie.',NULL,NULL),(384,18,'2021-12-26 17:22:12','2021-12-26 17:22:12','Ojciec gruźlik','Komisja wojskowa:\n- Zawód ojca?\n- Ojciec nie żyje...\n- Ale kim był?!\n- Gruźlikiem...\n- Ale co robił?!!\n- Kaszlał...\n- Ale z czego żył?!!! Z tego się przecież nie żyje!\n- Przecież mówię, że nie żyje...',NULL,NULL),(385,18,'2021-12-26 17:23:25','2021-12-26 17:23:25','Wypadek przy obiedzie','Rozmawia dwóch przyjaciół:\n- Słyszałem, że twoja Teściowa miała wypadek.\n- Tak, szła do piwnicy po ziemniaki na obiad, na schodach potknęła się i skręciła kark.\n- I co zrobiliście??\n- Spaghetti.',NULL,NULL),(386,18,'2021-12-26 18:51:55','2021-12-26 18:51:55','Weź dwie','Rozmowa dwóch Polaków przed sklepem monopolowym:\n- Wezmę dwie.\n- Weź jedną, tyle nie wypijemy?\n- Wezmę dwie, damy radę.\n- Nie damy, zobaczysz.\n- Damy radę. Biorę dwie?\nWchodzi do sklepu:\n- Poproszę skrzynkę wódki i dwie lemoniady.',NULL,NULL),(387,18,'2021-12-26 18:58:47','2021-12-26 18:58:47','Lekcja historii i nie przyznawanie się','Nauczyciel historii wpada zdenerwowany do pokoju nauczycielskiego i mówi do dyrektora:\n- Ech, ta licealna 1A! Nie wytrzymam z tymi baranami! Pytam ich, kto wziął Bastylię, a oni krzyczą, że to żaden z nich!\n- Niech się Pan nie denerwuje - uspokaja dyrektor - może to rzeczywiście ktoś z innej klasy?',NULL,NULL),(388,18,'2021-12-26 19:02:40','2021-12-26 19:02:40','Ratowanie tonącej żony','- Dlaczego nie ratował pan tonącej żony?\n- A skąd ja miałem wiedzieć, że tonie? Darła japę, jak zwykle.',NULL,NULL),(389,18,'2021-12-27 14:06:28','2021-12-27 14:06:28','Ile ma Pani lat?','Rozmowa podczas przyjmowania do pracy:\n- Ile ma pani lat?\n- Bliżej mi do trzydziestki, niż do dwudziestki.\n- To znaczy ile?\n- Pięćdziesiąt....',NULL,NULL),(390,18,'2021-12-27 14:09:15','2021-12-27 14:09:15','Przecholowanie na imprezie','Rozmawiają dwie koleżanki:\n- Jak tam wczorajsza impreza?\n- A daj spokój! Tak dałam w palnik, że wylądowałam w łóżku z własnym mężem. :)',NULL,NULL),(391,18,'2021-12-27 14:11:22','2021-12-27 14:11:22','Spotkanie pięciu przyjaciółek','Pewnego wieczoru spotkało się pięć przyjaciółek.\nNiestety, nie miały o czym rozmawiać, bo przyszły wszystkie.',NULL,NULL),(392,18,'2021-12-27 14:12:32','2021-12-27 14:12:32','Nieprzytomna żona i spokój','- Halo, pogotowie?! Żona leży nieprzytomna w kuchni, co ja mam robić, co robić?!\n- Najpierw proszę się uspokoić.\n- ...\n- Halo, jest pan tam?\n- Jestem. Ok, już jestem spokojny. Co dalej?\n- Jest pan obok żony?\n- No nie, przecież miałem się uspokoić. Siedzę przed telewizorem i piję piwo.',NULL,NULL),(393,18,'2021-12-27 14:17:18','2021-12-27 14:17:18','Mechanik i naciąganie klienta','W warsztacie samochodowym klient siedzi w fotelu i czyta gazetę, a na kanale stoi samochód.\nPrzychodzi mechanik i zabiera się za auto. Po chwili mówi do klienta:\n- Przydałoby się wymienić świece.\n- To wymieniaj pan, tylko szybko.\nNo to mechanik czuje, że złapał frajera i nawija dalej:\n- Pasek rozrządu też do wymiany. Klocki i tarcze też. I płyn hamulcowy, i w chłodnicy, i wycieraczki...\n- Wymieniaj pan, tylko szybciej, bo nie mam czasu.\nMechanik skończył, odstawił samochód i mówi:\n- No, gotowe.\nNa to klient pokazując na samochód stojący przed warsztatem:\n- No to bierz się pan teraz za mój.',NULL,NULL),(394,18,'2021-12-27 14:19:15','2021-12-27 14:19:15','Dzieci i wykształcenie','- Kopę lat! Co u ciebie słychać? Jak dzieci?\n- Jakoś leci. Najstarszy syn zrobił doktorat z historii sztuki, córka skończyła socjologię z wyróżnieniem, najmłodszy trochę się wyłamał, bo został pospolitym złodziejem.\n- Powinieneś wykopać go z domu.\n- Nie mogę. Tylko on przynosi jakieś pieniądze...',NULL,NULL),(395,18,'2021-12-27 14:21:43','2021-12-27 14:21:43','Kurczaki w mięsnym','Przychodzi baba do mięsnego, przygląda się mrożonym kurczakom. Wybiera, przekłada, miesza lecz nie znajduje dostatecznie dużego. Woła ekspedientkę.\n- Jutro będą większe?\n- Nie, nie będą - są martwe.',NULL,NULL),(396,18,'2021-12-27 14:25:08','2021-12-27 14:25:08','Mama coś rozbiła','Mama i córka zmywają talerze, zaś tata i synek sprzątają mieszkanie. Nagle z kuchni dobiega odgłos tłuczonego szkła.\n- Oho, mama coś rozbiła - mówi tata.\n- Skąd wiesz?\n- Bo nikt na nikogo nie krzyczy.',NULL,NULL),(397,18,'2021-12-27 14:25:48','2021-12-27 14:25:48','Szwedzi wkurzeni na Trumpa','W odpowiedzi na zarzuty Trumpa, że napływ imigrantów zaszkodził Szwecji, wkurzeni Szwedzi wypowiedzieli Trumpowi dżihad.',NULL,NULL),(398,18,'2021-12-27 17:18:01','2021-12-27 17:18:01','Czterech kumpli i ich synowie','Czterech kumpli spotyka się po wielu latach. Jeden z nich poszedł zamówić coś do picia, natomiast pozostali zaczynają rozmawiać o swoich synach. Pierwszy mówi:\n- Jestem taki dumny z mojego syna. Zaczął pracę jako goniec, wieczorowo skończył studia. Po paru latach został dyrektorem, a następnie prezesem firmy. Stał się tak bogaty, że swojemu przyjacielowi na urodziny podarował super luksusowego mercedesa.\nDrugi opowiada:\n- Ja też jestem bardzo dumny z mojego syna. Zaczął pracę jako steward w samolocie. Po niedługim czasie stał się pilotem. Założył spółkę z paroma wspólnikami i otworzył własne linie lotnicze. Dzisiaj jest tak bogaty, że swojemu przyjacielowi na urodziny podarował mały samolot dwusilnikowy Cessna.\nTrzeci opowiada:\n- Nie wyobrażacie sobie, jaki ja jestem dumny z mojego. Studiował inżynierię. Otworzył firmę budowlaną i zarobił miliardy. Pomyślcie, że na urodziny swojego przyjaciela podarował mu cudowną willę z basenem 1500m.\nTymczasem wraca czwarty kumpel i pyta, o czym rozmawiali. Opowiadają, że o synach, pytając go jednocześnie o jego syna.\n- Mój syn jest gejowym żygolakiem. Utrzymankiem bogatych gejów. W ten sposób zarabia na życie!\nPrzyjaciele:\n- Biedaczek, jakie nieszczęście!\n- Jakie tam nieszczęście, cudownie mu się żyje! Wyobraźcie sobie, że w tym roku na urodziny od swoich trzech kochanków dostał: mercedesa, prywatny samolot i willę z basenem. A wasi synowie co robią ciekawego?',NULL,NULL),(400,NULL,'2022-05-25 13:02:29','2022-05-25 13:02:29','aaaaaaaaaaaaaaaaaaaaaaaaa','jgjhjkljkljljlk',NULL,NULL),(401,NULL,'2022-05-25 13:03:30','2022-05-25 13:03:30','hghjjhjkhj','hghkhijkhjkh',NULL,NULL),(405,NULL,'2022-06-13 10:29:13','2022-06-13 10:29:13','sfgdgfjh','dsfgfjhggjhbjkh',NULL,NULL),(406,NULL,'2022-06-20 14:36:53','2022-06-20 14:36:53','hghfhfhf','hfhfghgghgh',NULL,NULL);
