INSERT INTO `joke_block` VALUES (64,207,50,'Ostatnio nie gadam za dużo z swoim współlokatorem Danielem. ',NULL,'2021-10-21 12:17:33'),(65,209,50,'Jest między nami niezręcznie bo miałem z nim dosyć wstydliwą sytuację... Bo Daniel nakrył mnie na masturbacji.',NULL,'2021-10-21 12:17:33'),(66,213,50,'spotkam go w tramwaju',NULL,'2021-10-21 12:17:33'),(67,211,50,'Było mi wtedy bardzo wstyd. I kompletnie nie spodziewałem się, że spotkam go w tramwaju.',NULL,'2021-10-21 12:17:33'),(76,242,46,'Kiedyś jak miałem problem to zbierałem kamienie, chodziłem nad wodę i rzucałem kaczki',NULL,'2021-11-18 15:14:49'),(77,244,46,'ale teraz nie jest to już takie proste.',NULL,'2021-11-18 15:14:49'),(78,246,46,'Ostanio właśnie jak nazbierałem kamieni, poszedłem nad wodę i zacząłem puszczać kaczki to nagle ludziom zaczeło to przeszkadzać i to do tego stopnia, że ratownik wypierdolił mnie z basenu.',NULL,'2021-11-18 15:14:49'),(79,248,46,'ratownik wypierdolił mnie z basenu.',NULL,'2021-11-18 15:14:49'),(80,202,48,'Nigdy nie miałem lekko... Jak byłem mały i mieszkałem z rodzicami to moja mama raz w miesiącu miała taki czas, że stawała się bardzo agresywna. Ja się wtedy bardzo jej bałem i chowałem się do szafy. I pamiętam jak dzisiaj jak ona ',NULL,'2021-10-21 09:37:51'),(81,206,48,'- No gówniarzu jeden gdzie jesteś? Czekaj niech no tylko ojciec do domu wróci!!\n I ja już właśnie miałem się rozpłakać, kiedy z drugiego kąta szafy ojciec do mnie: Ciiiii...',NULL,'2021-10-21 09:37:51'),(82,204,48,'chodzi po tym mieszkaniu i tupając nogami mnie szuka: \n- Gdzie jesteś? Gdzie jesteś? Wyłaź! \nJa tam wystraszony ale siedzę cicho. A ona dalej: \n- Gdzie jesteś? Chodź tu gnojku jeden! Pokaż się! \nMi już się łapki trzęsą z strachu ale siedzę cicho. ',NULL,'2021-10-21 09:37:51'),(83,413,48,'z drugiego kąta szafy ojciec do mnie: Ciiiii...',NULL,'2021-10-21 09:37:51'),(84,98,49,'Zainstalowałem sobie tindera jakiś czas temu i to fajnie bo chodzę sobie na randki dzieki temu. ',NULL,'2021-10-21 11:41:32'),(85,100,49,'I ostatnio byłem na bardzo nietypowej randce bo dziewczyna kompletnie mnie zaskoczyła... \nBo zrobiła coś czego jeszcze nie zrobiła żadna inna dziweczyna...',NULL,'2021-10-21 11:41:32'),(86,102,49,'Przyszła.',NULL,'2021-10-21 11:41:32'),(87,141,51,'Ciepła rodzinnego domu, dzieciństwa, świąt. Pamiętam te niebieskie migające lampki na niebieskich samochodzikac',NULL,'2021-10-21 12:51:52'),(88,139,51,'W ogóle tu jak wszedłem na scene to poczułem się tak jakoś tak bardzo fajnie, poczułem taki miły zapach alkoholu i wymiocin. Co od razu przywołało mi to wspomnienia.',NULL,'2021-10-21 12:51:52'),(89,143,51,'i ojciec tak prowadzony: Zabije was kurwa puśćcie mnie!',NULL,'2021-10-21 12:51:52'),(90,211,53,'Ale powiem wam, że w sumie to mam w to wyjebane.',NULL,'2021-10-21 12:59:54'),(91,207,53,'Ostatnio ojciec uderzył mnie w twarz i powiedział, że mnie nienawidzi... ',NULL,'2021-10-21 12:59:54'),(92,213,53,'Bo to nie był mój ojciec',NULL,'2021-10-21 12:59:54'),(93,209,53,'Bo to nie był mój ojciec tylko jakiegoś pięciolatka co mu kopa sprzedałem.',NULL,'2021-10-21 12:59:54'),(94,202,55,'W Białymstoku jest bardzo dużo agresji. \nRaz właśnie podbił do mnie typek, pierwszy raz gościa na oczy widzę i mówi do mnie: ',NULL,'2021-10-21 13:01:35'),(95,204,55,'- Wypierdalaj! \nJa do niego: \n- Gościu ochłoń przecież nawet Cię nie znam. \nA on do mnie dalej: \n- Wypierdalaj! \nI co z nim nie próbowałem jakoś spokojnie porozmawiać to on do mnie, że mam wypierdalać. ',NULL,'2021-10-21 13:01:35'),(96,206,55,'W końcu już tam machnąłem ręką i wyszedłem z jego mieszkania.',NULL,'2021-10-21 13:01:35'),(97,413,55,'wyszedłem z jego mieszkania',NULL,'2021-10-21 13:01:35'),(98,359,125,NULL,NULL,'2021-10-28 07:37:52'),(99,362,125,NULL,NULL,'2021-10-28 07:37:52'),(100,361,125,NULL,NULL,'2021-10-28 07:37:52'),(101,98,65,'W życiu zawsze z zmianami pomagał mi mój tata.',NULL,'2021-10-21 13:30:02'),(102,102,65,'- Synu, synu, synu... Ja już Ci nie pomogę... Jestem kurwa na tym samym etapie...',NULL,'2021-10-21 13:30:02'),(103,100,65,'Kiedy byłem w liceum pytam się go:\n- Tato jestem w liceum, co dalej mam zrobić z swoim życiem?\n- Zdaj dobrze maturę, a potem pójdź na studia\nTo ja tak zrobiłem:\n- Tato co teraz?\n- Teraz z kolei zrób inżynierkę, a potem magisterkę.\nTo ja tak zrobiłem:\n- Co dalej tato?\n- Teraz jest moment w którym musisz pójść do pracy. Nie będzie to dobrze płatna praca ale będzie. Nabedzięsz doświadczenia, będzie ok.\nTo ja tak zrobiłem i dwa lata spędziłem w tej pracy i przychodzę do taty:\n- Tato już dwa lata jestem w tej pracy. Nie lubię jej, słabo mi płacą, nie szanują mnie tam. Co dalej mam zrobić z swoim życiem?\nNa co ojciec spojrzał się na mnie:',NULL,'2021-10-21 13:30:02'),(104,202,65,'W życiu zawsze z zmianami zawsze mi ojciec pomagał.',NULL,'2021-10-21 13:30:02'),(105,204,65,'Kiedy byłem w liceum pytam się go:\n- Tato jestem w liceum, co dalej mam zrobić z swoim życiem?\n- Zdaj dobrze maturę, a potem pójdź na studia\nTo ja tak zrobiłem:\n- Tato co teraz?\n- Teraz z kolei zrób inżynierkę, a potem magisterkę.\nTo ja tak zrobiłem:\n- Co dalej tato?\n- Teraz jest moment w którym musisz pójść do pracy. Nie będzie to dobrze płatna praca ale będzie. Nabedzięsz doświadczenia, będzie ok.',NULL,'2021-10-21 13:30:02'),(106,206,65,'To ja tak zrobiłem i dwa lata spędziłem w tej pracy i przychodzę do taty:\n- Tato już dwa lata jestem w tej pracy. Nie lubię jej, słabo mi płacą, nie szanują mnie tam. Co dalej mam zrobić z swoim życiem?\nNa co ojciec spojrzał się na mnie:\n- Synu... Ja już Ci nie pomogę... Jestem kurwa na tym samym etapie...',NULL,'2021-10-21 13:30:02'),(107,413,65,'Jestem kurwa na tym samym etapie...',NULL,'2021-10-21 13:30:02'),(108,202,63,NULL,NULL,'2021-10-21 13:21:25'),(109,204,63,NULL,NULL,'2021-10-21 13:21:25'),(110,206,63,NULL,NULL,'2021-10-21 13:21:25'),(111,232,63,NULL,NULL,'2021-10-21 13:21:25'),(112,234,63,NULL,NULL,'2021-10-21 13:21:25'),(113,236,63,NULL,NULL,'2021-10-21 13:21:25'),(114,413,63,NULL,NULL,'2021-10-21 13:21:25'),(118,258,129,'No, a ona została w domu i dalej mieszka u moich rodziców.',NULL,'2021-10-26 13:45:17'),(119,256,129,'Było ciężko bo nie miałem gdzie spać.\nMusiałem znajomych prosić by mnie przenocowali.\nAle w końcu udało mi się znaleźć jakąś małą i tanią klitkę.',NULL,'2021-10-26 13:45:17'),(120,254,129,'Dziweczyna się na mnie wkurzyła.\nTam wyjebała mnie z domu',NULL,'2021-10-26 13:45:17'),(121,254,67,'Poszedłem się dziś przejść.\nZobaczyłem dziecko.\nByło zamknięte z tyłu rozgrzanego samochodu.',NULL,'2021-10-27 13:30:36'),(122,256,67,'To był wspaniały dzień.\nPodobał mi się.\nNie zrozumcię mnie źle. Nie jestem potworem. Próbowałem pomóc dziecku.\nRzuciłem w szybę kamieniem.',NULL,'2021-10-27 13:30:36'),(123,258,67,'Ale okno było otwarte',NULL,'2021-10-27 13:30:36'),(124,158,52,'Do Białegostoku przeprowadziłem się na studia i spędziłem tam siedem lat. Było to siedem cudownych lat. ',NULL,'2021-10-21 12:56:05'),(125,139,52,'Do Białegostoku przeprowadziłem się na studia i spędziłem tam siedem lat. Było to siedem cudownych lat.  ',NULL,'2021-10-21 12:56:05'),(126,141,52,'Bo tam miałem swoje pierwsze kontakty z narkotykami... \nPotem pierwsze kontakty seksualne... ',NULL,'2021-10-21 12:56:05'),(127,160,52,'Bo tam miałem swoje pierwsze kontakty z narkotykami... ',NULL,'2021-10-21 12:56:05'),(128,143,52,'No bo wiadomo na narkotyki jakoś musiałem zarabiać.',NULL,'2021-10-21 12:56:05'),(129,162,52,'Potem pierwsze kontakty seksualne... ',NULL,'2021-10-21 12:56:05'),(130,164,52,'No bo wiadomo na narkotyki jakoś musiałem zarabiać.',NULL,'2021-10-21 12:56:05'),(131,254,61,'Zadzwonił do mnie telefon, a tam słyszę w słuchawce:\n- ooo siema Radek! W końcu jestem singlem, uwolniłem się od tej swojej. Teraz możemy zacząć pić, możemy zacząć ćpać, możemy zacząć ruchać dupy! ',NULL,'2021-10-21 13:11:16'),(132,256,61,'A ja na to mówię, że: \n- Nie, nie, nie mogę. W żałobie jestem po śmierci babci... A poza tym dziadku... Byś się kurwa wstydził!',NULL,'2021-10-21 13:11:16'),(133,258,61,'A poza tym dziadku... Byś się kurwa wstydził!',NULL,'2021-10-21 13:11:16'),(134,202,64,'W Warszawie nie podoba mi się takie wszechobecne cwaniactowo. Tutaj dosłownie na każdym kroku ktoś próbuje wyłudzic ode mnie hajs.',NULL,'2021-10-21 13:23:07'),(135,204,64,'Nie tak dawno podbił do mnie taki właśnie gagatek i pyta się czy mam 20 złotych. Ja na to:\n- Nie mam.\n- Kolego to chociaż może dychę\nJa na to dalej:\n- Nie mam.\n- Kierowniku to przynajmniej mi piątke daj',NULL,'2021-10-21 13:23:07'),(136,206,64,'Ja na to twardo odpowiadam:\n- Nie. Nie dam Ci żadnych pieniędzy.\nI to już podziałało bo ksiądz z tacą poszedł dalej',NULL,'2021-10-21 13:23:07'),(137,413,64,'ksiądz z tacą poszedł dalej',NULL,'2021-10-21 13:23:07'),(138,232,66,NULL,NULL,'2021-10-21 13:33:05'),(139,234,66,NULL,NULL,'2021-10-21 13:33:05'),(140,236,66,NULL,NULL,'2021-10-21 13:33:05'),(170,214,69,'Tak, mam niezłe mieszkanie.\nStaram się trzymać w nim porządek.\nNie zawsze się to udaje.\nKiedyś kupiłem sobie pieska.\nTo była katastrofa.\nMusiałem się go pozbyć.\nMusiałem zrobić to natychmiast.\nJak tylko zostawiłem go samego... ',NULL,'2021-10-21 13:42:13'),(172,218,69,'Gdy pierwszy raz został sam w domu, poszarpał wszystko na strzępy, wszędzie nasrał',NULL,'2021-10-21 13:42:13'),(173,220,69,'i do tego zdechł z głodu',NULL,'2021-10-21 13:42:13'),(174,207,71,'Mnie rodzice posłali do szkoły katolickiej.\nNienawidziłem jej.\nNajbardziej na świecie.',NULL,'2021-10-26 11:35:59'),(175,209,71,'Zakonnice były bezwzględne.\nBiły mnie linijką, dostawałem też w twarz.',NULL,'2021-10-26 11:35:59'),(176,211,71,NULL,NULL,'2021-10-26 11:35:59'),(177,213,71,'Robiły wszystko by się bronić.',NULL,'2021-10-26 11:35:59'),(178,207,70,'Moja dziewczyna strasznie się na mnie wściekła.\nWściekła się, bo uśmierciłem jej rośliny doniczkowe.\nPrzeze mnie zdechły co do jednej.',NULL,'2021-10-21 14:01:05'),(179,209,70,'Powiedziała:\n- Wyjeżdżam na dwa tygodnie. Wlej każdej pół kubeczka co drugi dzień.',NULL,'2