INSERT INTO `joke_copy_for_test` VALUES (45,8,'Współlokator gej','Wydaje mi się, że mój współlokator jest gejem... \nW sensie tak myślę, że to jest gej bo ostatnio jak się przelizaliśmy to powiedział mi, że mnie kocha...',NULL,'2020-10-31 23:13:01','2021-07-23 08:12:30'),(46,8,'Puszczanie kaczek','Kiedyś jak miałem problem to zbierałem kamienie, chodziłem nad wodę i rzucałem kaczki ale teraz nie jest to już takie proste. \nOstanio właśnie jak nazbierałem kamieni, poszedłem nad wodę i zacząłem puszczać kaczki to nagle ludziom zaczeło to przeszkadzać i to do tego stopnia, że ratownik wypierdolił mnie z basenu.',NULL,'2020-11-01 19:16:27','2021-05-19 17:59:17'),(48,8,'Chowanie się do szafy','Nigdy nie miałem lekko... Jak byłem mały i mieszkałem z rodzicami to moja mama raz w miesiącu miała taki czas, że stawała się bardzo agresywna. Ja się wtedy bardzo jej bałem i chowałem się do szafy. I pamiętam jak dzisiaj jak ona chodzi po tym mieszkaniu i tupając nogami mnie szuka: \n- Gdzie jesteś? Gdzie jesteś? Wyłaź! \nJa tam wystraszony ale siedzę cicho. A ona dalej: \n- Gdzie jesteś? Chodź tu gnojku jeden! Pokaż się! \nMi już się łapki trzęsą z strachu ale siedzę cicho. \n- No gówniarzu jeden gdzie jesteś? Czekaj niech no tylko ojciec do domu wróci!!\n I ja już właśnie miałem się rozpłakać, kiedy z drugiego kąta szafy ojciec do mnie: Ciiiii...',NULL,'2020-11-03 23:08:22','2021-05-19 20:49:28'),(49,8,'Nietypowa randka','Zainstalowałem sobie tindera jakiś czas temu i to fajnie bo chodzę sobie na randki dzieki temu. \nI ostatnio byłem na bardzo nietypowej randce bo dziewczyna kompletnie mnie zaskoczyła... \nBo zrobiła coś czego jeszcze nie zrobiła żadna inna dziweczyna... Przyszła.',NULL,'2020-11-05 20:21:15','2021-01-03 23:03:53'),(50,8,'Wstydliwa sytuacja','Ostatnio nie gadam za dużo z swoim współlokatorem Danielem. Jest między nami niezręcznie bo miałem z nim dosyć wstydliwą sytuację... Bo Daniel nakrył mnie na masturbacji. Było mi wtedy bardzo wstyd. I kompletnie nie spodziewałem się, że spotkam go w tramwaju.',NULL,'2020-11-06 23:22:29','2021-07-23 08:15:15'),(51,9,'Świąteczna atmosfera','W ogóle tu jak wszedłem na scene to poczułem się tak jakoś tak bardzo fajnie, poczułem taki miły zapach alkoholu i wymiocin. Co od razu przywołało mi to wspomnienia. Ciepła rodzinnego domu, dzieciństwa, świąt. Pamiętam te niebieskie migające lampki na niebieskich samochodzikach i ojciec tak prowadzony: Zabiije was kurwa puśćcie mnie!',NULL,'2020-11-07 11:34:20','2021-01-04 16:21:02'),(52,8,'Pierwsze kontakty w Białymstoku','Do Białegostoku przeprowadziłem się na studia i spędziłem tam siedem lat. Było to siedem cudownych lat.  Bo tam miałem swoje pierwsze kontakty z narkotykami... \nPotem pierwsze kontakty seksualne... \nNo bo wiadomo na narkotyki jakoś musiałem zarabiać.',NULL,'2020-11-08 23:06:53','2021-01-04 16:22:41'),(53,8,'Ojciec mnie uderzył','Ostatnio ojciec uderzył mnie w twarz i powiedział, że mnie nienawidzi... \nAle powiem wam, że w sumie to mam w to wyjebane. Bo to nie był mój ojciec tylko jakiegoś pięciolatka co mu kopa sprzedałem.',NULL,'2020-11-08 23:18:42','2021-05-26 19:30:20'),(55,8,'Agresywny Białostoczanin','W Białymstoku jest bardzo dużo agresji. Raz właśnie podbił do mnie tam typek, pierwszy raz gościa na oczy widzę i mówi do mnie: \n- Wypierdalaj! \nJa do niego: \n- Gościu ochłoń przecież nawet Cię nie znam. \nA on do mnie dalej: \n- Wypierdalaj! \nI co z nim nie próbowałem jakoś spokojnie porozmawiać to on do mnie, że mam wypierdalać. W końcu już tam machnąłem ręką i wyszedłem z jego mieszkania.',NULL,'2020-11-09 22:22:36','2021-05-27 21:45:04'),(60,8,'Nie lubię psychologów','Bardzo nie lubię psychologów, a to, że ich nie lubię jest powodem dla którego chodzę na standupy. \nBo tutaj mogę za darmo poopowiadać o swoich problemach... \nKażdy mnie tu zawsze wysłucha... \nI nikt się nie śmieje nigdy',NULL,'2020-11-17 11:02:39','2020-11-17 21:31:22'),(61,8,'Dzwoni telefon','Zadzwonił do mnie telefon, a tam słyszę w słuchawce:\n- ooo siema Radek! W końcu jestem singlem, uwolniłem się od tej swojej. Teraz możemy zacząc pić, możemy zaczą ćpać, możemy zacząć ruchać dupy! \nA ja na to mówię, że: \n- Nie, nie, nie mogę. W żałobie jestem po śmierci babci... A poza tym dziadku... Byś się kurwa wstydził!',NULL,'2020-11-17 12:18:36','2021-05-27 22:03:29'),(63,8,'Pilnowanie kotka','Bliskim trzeba zawsze pomagać dlategoteż, kiedy siostra poprosiła mnie czy nie popilnowałbym jej kotka - bo ona tam z szwagrem szła na jakiś melanż, to ja oczyiście się zgodziłem i przyjechałem z Białegostoku do Warszawy by tego kotka jej popilnować.\nI kotek jak to kotek, tam chodził sobie swoimi ścieżkami. Mi się trochę nudziło bo tyle co na krześle siedziałem to uznałem, że zagadam do kotka i pytam się go czy miał dobry dzień, a on mi na to że:\n- Miał\nNo nieźle myślę sobie i zagaduje go dalej. Pytam się go czyyy miałł okazję być w Francji? A on mi na to, że:\n- Miał\nO kurde, myślę sobie, że zajebisty ten kotek i mówię do niego, że jest mega interesujący i już dawno chciałem go poznać bo zawsze mega fajny wydawał mi się być... I pytam się go czy on też tak miał\nA on wtedy spojrzał tak na mnie, wyprostował się i mówi:\n- Nie. Ani trochę.\n',NULL,'2020-11-17 21:15:55','2020-11-17 21:24:25'),(64,8,'Wyłudzanie w Warszawie','W Warszawie nie podoba mi się takie wszechobecne cwaniactowo. Tutaj dosłownie na każdym kroku ktoś próbuje wyłudzic ode mnie hajs.\nNie tak dawno podbił do mnie taki właśnie gagatek i pyta się czy mam 20 złotych. Ja na to:\n- Nie. Nie mam.\n- Kolego to chociaż może dychę\nJa na to dalej:\n- Nie. Nie mam.\n- Kierowniku to przynajmniej mi piątke daj\nJa na to twardo odpowiadam:\n- Nie. Nie dam.\nI to już podziałało bo ksiądz z tacą poszedł dalej',NULL,'2020-11-18 18:04:11','2021-05-27 23:01:54'),(65,8,'Rady ojca','W życiu zawsze ojciec mi mówił co mam robić.\nKiedy byłem w liceum pytam się go:\n- Tato jestem w liceum, co dalej mam zrobić z swoim życiem?\n- Synu zdaj dobrze matury, a potem pójdź na studia\nTo ja zdałem maturę, potem poszedłem na studia i pytam się:\n- Tato co teraz?\n- Synu teraz z kolei zrób inżynierkę, potem magisterkę, będzie ok.\nTo ja zrobiłem inżynierkę, a potem magisterkę i znowu:\n- Tato co dalej?\n- Synu teraz jest moment w którym musisz pójść do pracy. Nie będzie to dobrze płatna praca ale będzie. Nabedzięsz doświadczenia, będzie ok.\nTo ja tak zrobiłem i spędziłem dwa lata w tej pracy i przychodzę do taty i mówię:\n- Tato już dwa lata jestem w tej pracy. Nie lubię jej, słabo mi płacą, nie szanują mnie tam. Co dalej mam zrobić z swoim życiem?\nNa co ojciec spojrzał się na mnie i pokręcił głową:\n- Kurwa, jestem na tym samym etapie...',NULL,'2020-11-19 22:11:24','2020-11-20 23:34:25'),(66,8,'Dresik z nożem','Raz w Białymstoku podbił do mnie dresik, wyciągnął nóż i mnie ciapnął w brzuch. Już się miałem na niego zdenerwować kiedy widzę, że zaczyna płakać. Szkoda mi się go zrobiło to mówie do niego:\n- Nie no stary nie przejmuj się. Każdemu się może zdarzyć\n- Nie, nie, nie kolego. Ty mnie źle zrozumiałeś. Ja po prostu zawsze płaczę jak cebulę kroję',NULL,'2020-11-20 21:31:59','2021-07-13 17:10:50'),(67,11,'Dziecko zamknięte w samochodzie','Poszedłem się dziś przejść.\nZobaczyłem dziecko.\nByło zamknięte z tyłu rozgrzanego samochodu.\nTo był wspaniały dzień.\nPodobał mi się.\nNie zrozumcię mnie źle. Nie jestem potworem. Próbowałem pomóc dziecku.\nRzuciłem w szybę kamieniem.\nAle okno było otwarte',NULL,'2020-11-20 21:45:11','2021-05-27 23:05:22'),(68,11,'Kobiety z San Franciso','Kocham San Franciso.\nNajbardziej podobają mi się w tym mieście kobiety.\nKobiety w San Franciso są przecudne.\nStwierdzam to mimo tego, co mamy dziś na widowni.',NULL,'2020-11-20 21:53:35','2020-11-20 23:09:06'),(69,11,'Pies sam w domu','Tak, mam niezłe mieszkanie.\nStaram się trzymać w nim porządek.\nNie zawsze się to udaje.\nKiedyś kupiłem sobie pieska.\nTo była katastrofa.\nMusiałem się go pozbyć.\nMusiałem zrobić to natychmiast.\nJak tylko zostawiłem go samego... \nGdy pierwszy raz został sam w domu, poszarpał wszystko na strzępy, wszędzie nasrał i do tego zdechł z głodu',NULL,'2020-11-20 22:10:29','2021-05-28 18:34:55'),(70,11,'Podlewanie kwiatków dziewczyny','Moja dziewczyna strasznie się na mnie wściekła.\nWściekła się, bo uśmierciłem jej rośliny doniczkowe.\nPrzeze mnie zdechły co do jednej.\nPowiedziała:\n- Wyjeżdżam na dwa tygodnie. Wlej każdej pół kubeczka co drugi dzień.\nAle ja jestem samcem.\nUsłyszałem tylko \"dwa tygodnie\" i \"zdradzaj mnie\"\n',NULL,'2020-11-20 22:22:06','2021-07-13 17:37:37'),(71,11,'Szkoła katolicka','Mnie rodzice posłali do szkoły katolickiej.\nNienawidziłem jej.\nNajbardziej na świecie.\nZakonnice były bezwzględne.\nBiły mnie linijką, dostawałem też w twarz.\nRobiły wszystko by się bronić.\n',NULL,'2020-11-21 15:36:48','2021-05-28 19:31:24'),(72,11,'Kobiety muszą Cię nienawidzić','Ciągle słyszę:\n- Anthony strasznie się ubawiłem ale kobiety muszą Cię nienawidzić. Kobiety, które przychodzą na Twoje występy muszą Cię nienawidzić.\nOdpowiadam:\n- Nie. Nie. Tylko głupie kobiety mnie nienawidzą. Nienawidzą moich występów. Mądre kobiety na nie nie przychodzą.\n',NULL,'2020-11-21 15:41:25','2020-11-21 15:41:33'),(73,11,'Rodzina w II wojnie światowej','Dowiedziałem się, że członkowie mojej rodziny podczas II wojny światowej walczyli po obu stronach.\nTo upokarzające.\nPodczas gdy bandycka część rodziny służyła w Wermachcie, krewka część rodziny Jeselników była w Ameryce.\nI szpiegowała dla Niemców.\n',NULL,'2020-11-21 15:51:13','2021-07-13 18:09:24'),(74,11,'Zamiłowanie do alkoholu','Lubię pić. \nWręcz kocham. Robię to codziennie.\nNie wiem, skąd mi się to wzięło.\nRodzice opowiadali, że kiedy byłem bardzo mały, co rano wyłaziłem z łóżeczka i szedłem na czworakach w stronę barku. \nBy choć trochę z nimi pobyć.',NULL,'2020-11-21 16:40:18','2021-05-28 19:55:55'),(75,8,'Chciałem mieć dzieci','Zerwałem z dziewczyną. Jednym z powodów naszego zerwania było to, że ja chciałem mieć dzieci, a ona bardzo nie. I to do tego stopnia nie chciała, że co tylko jakieś przyprowadziłem to wypuszczała je z piwnicy.',NULL,'2020-11-21 16:44:26','2021-07-13 18:26:09'),(78,11,'Broń palna i dzieci','Ja nie mam broni.\nJestem przeciwny jej posiadaniu.\nMoi rodzice mieli broń, jak byłem mały.\nMówili, że jest im potrzebna.\nPotrzebna by chronić pięcioro dzieci.\nJak masz pięcioro dzieci, to potrzebujesz broni, by je chronić.\nW końcu sie jej pozbyli,\nby chronić pozostałe czworo.',NULL,'2021-01-03 23:31:45','2021-07-13 18:28:34'),(79,11,'Pała na świadectwie','Nigdy nie zapomnę,\njak pierwszy raz miałem pałę na swiadectwie.\nPrzyniosłem je do domu i pokazałem tacie.\nStrasznie mnie sprał.\nNa kwaśne jabłko,\nAle to mnie czegoś nauczyło.\nGdy nasepnym razem miałem na świadectwie pałę, przyniosłem je do domu i dałem mamie\nNiechże ona dostanie',NULL,'2021-01-03 23:36:03','2021-07-19 21:40:59'),(80,11,'Nauka przez doświadczenie','Tata był twardy.\nJeden z tych, którzy wierzą, że mężczyznę uczy tylko doświadczenie.\nJego zdaniem szkoła nic nie da.\nTłumaczenie nic nie da.\nMusisz sam w praktyce do czegoś dojść.\nGdy byłem mały, nie potrzebowałem lekcji pływania.\nTata wrzucał mnie do basenu,\nby poćwiczyć udzielanie pierwszej pomocy.',NULL,'2021-01-03 23:41:00','2021-07-20 16:09:42'),(82,8,'Zabieranie kołdry','Strasznie mnie to denerwuje, że moja dziewczyna zawsze mi w nocy kołdrę zabiera. Szeczególnie, że mamy tylko jedną kołdrę w mieszkaniu. To jest tragedia jakaś... Codziennie w nocy mi zabiera kołdrę i to mimo tego, że śpię w oddzielnym pokoju.',NULL,'2021-01-04 22:57:40','2021-07-20 17:10:27'),(83,8,'Kłamliwe wypowiedzenie','W poprzedniej pracy szef mnie bardzo nie lubił i za wszelką cenę chciał mnie zwolnić. \nDoszło nawet do tego, że dał mi wypowiedzenie pod prekstem, że niby napastuje seksualnie innych pracowników.\nOczywiście było to ochydne kłamstwo.\nAle ja swojej pracy i tak nie lubiłem\nDlatego schowałem wojego penisa w spodnie i poszedłem do domu.',NULL,'2021-01-04 23:03:11','2021-07-20 16:26:09'),(84,11,'Mój tata nie ufa nikomu','Mój tata nie ufał nikomu. Dosłownie nikomu.\nMiał nawet na to powiedzenie,\nale nigdy mi go nie powiedział',NULL,'2021-01-21 21:21:32','2021-07-19 21:43:44'),(85,11,'Urodziny mamy','Zeszły rok był smutny dla mojej rodziny.\nMama mogła mieć swoją 60 imprezę urodzinową.\nAle przez narkotyki, alkohol i inne fatalne decyzje zapomnieliśmy o tym',NULL,'2021-01-21 21:24:43','2021-05-28 19:43:17'),(86,11,'Mama rasistka','Mama była rasistką. Straszną rasistką.\nA ja nie toleruje rasizmu.\nNie znoszę bo to przejaw ignorancji.\nGdy miałem 9 lat i wracałem do domu po szkole, raz na jakiś czas przyprowadzałem ze sobą kolegę.\nZdarzało się, że kolega był czarny.\nGdy przychodził mama zaczynała się dziwnie zachowywać.\nOdciągała mnie na bok i pytała:\n- Anthony, kim jest Twój nowy przyjaciel? Czy to jakiś handlarz narkotyków?\nOdpowiadałem:\n- Zamknij się mamo to rasistowskie... i schowaj te pieniądze.\n',NULL,'2021-01-21 21:32:26','2021-07-20 21:19:26'),(87,11,'Zamykanie klinik aborcyjnych','Wieczorami występuję, ale mam też hobby.\nW dzień jeżdżę od miasta do miasta i zamykam kliniki aborcyjne.\nDobrze słyszeliście.\nZamykam kliniki aborcyjne, gdzie tylko pojadę.\nŁatwo mi to przychodzi. Jestem czarujący.\nStoję czły dzień przed wejściem i proponuję niższe ceny',NULL,'2021-01-21 21:58:35','2021-05-26 21:38:24'),(88,11,'Autopsja babci','Moja babcia umarła. \nBabcia zawsze chciała umrzeć spokjnie w śnie.\nMyśleliśmy, że tak było.\nCieszyliśmy się z jej szczęścia.\nPotem zleciliśmy autopsję.\nOkazało się, że zmarła straszną śmiercią.\nW najgorszy możliwy sposób.\nPodczas autopsji.',NULL,'2021-03-30 21:30:15','2021-07-20 21:20:39'),(89,11,'Zły wpływ i brzydkie słowo','Przyjaciółka mojej żony jest nawróconą chrześcijanką.\nI ni cholery się nie dogadujemy.\nZadzowniła żeby mnie ochrzanić.\nPowiedziała, że mam zły wpływ na jej męża, bo brzydko ją nazwał.\n- Jak? Nazwał Cię suką\n- Nie, Anthony. Nie chodziło o słowo na \"S\"\nNo nieźle\n- Czy nazwał Cię pizdą?\n- Nie\n- Więc nie usłyszał tego ode mnie',NULL,'2021-03-30 22:04:18','2021-07-20 21:22:16'),(90,11,'Najlepszy telefon w życiu','Czasami życie nie jest zabawne.\nNie chcę wnikać w szczegóły, ale na początku tygodnia odebrałem najlepszy telefon w moim całym życiu.\nPięć minut później odebrałem kolejny telefon, mówiący o tym, że mój tata jest w szpitalu.\nPowiedziałem: \"Tak, właśnie słyszałem\"',NULL,'2021-03-30 22:09:54','2021-05-28 19:48:11'),(91,11,'Niezapomniany widok','Nigdy nie zapomnę tego jednego razu, gdy zobaczyłem penisa ojca.\nPowiedziałem: \n-Tato... Nie wysyłaj mi takich zdjęć',NULL,'2021-03-31 21:18:21','2021-03-31 21:18:21'),(92,11,'Ślepy woźny','Kiedy chodziłem do liceum, szkoła zatrudniła niewidomego woźnego.\nBył w stu procentach ślepy.\nWszystkie dzieci żartowały, że oślepł od masturbacji.\nWtedy w to wierzyłem.\nByłem dzieckiem, skąd miałem wiedzieć?\nDopiero gdy dorosłem, zmądrzałem, zrozumiałem, że to głupi przesąd, którego użyli, żeby wytłumaczyć, dlaczego ciągle walił przy nas konia.',NULL,'2021-03-31 21:23:30','2021-03-31 21:23:30'),(93,11,'Sąsiedzi Jehowi','Mam fajne mieszkanie.\nTrochę gorzej z sąsiadami.\nMieszkam na jednej ulicy z trzem rodzinami świadków Jehowych.\nI ile razy bym nie powtarzał:\n- Nie, absoultnie nie\nI tak przychodzą dwa razy w tygodniu i mówią:\n- Anthony, proszę przestań rzucać kamieniami w nasze domy\n',NULL,'2021-03-31 21:29:56','2021-05-28 20:14:36'),(94,11,'Sąsiad z Alzheimerem','Mam jeszcze gorszych sąsiadów.\nJednym z najbliżej mieszkających jest 90-latek, który ma Alzheimera.\nI każdego ranka o dziewiątej puka do moich drzwi i pyta czy nie widziałem jego żony.\nCo oznacza, że każdego ranka o dziewiątej muszę tłumaczyć 90-latkowi z Alzheimerem, że jego żona od dawna nie żyje.\nMyślałe, żeby się przenieść.\nMyślałem, żeby nie otwierać drzwi rano, ale szczerze to warto się poświęcić, żeby widzieć ten usmiech na jego twarzy.',NULL,'2021-03-31 21:34:56','2021-03-31 21:34:56'),(95,11,'Upuszczenie dziecka','Ostanio w centrum handlowym znajomy poprosił mnie czy mogę potrzymać jego dziecko bo on musi iść do łazienki.\nUpuściłem je.\nPodniosłem, zanim mnie ktoś zobaczył.\nA było blisko.\nMusiałem zbiec trzy piętra po schodach.',NULL,'2021-03-31 21:49:50','2021-03-31 21:49:50'),(96,11,'Dziewczynka z szklanym okiem','Nie lubię dzieci.\nZnam dziewięciolatkę, mała, chudą dziewczynkę.\nMała, chuda dziewczynka mieszka w moim śasiedztwie.\nMa szklane oko.\nCholernie się jej boję.\nRobię w porty ze strachu.\nKiedy tylko mnie widzi zaczyna mnie gonić.\nTak długo, aż oddam jej szklane oko. Najgorzej.',NULL,'2021-03-31 21:57:32','2021-07-15 14:08:57'),(97,11,'Znajoma nie może mieć dzieci','Mam znajomą, która dowiedziała się, że nie może mieć dzieci... od sądu rodzinnego',NULL,'2021-03-31 22:02:36','2021-07-12 12:13:28'),(98,11,'Depresja mamy','Mama miała depresję.\nNaprawdę miała depresję.\nTak wielką, że wytatuowała: \"w przypadku zagrożenia życia, nie reanimować\"\nNa wszystkich zieciach',NULL,'2021-04-01 19:36:47','2021-04-01 19:36:47'),(99,11,'Spór prawny','Od pogrzebu mamy minęło jakieś 10 lat.\nW zeszłym roku kazałem wykopać jej ciało żeby rozwiązać spór prawny z rodzeństwem.\nOkazało się, że to oni mieli rację.\nTo jednak nielegalne.',NULL,'2021-04-01 19:41:14','2021-04-01 19:41:14'),(100,11,'Inny język','Każdego dnia moi latynoscy sąsiedzi próbują do mnie zagadać.\nA ja nic nie rozumiem.\nW dziewięciu przypadkach na dziesięć jestem uprzejmy.\nAle ostatnio byłem zmęczony, na kacu, wypaliłem trochę zioła, wziąłem parę piguł i kiepsko się czułem.\nNie wytrzymałem.\n- Hej, dupku. Jesteśmy w Ameryce. Nie znam migowego',NULL,'2021-04-01 19:53:12','2021-04-02 18:39:37');
