INSERT INTO `structure` VALUES (11,'Podejrzewanie i Dowód','Jest przedstwione pewne podejrzenie (lub stwierdznie) i na jego potwierdzenie podaje się dowód. W tle zagnieżdzona jest ukryta informacja będąca naruszeniem komediowym i świadcząca o pewności dowodu.\nBlok \"Dowód\" i \"Ukryta informacja\" mogą występować w dowolnej kolejności.\nNa dany moment struktura ta dopuszcza również i stwierdzenie zamiast dowodu. Nie chcę rozdzielać, gdyż róznica wydaje mi się być znikoma w działaniu.','2020-10-31 23:28:26','2021-09-20 11:54:18'),(13,'Problem we mnie','Żart buduje się wokół narzekania na kogoś lub na coś. Na samym końcu odkrywa się informacje, która jednozacznie określa, że to problem od samego początku był we mnie, a reakacja innych była uzasadniona.','2020-11-01 19:30:36','2020-11-01 19:30:36'),(14,'Stopniowe budowanie napięcia','Jest to pewnego rodzaju zapętlenie (najlepiej do trzech lub czterech powtórzeń). Przy każdym kolejnym powtórzeniu jakaś emocja w żarcie musi narastać. Struktura ta choć nie zawiera konfliktu komediowego to świetnie spełnia się jako tło do budowania ciekawości i napięcia u widza.','2020-11-03 23:15:03','2020-11-03 23:15:03'),(16,'Złamanie wielkich oczekiwań','Należy wzbudzić w widzu ciekawość i ją podsycać jego oczekiwania co do końca historii do granic możliwości (np. niech myśli, że ta informacja mu się przyda)  by na końcu złamać jego oczekiwania czymś bardzo prozaicznym, minimalnym lub nieudolnym.','2020-11-06 23:16:31','2021-09-13 08:45:35'),(17,'Krótka sprzczeność (Podbicie)','Opisuje sie przymiotnikami kompletnie nie pasującymi lub przeciwstawnymi do obiektu opisywanego. Ważnym jest by równeż ekspresja była zgodna z opisywaniem.\nMa to być szybki żart, więc treść powinna być zwięzła.\nStruktura nie ma na celu wywoływania mocnych reakcji, a raczej uprzyjmnienia treści łączącej żarty lub też zastowania w innej strukturze w ramach podbicia.','2020-11-08 23:00:01','2021-08-24 17:26:45'),(18,'Opis i przeciwstawność','Należy coś opisywać tak by nakierować widza na odpowiedni schemat myślowy by na końcu go złamać czymś kompletnie przeciwstawnym do opisu','2020-11-08 23:14:25','2021-05-19 21:21:00'),(19,'Drugie powiązane z pierwszym','Przedstawia się pierwsze zagadnienie, a potem drugie, a następnie pokazuje się polączenie między nimi. Ważnym jest by te połączenie nie było zauważalne na pierwszy rzut oka.','2020-11-08 23:22:08','2021-05-26 19:46:27'),(20,'Skutek i Przyczyna','Wpierw podaje się skutek, a potem przyczynę. Powinno to przedstawiać jakiś typowy powszechnie znany problem.\nDopiero podczas mowy o swoich uczuciach jakie temu towarzyszą/ towarzyszyły należy zaszyć ukrytą wcześniej informację tak by wyszło naruszenie komediowe.\nJednak można też wpierw przedstawić swoje uczucia/stanowisko, a dopiero potem przyczynę i to w niej zaszyć ukrytą informację.\n\nMożliwe kombinacje tematów:\nSeks <-> Miejsce publiczne\n','2020-11-08 23:28:56','2021-09-20 13:51:37'),(22,'Zasada trzech powtórzeń','Dwukrotnie albo trzykrotnie powtarza się ten sam schemat, by za trzecim lub czwartym razem go złamać.\nZasada jest o tyle dobra bo poprzez powtóki widz lepiej zapamięta istotne informacje (te z powtórek), więc jest większa szansa, że załapie żart.\nWprowadzenie może być moją opinią/ oświadczeniem na jakiś temat.','2020-11-17 21:18:07','2021-07-26 07:51:16'),(23,'Zwierzę -> ludzkie zachowanie','Przypisywanie zwierzętom ludzkich zachowań bardzo częto dużo wnosi do żartu i potrafi bardzo mocno go wnieść. Może to być używane w kontekście przełamania jak i również ciała żartu.','2020-11-17 21:21:33','2021-10-11 14:01:50'),(24,'Słowo -> Dwa znaczenia','Jedno słowo ma dwa znaczenia i przez to wprowadza się widza na pewien schemat myślowy związany z pierwszym znaczeniem słowa by potem te słowo ujawnić co ma poskutkować zależnością wgledem pierwszego znaczenia słowa ale logiką wzgłedem drugiego.','2020-11-17 21:23:49','2021-10-11 14:08:44'),(26,'Pochwała - pocisk','Buduje się złudzenie chwalenia kogoś lub czegoś by potem w przełamaniu ostatecznie wychodzi pocisk. Dobrze się sprawdza gdy jako cel weźmie się widownię.','2020-11-20 23:08:36','2020-11-20 23:08:36'),(27,'Złamanie normy społecznej','Celem tu jest złamanie powszchnie znanej normy społecznej. Poprzez odwołanie się od znanej normy społecznej, widzowie przyjmują pewne założenia i dzięki temu potem jest je łatwo przełamać.','2020-11-20 23:12:17','2020-11-20 23:12:17'),(28,'Nic lepszy','W ciele dowcipu należy kogoś krytykować i oceniać by w przełamaniu wyszło, że samemu nie jest się lepszym albo nawet jest się gorszym.','2020-11-20 23:21:59','2020-11-20 23:21:59'),(29,'Kiedyś -> Dziś -> Ukryta informacja','Wpierw przedstawia się jakąś zasadę przyczynowo skutkową. Może być to zasada ukształtowana na tle swojego doświadczenia lub powszechnej wiedzy (społecznej). \nNastępnie stwierdza się, że zasada ta jest tak naprawdę kłamstwem albo nie jest już aktualna.\nNa samym końcu dostarcza się dowód na to czemu zasada nie jest (już) prawdziwa. Dowód ten zawiera również informację, która stanowi naruszenie komediowe.\n\nKombinacje tematów:\nPrzemoc -> Miejsce Publiczne\n\nDobrze się sprawdza przy łamaniu norm społecznych.','2020-11-20 23:28:54','2021-11-18 15:22:43'),(46,'Akcja i Reakcja','Nagle następuje jakaś niespodziewana akcja, która niewątpliwie wymaga reakcji z mojej strony. Przedstawia się podjętą reakcję, która powinna być zgodna z oczekiwaniam widza. Na samym końcu podaje się ukrytą informację, któa powinna kompletnie złamać poprzednio rzekomo potwierdzone oczekiwania widza.','2021-05-27 22:03:12','2021-07-13 18:56:41'),(47,'Zasada trzeciego argumentu','Wprowadzenie struktury powinno jasno naprowadzić widza na temat pozorny. Następnie pierwsze dwa (albo i więcej) argumenty powinny utwierdzić widza, że mowa jest o temacie pozornym.\nDopiero trzeci argument kompletnie nie pasuje do tematu pozornego i jasno wskazuje temat komediowy, który jest zgodny z poprzednim wprowadzeniem i argumentami.','2021-05-28 18:32:11','2021-09-13 12:46:14'),(49,'Pozorna przeciwstawność','Na samym początku deklaruje się pewną przeciwstawność. Zgodnie z domysłem widza z tej przeciwstanosci powinna wynikać inna przeciwstawność. Przedstawia się pierszwy element, który faktycznie mieści się po jednej z stron zarówno zadeklarowanej jak i domniemanej przeciwstawności. Drugi element choć co prawda mieści się faktycznie po drugiej stronie zadeklarowanej przeciwstawności to w przypadku domniemanej przeciwstawności jest po tej samej stronie co i pierwszy element.','2021-07-13 18:08:59','2021-07-13 18:08:59'),(67,'Wyciągnięcie Wniosku','','2021-07-19 21:39:31','2021-07-19 21:39:31'),(72,'Potwierdzenie przez zaprzeczenie','','2021-07-20 16:25:34','2021-07-20 16:25:34'),(83,'Stwierdzenie, powód, dowód - odwrócenie teamatów','Struktura ciekawa ponieważ polega na odwróceniu porzedstawiania tematów.\nWpierw podaje się temat komediowy jako stwierdzenie, następnie temat łączący jako powód, a na końcu temat pozorny jako dowód.\nDowód powinien składać się z argumentów w postaci tematów pozornych tego tematu pozornego.\nChodzi to o to by całość miała pozorny sens logiczny jednak w przedstawione argumenty względem stwierdzenia były jak najbardziel absurdalne.\n\nStruktura testowa czekająca na potwierdzenie w jeszcze jakimś żarcie!!! ','2021-08-24 21:21:35','2021-08-24 21:21:35'),(84,'Temat komediowy -> temat łączący','Trudna struktura. Jeśli wymyśle drugi żart na jej podstawie to będzie prawdziwa i jakoś sensowniej uzupełnię ten tekst.','2021-08-26 20:59:49','2021-08-26 20:59:49'),(86,'Zarzut -> Nic lepszy -> Dowód','Jest przedstwione pewne podejrzenie pewnego zjawiska u kogoś i na potwierdzenie tego podejrzenia podaje się mały dowód zagnieżdżony w dużym dowodzie.\n\nZ tego żartu musi też wynikać, że nie jestem nic lepszy','2021-09-20 12:35:57','2021-11-18 14:56:30');
/*!40000 ALTER TABLE `structure` ENABLE KEYS */;
