INSERT INTO `structure_block` VALUES (98,'2021-05-18 14:56:23.730000','Krótkie wprowadzenie, które ma być przyczyną wyolbrzymionej sytuacji.','2021-09-13 08:45:35.369000',0,'Wprowadzenie',16),(100,'2021-05-18 14:56:23.744000','Należy jakąś sytuacje wyolbrzymiać, nadając jej dużego znaczenia. Powinna zachaczać o tematyke, która zainteresuje widza np. jakaś intryga lub przydatna informacja.','2021-09-13 08:45:35.376000',1,'Budowanie oczekiwań u widza',16),(102,'2021-05-18 14:56:23.755000','Poprzednio zbudowane oczekiwania należy złamać czymś małym, trywialnym, bądź nieudolnym.','2021-09-13 08:45:35.377000',2,'Złamanie',16),(103,'2021-05-18 18:39:58.710000','Tematem pozornym jest podejrzewanie kogoś o coś bądź też powiedznie prawdy o kimś, której się jest pewnym.','2021-09-20 11:54:17.985000',0,'Podejrzenie / Stwierdzenie',11),(105,'2021-05-18 18:39:58.721000','Przedstawienie swoich uczuć (lub innych) oraz swojego stanowiska na ten temat.\nMoże fajnie podkręcić żart.','2021-09-20 11:54:17.989000',1,'Satnowisko (opcjonalne)',11),(107,'2021-05-18 18:39:58.733000','Ma stanowić potwierdzenie mojego osądu.','2021-09-20 11:54:17.993000',2,'Dowód',11),(139,'2021-05-19 21:20:59.603000','Krótkie wprowadzenie, które ma być przyczyną opisywania \"czegoś\".','2021-05-19 21:20:59.603000',0,'Wprowadzenie',18),(141,'2021-05-19 21:20:59.613000','Należy opisywać \"coś\" używając wielu przymiotników, tak by wprowadzić w określony schemat myślowy','2021-05-19 21:20:59.613000',1,'Opisywanie',18),(143,'2021-05-19 21:20:59.622000','Poprzednio zbudowany schemat myśłowy należy złamać czymś kompletnie przeciwstawnym co jednak może pasować do opisu.','2021-05-19 21:20:59.622000',2,'Złamanie',18),(158,'2021-05-26 19:46:27.240000','Przedstawia się swoje stanowisko na jakiś temat','2021-05-26 19:46:27.240000',0,'Teza',19),(160,'2021-05-26 19:46:27.240000','Przytoczenie pierwszego argumenty, który ma potwierdzić tezę','2021-05-26 19:46:27.240000',1,'Pierwszy argument',19),(162,'2021-05-26 19:46:27.255000','Drugi argument wraz z pierwszym argumentem mają tworzyć logiczne potwierdzenie tezy','2021-05-26 19:46:27.255000',2,'Drugie argument',19),(164,'2021-05-26 19:46:27.271000','Wspomina się o czymś co łączy te dwa argumenty i kompletnie wywraca tezę, pokazując tym samym widzowi, że został nabrany ','2021-05-26 19:46:27.271000',3,'Powiązanie',19),(202,'2021-05-28 19:27:09.302000','Krótkie wprowadzenie, które ma wprowadzić widza do zaistniałego zdarzenia.','2021-07-26 07:51:16.178000',0,'Wprowadzenie',22),(204,'2021-05-28 19:27:09.313000','Należy przedstawić jakieś zdarzenie i powtórzyć je 2-3 razy. Zdarzenia te mają tworzyć schemat i powinny wzbudzać jakieś emocje. Powótrki mogą być na stałym poziomie i mogą mięć tendencję wzrostową.','2021-07-26 07:51:16.180000',1,'Powtarzanie zdarzenia',22),(206,'2021-05-28 19:27:09.322000','W ostatniej powtórce należy złamać schemat wynikający z poprzednich powtórek poprzez np. ukrytą informację.','2021-07-26 07:51:16.181000',2,'Łamiąca powtórka',22),(207,'2021-05-28 19:39:18.817000','Nakreślenie nietypowego stanu rzeczy, który musi z czegoś wynikać','2021-09-20 13:51:36.832000',0,'Skutek',20),(209,'2021-05-28 19:39:18.826000','Powód przez który nastąpił stan rzeczy z poprzedniego bloku. Zawiera w sobie zarówno temat łączący jak i pozorny.','2021-09-20 13:51:36.837000',1,'Przyczyna',20),(211,'2021-05-28 19:39:18.835000','Moje stanowikso w tej sprawie. Wzmianka o uczuciach jakie mi towrzyszą doda trochę realizmu i zaciekawi.','2021-09-20 13:51:36.842000',2,'Moje uczucia',20),(213,'2021-05-28 19:39:18.844000','Ukryta informacja lub niedoprecyzowanie, które zawiera w sobie temat komediowy.','2021-09-20 13:51:36.846000',3,'Ukryta informacja',20),(214,'2021-05-28 19:46:02.868000','Należy nabrać widza, że będzie się mówić na temat pozorny, kiedy tak naprawdę będzie się mówić na temat komediowy.','2021-09-13 12:46:20.420000',0,'Wprowadzenie naprowadzające',47),(218,'2021-05-28 19:46:02.886000','Wymienić pare (2-3) argumentów wspólnych dla tematu pozornego i komediowego','2021-09-13 12:46:20.475000',1,'Wymienianie arguemntów',47),(220,'2021-05-28 19:46:02.896000','Ostatni z wymienianych argumentów powinien stać w dużej sprzeczności z tematem pozornym i powinno z niego jasno wynikać, że mówiło się cały czas o temacie komediowym.','2021-09-13 12:46:20.481000',2,'Złamanie oczekiwania',47),(232,'2021-07-13 17:34:01.040000','Krótkie wprowadzenie, które ma być przyczyną zaistniałego dalej stereotypu.','2021-07-13 17:34:01.040000',0,'Wprowadzenie',24),(234,'2021-07-13 17:34:01.048000','Tworzenie sytuacji, która jest powiązana z stereotypem odnośnie pierwszego znaczenia słowa.','2021-07-13 17:34:01.048000',1,'Stereotyp powiązany z pierwszym znaczeniem',24),(236,'2021-07-13 17:34:01.055000','Ujawnienie słowa o podwójnym znaczeniu.\nSłowo to powinno tracić logikę względem pierwszego znaczenia, a zyskiwać wzgłedem drugiego.','2021-07-13 17:34:01.055000',2,'Słowo o podówjnym znaczeniu',24),(237,'2021-07-13 18:08:58.729000','Należy zadeklarować przeciwstawność pewnych elementów, których pochodne też powinny być z sobą przeciwstawne.','2021-07-13 18:08:58.729000',0,'Deklaracja przeciwstawności',49),(239,'2021-07-13 18:08:58.736000','Przedstawienie pierwszego elementu, który faktycznie mieści się po jednej stronie rzekomej przeciwstawności. ','2021-07-13 18:08:58.736000',1,'Pierwszy element po pierwszej stronie ',49),(241,'2021-07-13 18:08:58.743000','Przedstawienie drugiego elementu, który co prawda mieści się w zadeklarowanej przeciwstawności ale w tej rzekomej już nie.','2021-07-13 18:08:58.743000',2,'Drugi element też po pierwszej stronie',49),(242,'2021-07-13 18:36:59.125000','Należy przedstawić jakąś zasadę z przeszłości (wykonywanie pewnej czynności) i jej rezultaty','2021-11-18 15:22:42.921000',0,'Kiedyś',29),(244,'2021-07-13 18:36:59.132000','Stwierdzenie, że zasada ta jest tak naprawdę kłamstwem albo nie jest już aktualna.','2021-09-20 13:37:59.098000',1,'Niedziałanie zasady',29),(246,'2021-07-13 18:36:59.132000','Zaznacza się, że obecnie już ta zasada nie działa i przedstawia się jej odmienny wynik','2021-11-18 15:22:42.922000',1,'Dziś',29),(248,'2021-07-13 18:36:59.139000','Stanowi naruszenie komediowe. \nMoże to być m. in.: \n-> miejsce \n-> czas \n-> osoba ','2021-11-18 15:22:42.923000',2,'Ukryta informacja',29),(254,'2021-07-13 18:56:40.673000','Nastąpiło jakieś zdarzenie z zewnątrz.','2021-07-13 18:56:40.673000',0,'Akcja',46),(256,'2021-07-13 18:56:40.680000','Reakcja na te zewnętrzne zdarzenie','2021-07-13 18:56:40.680000',1,'Reakcja',46),(258,'2021-07-13 18:56:40.688000','Stanowi naruszenie komediowe. \nMoże to być m. in.: \n-> miejsce \n-> czas \n-> osoba ','2021-07-13 18:56:40.688000',2,'Ukryta informacja',46),(359,'2021-07-19 21:39:30.682000','Nastąpiło jakieś zdarzenie i rezultat, który był bardzo nieporządany','2021-07-19 21:39:30.682000',0,'Zdarzenie i rezultat',67),(361,'2021-07-19 21:39:30.684000','Stanowi naruszenie komediowe. \nMoże to być m. in.: \n-> miejsce \n-> czas \n-> osoba ','2021-07-19 21:40:38.145000',2,'Ukryta informacja',67),(362,'2021-07-19 21:39:30.684000','Z zdarzenia wyciągnęło się wnioski i gdy sytuacja się powtórzyła to zareagowało się inaczej','2021-07-19 21:39:30.684000',1,'Wyciągnięcie wniosków',67),(371,'2021-07-20 16:25:34.347000','Ktrótkie wprowadznie, które jest próbą przkonywania o tym, że oskarżenie (kolejny blok) jest nieprawdą.','2021-07-20 16:25:34.347000',0,'Kontekst sytuacji',72),(372,'2021-07-20 16:25:34.349000','Otwarte niezgodzenie się z postawionym wczesniej oskarżeniem','2021-07-20 16:25:34.349000',2,'Zaprzeczenie',72),(376,'2021-07-20 16:25:34.349000','Oskarżenie wymierzone w naszym kierunku przez kogoś z zewnątrz','2021-07-20 16:25:34.349000',1,'Oskarżenie',72),(377,'2021-07-20 16:25:34.356000','Zaszyta w zaprzeczniu informacja, która jednak stanowi prawdziwość oskarżenia','2021-07-20 16:25:34.356000',3,'Ukryte potwierdzenie',72),(379,'2021-07-20 21:16:43.197000','Ma świadczyć o pewności dowdu i ma zawierać w sobie naruszenie komediowe.\nTak więc tematem komediowym jest Pewność, a naruszeniem komediowym temat będący w relacji z tematem łączącym','2021-09-20 11:54:17.997000',3,'Ukryta informacja',11),(413,'2021-07-26 07:50:49.213000','Stanowi naruszenie komediowe. \nMoże to być m. in.: \n-> miejsce \n-> czas \n-> osoba ','2021-07-26 07:51:16.158000',3,'Ukryta informacja',22),(417,'2021-08-24 17:26:45.029000','Krótkie wprowadzenie, które ma być przyczyną opisywania \"czegoś\".','2021-08-24 17:26:45.029000',0,'Wprowadzenie',17),(418,'2021-08-24 17:26:45.029000','Poprzednio zbudowany schemat myślowy należy złamać czymś przeciwstawnym co kompletnie nie pasuje do opisu.','2021-08-24 17:26:45.029000',2,'Szybkie złamanie ',17),(419,'2021-08-24 17:26:45.030000','Należy wymienić przymiotnik lub przymiotniki opisujące dany podmiot.','2021-08-24 17:26:45.030000',1,'Przymiotniki opisujące',17),(420,'2021-08-24 21:21:34.625000','Na samym początku podaje się temat komiediowy, nie ukrywa się go jak to zwykle bywa.','2021-08-24 21:21:34.625000',0,'Stwierdzenie',83),(421,'2021-08-24 21:21:34.626000','Podaje się temat łączący jako powód. ','2021-08-24 21:21:34.626000',1,'Powód',83),(422,'2021-08-24 21:21:34.627000','Wymienia się dowody, które są tematami pozornymi tematu pozornego. Ważne jest jednak to by w kontekście stwierdzenia, który jest tematem komiediowym były one jak najbardziej absurdalne.','2021-08-24 21:21:34.627000',2,'Dowód',83),(423,'2021-08-26 20:59:48.731000','Tutaj wypisać drugą grupę tematów czyli:\n-> temat pozorny\n-> temat łączący\n-> temat komediowy','2021-08-26 20:59:48.731000',3,'Druga grupa tematów',84),(424,'2021-08-26 20:59:48.724000','Standardowo buduje się historię by wkręcić widza w odpowiedni tok myślowy.','2021-08-26 20:59:48.724000',1,'Zdarzenie nakierowujące na temat pozorny',84),(425,'2021-08-26 20:59:48.724000','Krótkie wprowadzenie widza do zaistniałego zdarzenia.','2021-08-26 20:59:48.724000',0,'Wprowadzenie',84),(426,'2021-08-26 20:59:48.724000','Odkrywa się temat komediowy, który jest też zarazem tematem łączącym innej grupy tematów lub zawiera w sobie ten temat łączący. ','2021-08-26 20:59:48.724000',2,'Temat komediowy -> temat łączący',84),(430,'2021-09-20 12:35:57.508000','Zarzut w kogoś kierunku. Jest to temat łączący. Zarzut może być przedstawiony w formie podejrzenia bądź też całkowitej pewności.','2021-11-18 14:55:42.792000',0,'Zarzut',86),(431,'2021-09-20 12:35:57.510000','Przedstawienie swoich uczuć (lub innych) oraz swojego stanowiska na ten temat.\nMoże fajnie podkręcić żart.\nPowinno być krótkie i zaraz po nim należy przypomnieć zarzut.','2021-11-18 14:55:42.799000',1,'Satnowisko (opcjonalne)',86),(432,'2021-09-20 12:35:57.511000','Przedstawia się okoliczności i wspólnie wykonywaną czynność do dowodu potwierdzającego dany zarzut.\nI one  już same w sobie są dowodem na zarzut i wynika z nich, że ja sam nie jestem nic lepszy (bo robiliśmy to razem).','2021-11-18 14:55:42.800000',2,'Nic lepszy',86),(433,'2021-09-20 12:35:57.511000','Jest czynnością, którą wykonała dana osoba, a ja już nie i która również stanowi dowód na postawiony zarzut.','2021-11-18 14:55:42.801000',3,'Dowód',86),(449,'2021-10-11 14:01:50.044000',NULL,'2021-10-11 14:01:50.044000',0,NULL,23);
