INSERT INTO `structure_block_copy_for_test` VALUES (98,'2021-05-18 14:56:23.730000','Krótkie wprowadzenie, które ma być przyczyną wyolbrzymionej sytuacji.','2021-05-18 14:56:23.730000',0,'Wprowadzenie',16),(100,'2021-05-18 14:56:23.744000','Należy jakąś sytuacje wyolbrzymiać, nadając jej dużego znaczenia. Powinna zachaczać o tematyke, która zainteresuje widza np. jakaś intryga lub przydatna informacja.','2021-05-18 14:56:23.744000',1,'Budowanie oczekiwań u widza',16),(102,'2021-05-18 14:56:23.755000','Poprzednio zbudowane oczekiwania należy złamać czymś małym, trywialnym.','2021-05-18 14:56:23.755000',2,'Złamanie',16),(103,'2021-05-18 18:39:58.710000','podejrzewanie kogoś o coś bądź też powiedznie prawdy o kimś, której się jest pewnym.','2021-07-20 16:14:32.252000',0,'Teoria / Stwierdzenie',11),(105,'2021-05-18 18:39:58.721000','Przedstawienie swoich uczuć (lub innych) oraz swojego stanowiska na ten temat.\nMoże fajnie podkręcić żart.','2021-07-20 21:17:53.632000',1,'Satnowisko (opcjonalne)',11),(107,'2021-05-18 18:39:58.733000','Ma stanowić potwierdzenie mojego osądu','2021-07-20 21:16:43.189000',2,'Dowód',11),(139,'2021-05-19 21:20:59.603000','Krótkie wprowadzenie, które ma być przyczyną opisywania \"czegoś\".','2021-05-19 21:20:59.603000',0,'Wprowadzenie',18),(141,'2021-05-19 21:20:59.613000','Należy opisywać \"coś\" używając wielu przymiotników, tak by wprowadzić w określony schemat myślowy','2021-05-19 21:20:59.613000',1,'Opisywanie',18),(143,'2021-05-19 21:20:59.622000','Poprzednio zbudowany schemat myśłowy należy złamać czymś kompletnie przeciwstawnym co jednak może pasować do opisu.','2021-05-19 21:20:59.622000',2,'Złamanie',18),(158,'2021-05-26 19:46:27.240000','Przedstawia się swoje stanowisko na jakiś temat','2021-05-26 19:46:27.240000',0,'Teza',19),(160,'2021-05-26 19:46:27.240000','Przytoczenie pierwszego argumenty, który ma potwierdzić tezę','2021-05-26 19:46:27.240000',1,'Pierwszy argument',19),(162,'2021-05-26 19:46:27.255000','Drugi argument wraz z pierwszym argumentem mają tworzyć logiczne potwierdzenie tezy','2021-05-26 19:46:27.255000',2,'Drugie argument',19),(164,'2021-05-26 19:46:27.271000','Wspomina się o czymś co łączy te dwa argumenty i kompletnie wywraca tezę, pokazując tym samym widzowi, że został nabrany ','2021-05-26 19:46:27.271000',3,'Powiązanie',19),(202,'2021-05-28 19:27:09.302000','Krótkie wprowadzenie, które ma wprowadzić widza do zaistniałego zdarzenia.','2021-05-28 19:27:09.302000',0,'Wprowadzenie',22),(204,'2021-05-28 19:27:09.313000','Należy przedstawić jakieś zdarzenie i powtórzyć je 2-3 razy. Zdarzenia te mają tworzyć schemat i powinny wzbudzać jakieś emocje. Powótrki mogą być na stałym poziomie i mogą mięć tendencję wzrostową.','2021-05-28 19:27:09.313000',1,'Powtarzanie zdarzenia',22),(206,'2021-05-28 19:27:09.322000','Należy złamać schemat wynikający z poprzednich powtórek poprzez np. ukrytą informację.','2021-05-28 19:27:09.322000',2,'Złamanie schematu',22),(207,'2021-05-28 19:39:18.817000','Nakreślenie nietypowego stanu rzeczy, który musi z czegoś wynikać','2021-05-28 19:39:18.817000',0,'Skutek',20),(209,'2021-05-28 19:39:18.826000','Powód przez który nastąpił stan rzeczy z poprzedniego bloku','2021-05-28 19:39:18.826000',1,'Przyczyna',20),(211,'2021-05-28 19:39:18.835000','Moje stanowikso w tej sprawie. Wzmianka o uczuciach jakie mi towrzyszą doda trochę realizmu i zaciekawi.','2021-05-28 19:39:18.835000',2,'Moje uczucia',20),(213,'2021-05-28 19:39:18.844000','Ukryta informacja lub niedoprecyzowanie\n\nStanowi naruszenie komediowe.\nMoże to być m. in.:\n-> miejsce\n-> czas\n-> osoba','2021-05-28 19:39:18.844000',3,'Ukryta informacja',20),(214,'2021-05-28 19:46:02.868000','Znalezienie tematu A i tematu B, które choć dotyczą zupełnie innych spraw to mają w sobie kilka podobieństw.','2021-05-28 19:46:02.868000',0,'Połączenie',47),(216,'2021-05-28 19:46:02.877000','Należy nabrać widza, że będzie się mówić na temat A, kiedy tak naprawdę będzie się mówić na temat B','2021-05-28 19:46:02.877000',1,'Wprowadzenie naprowadzające',47),(218,'2021-05-28 19:46:02.886000','Wymienić pare (2-3) argumentów wspólnych dla tematu A i B','2021-05-28 19:46:02.886000',2,'Wymienianie arguemntów',47),(220,'2021-05-28 19:46:02.896000','Ostatni z wymienianych argumentów powinien stać w dużej sprzeczności z tematem A i powinno z niego jasno wynikać, że mówiło się cały czas o temacie B.','2021-05-28 19:46:02.896000',3,'Złamanie oczekiwania',47),(232,'2021-07-13 17:34:01.040000','Krótkie wprowadzenie, które ma być przyczyną zaistniałego dalej stereotypu.','2021-07-13 17:34:01.040000',0,'Wprowadzenie',24),(234,'2021-07-13 17:34:01.048000','Tworzenie sytuacji, która jest powiązana z stereotypem odnośnie pierwszego znaczenia słowa.','2021-07-13 17:34:01.048000',1,'Stereotyp powiązany z pierwszym znaczeniem',24),(236,'2021-07-13 17:34:01.055000','Ujawnienie słowa o podwójnym znaczeniu.\nSłowo to powinno tracić logikę względem pierwszego znaczenia, a zyskiwać wzgłedem drugiego.','2021-07-13 17:34:01.055000',2,'Słowo o podówjnym znaczeniu',24),(237,'2021-07-13 18:08:58.729000','Należy zadeklarować przeciwstawność pewnych elementów, których pochodne też powinny być z sobą przeciwstawne.','2021-07-13 18:08:58.729000',0,'Deklaracja przeciwstawności',49),(239,'2021-07-13 18:08:58.736000','Przedstawienie pierwszego elementu, który faktycznie mieści się po jednej stronie rzekomej przeciwstawności. ','2021-07-13 18:08:58.736000',1,'Pierwszy element po pierwszej stronie ',49),(241,'2021-07-13 18:08:58.743000','Przedstawienie drugiego elementu, który co prawda mieści się w zadeklarowanej przeciwstawności ale w tej rzekomej już nie.','2021-07-13 18:08:58.743000',2,'Drugi element też po pierwszej stronie',49),(242,'2021-07-13 18:36:59.125000','Należy przedstawić jakąś zasadę. Może być to prawda ukształtowana na tle swojego doświadczenia lub powszechnej wiedzy (społecznej).','2021-07-13 18:36:59.125000',0,'Ogłoszenie jakiejś zasady',29),(244,'2021-07-13 18:36:59.132000','Stwierdzenie, że zasada ta jest tak naprawdę kłamstwem albo nie jest już aktualna.','2021-07-13 18:36:59.132000',1,'Niedziałanie zasady',29),(246,'2021-07-13 18:36:59.139000','Dowody na to czemu zasada nie jest (już) prawdziwa.','2021-07-13 18:36:59.139000',2,'Dowód',29),(248,'2021-07-13 18:36:59.146000','Stanowi naruszenie komediowe. \nMoże to być m. in.: \n-> miejsce \n-> czas \n-> osoba ','2021-07-13 18:36:59.146000',3,'Ukryta informacja',29),(254,'2021-07-13 18:56:40.673000','Nastąpiło jakieś zdarzenie z zewnątrz.','2021-07-13 18:56:40.673000',0,'Akcja',46),(256,'2021-07-13 18:56:40.680000','Reakcja na te zewnętrzne zdarzenie','2021-07-13 18:56:40.680000',1,'Reakcja',46),(258,'2021-07-13 18:56:40.688000','Stanowi naruszenie komediowe. \nMoże to być m. in.: \n-> miejsce \n-> czas \n-> osoba ','2021-07-13 18:56:40.688000',2,'Ukryta informacja',46),(359,'2021-07-19 21:39:30.682000','Nastąpiło jakieś zdarzenie i rezultat, który był bardzo nieporządany','2021-07-19 21:39:30.682000',0,'Zdarzenie i rezultat',67),(361,'2021-07-19 21:39:30.684000','Stanowi naruszenie komediowe. \nMoże to być m. in.: \n-> miejsce \n-> czas \n-> osoba ','2021-07-19 21:40:38.145000',2,'Ukryta informacja',67),(362,'2021-07-19 21:39:30.684000','Z zdarzenia wyciągnęło się wnioski i gdy sytuacja się powtórzyła to zareagowało się inaczej','2021-07-19 21:39:30.684000',1,'Wyciągnięcie wniosków',67),(371,'2021-07-20 16:25:34.347000','Ktrótkie wprowadznie, które jest próbą przkonywania o tym, że oskarżenie (kolejny blok) jest nieprawdą.','2021-07-20 16:25:34.347000',0,'Kontekst sytuacji',72),(372,'2021-07-20 16:25:34.349000','Otwarte niezgodzenie się z postawionym wczesniej oskarżeniem','2021-07-20 16:25:34.349000',2,'Zaprzeczenie',72),(376,'2021-07-20 16:25:34.349000','Oskarżenie wymierzone w naszym kierunku przez kogoś z zewnątrz','2021-07-20 16:25:34.349000',1,'Oskarżenie',72),(377,'2021-07-20 16:25:34.356000','Zaszyta w zaprzeczniu informacja, która jednak stanowi prawdziwość oskarżenia','2021-07-20 16:25:34.356000',3,'Ukryte potwierdzenie',72),(379,'2021-07-20 21:16:43.197000','Stanowi naruszenie komediowe.\nMoże to być m. in.:\n-> miejsce\n-> czas\n-> osoba','2021-07-20 21:16:43.197000',3,'Ukryta informacja',11),(381,'2021-07-21 08:36:31.946000','only for test.','2021-07-21 08:36:31.946000',0,'test',NULL),(383,'2021-07-21 08:49:22.200000',NULL,'2021-07-21 08:49:22.200000',0,NULL,NULL),(384,'2021-07-21 09:36:37.131000','only for test.','2021-07-21 09:36:37.131000',0,'test',NULL),(404,'2021-07-22 20:11:55.925000','dfsfdsffds','2021-07-22 20:11:55.925000',1,'blok 2',79),(405,'2021-07-22 20:11:55.921000','dsddds','2021-07-22 20:11:55.921000',0,'blok 1',79),(406,'2021-07-22 20:11:55.925000',NULL,'2021-07-22 20:11:55.925000',2,'blok 3',79),(407,'2021-07-23 07:40:03.310000','11','2021-07-23 07:40:03.310000',0,'11',80),(408,'2021-07-23 07:40:03.310000','13','2021-07-23 07:40:03.310000',2,'13',80),(409,'2021-07-23 07:40:03.310000','12','2021-07-23 07:40:03.310000',1,'12',80),(410,'2021-07-23 07:40:25.288000','21','2021-07-23 07:40:25.288000',0,'21',81),(411,'2021-07-23 07:40:25.288000','23','2021-07-23 07:40:25.288000',2,'23',81),(412,'2021-07-23 07:40:25.288000','22','2021-07-23 07:40:25.288000',1,'22',81);
