INSERT INTO `structure_copy_for_test` VALUES (11,'Teoria / Stwierdzenie i Dowód','Jest przedstwiona teoria (lub stwierdznie) i na jej potwierdzenie podaje się dowód. W tle zagnieżdzona jest ukryta informacja będąca naruszeniem komediowym.\nBlok \"Dowód\" i \"Ukryta informacja\" mogą występować w dowolnej kolejności.\nNa dany moment struktura ta dopuszcza również i stwierdzenie zamiast dowodu. Nie chcę rozdzielać, gdyż róznica wydaje mi się być znikoma w działaniu.','2020-10-31 23:28:26','2021-07-20 21:16:43'),(13,'Problem we mnie','Żart buduje się wokół narzekania na kogoś lub na coś. Na samym końcu odkrywa się informacje, która jednozacznie określa, że to problem od samego początku był we mnie, a reakacja innych była uzasadniona.','2020-11-01 19:30:36','2020-11-01 19:30:36'),(14,'Stopniowe budowanie napięcia','Jest to pewnego rodzaju zapętlenie (najlepiej do trzech lub czterech powtórzeń). Przy każdym kolejnym powtórzeniu jakaś emocja w żarcie musi narastać. Struktura ta choć nie zawiera konfliktu komediowego to świetnie spełnia się jako tło do budowania ciekawości i napięcia u widza.','2020-11-03 23:15:03','2020-11-03 23:15:03'),(16,'Złamanie wielkich oczekiwań','Należy wzbudzić w widzu ciekawość i ją podsycać tak aby miał duże oczekiwania co do końca historii by na końcu złamać jego oczekiwania czymś bardzo prozaicznym, minimalnym.','2020-11-06 23:16:31','2020-11-06 23:16:31'),(17,'Krótka sprzczeność','Opisuje sie przymiotnikami kompletnie nie pasującymi lub przeciwstawnymi do obiektu opisywanego. Ważnym jest by równeż ekspresja była zgodna z opisywaniem.','2020-11-08 23:00:01','2020-11-08 23:00:01'),(18,'Opis i przeciwstawność','Należy coś opisywać tak by nakierować widza na odpowiedni schemat myślowy by na końcu go złamać czymś kompletnie przeciwstawnym do opisu','2020-11-08 23:14:25','2021-05-19 21:21:00'),(19,'Drugie powiązane z pierwszym','Przedstawia się pierwsze zagadnienie, a potem drugie, a następnie pokazuje się polączenie między nimi. Ważnym jest by te połączenie nie było zauważalne na pierwszy rzut oka.','2020-11-08 23:22:08','2021-05-26 19:46:27'),(20,'Skutek i Przyczyna','Wpierw podaje się skutek, a potem przyczynę. Powinno to przedstawiać jakiś typowy powszechnie znany problem.\nDopiero podczas mowy o swoich uczuciach jakie temu towarzyszą/ towarzyszyły należy zaszyć ukrytą wcześniej informację tak by wyszło naruszenie komediowe.\nJednak można też wpierw przedstawić swoje uczucia/stanowisko, a dopiero potem przyczynę i to w niej zaszyć ukrytą informację.','2020-11-08 23:28:56','2021-05-28 19:39:19'),(22,'Zasada trzech powtórzeń','Dwukrotnie albo trzykrotnie powtarza się ten sam schemat, by za trzecim razem go złamać.\nZasada jest o tyle dobra bo poprzez powtóki widz lepiej zapamięta istotne informacje (te z powtórek), więc jest większa szansa, że załapie żart.\nWprowadzenie może być moją opinią/ oświadczeniem na jakiś temat.','2020-11-17 21:18:07','2021-05-28 19:27:09'),(23,'Zwierzęta i ludzkie zachowania','Przypisywanie zwierzętom ludzkich zachowań bardzo częto dużo wnosi do żartu i potrafi bardzo mocno go wnieść. Może to być używane w kontekście przełamania jak i również ciała żartu.','2020-11-17 21:21:33','2020-11-17 21:21:33'),(24,'Podwójne znaczenie słowa','Jedno słowo ma dwa znaczenia i przez to wprowadza się widza na pewien schemat myślowy związany z pierwszym znaczeniem słowa by potem te słowo ujawnić co ma poskutkować zależnością wgledem pierwszego znaczenia słowa ale logiką wzgłedem drugiego.','2020-11-17 21:23:49','2021-07-13 17:34:01'),(26,'Pochwała - pocisk','Buduje się złudzenie chwalenia kogoś lub czegoś by potem w przełamaniu ostatecznie wychodzi pocisk. Dobrze się sprawdza gdy jako cel weźmie się widownię.','2020-11-20 23:08:36','2020-11-20 23:08:36'),(27,'Złamanie normy społecznej','Celem tu jest złamanie powszchnie znanej normy społecznej. Poprzez odwołanie się od znanej normy społecznej, widzowie przyjmują pewne założenia i dzięki temu potem jest je łatwo przełamać.','2020-11-20 23:12:17','2020-11-20 23:12:17'),(28,'Nic lepszy','W ciele dowcipu należy kogoś krytykować i oceniać by w przełamaniu wyszło, że samemu nie jest się lepszym albo nawet jest się gorszym.','2020-11-20 23:21:59','2020-11-20 23:21:59'),(29,'Niedziałająca zasada','Wpierw przedstawia się jakąś zasadę przyczynowo skutkową. Może być to zasada ukształtowana na tle swojego doświadczenia lub powszechnej wiedzy (społecznej). \nNastępnie stwierdza się, że zasada ta jest tak naprawdę kłamstwem albo nie jest już aktualna.\nNa samym końcu dostarcza się dowód na to czemu zasada nie jest (już) prawdziwa. Dowód ten zawiera również informację, która stanowi naruszenie komediowe.','2020-11-20 23:28:54','2021-07-13 18:36:59'),(46,'Akcja i Reakcja','Nagle następuje jakaś niespodziewana akcja, która niewątpliwie wymaga reakcji z mojej strony. Przedstawia się podjętą reakcję, która powinna być zgodna z oczekiwaniam widza. Na samym końcu podaje się ukrytą informację, któa powinna kompletnie złamać poprzednio rzekomo potwierdzone oczekiwania widza.','2021-05-27 22:03:12','2021-07-13 18:56:41'),(47,'Zasada trzeciego argumentu','','2021-05-28 18:32:11','2021-05-28 18:39:36'),(49,'Pozorna przeciwstawność','Na samym początku deklaruje się pewną przeciwstawność. Zgodnie z domysłem widza z tej przeciwstanosci powinna wynikać inna przeciwstawność. Przedstawia się pierszwy element, który faktycznie mieści się po jednej z stron zarówno zadeklarowanej jak i domniemanej przeciwstawności. Drugi element choć co prawda mieści się faktycznie po drugiej stronie zadeklarowanej przeciwstawności to w przypadku domniemanej przeciwstawności jest po tej samej stronie co i pierwszy element.','2021-07-13 18:08:59','2021-07-13 18:08:59'),(67,'Wyciągnięcie Wniosku','','2021-07-19 21:39:31','2021-07-19 21:39:31'),(72,'Potwierdzenie przez zaprzeczenie','','2021-07-20 16:25:34','2021-07-20 16:25:34'),(79,'struktura','','2021-07-22 20:11:56','2021-07-22 20:11:56'),(80,'test 1','test 1','2021-07-23 07:40:03','2021-07-23 07:40:03'),(81,'test 2','test 2','2021-07-23 07:40:25','2021-07-23 07:40:25');
